(1,1,'Quality');
INSERT INTO `ps_product_lang` VALUES
(1001,1,1,'','<p>najlepszy produkt</p>','produkt-super','','','','produkt super','','','',''),
(1005,1,1,'','Wytwarzane z najwyższej jakości ziaren kakao zapewnia wyborny smak i niezrównany aromat. Jego ciemna barwa i wysoka wydajność gwarantują najwyższą jakość napojów i wypieków.','kakao-decomorreno-150g','','','','Kakao Decomorreno 150g','','','',''),
(1006,1,1,'Skład:<br />sól morska, masło shea*, pomidory*, skrobia kukurydziana*, prażona cebula*, seler*, 2,5% sproszkowane mięso wołowe*, skarmelizowany cukier*, kurkuma*, ekstrakt z drożdży,  naturalny aromat, lubczyk liście*, czosnek*, pieprz*.<br />* produkty pochodzące z kontrolowanych, certyfikowanych upraw ekologicznych','Kostki rosołowe to kompozycja ekologicznych ziół i przypraw polecana do przyrządzania zup, rosołów, sosów, makaronów i innych potraw. Kostki nie zawierają glutaminianu sodu czy oleju palmowego. Z ich pomocą łatwo przygotujesz zdrową zupę dla całej rodziny.','ekologiczna-kostka-rosolowa-wolowa','','','','Ekologiczna kostka rosołowa wołowa','','','',''),
(1007,1,1,'','Naturalny suszony czosnek w plastrach.','czosnek-suszony-naturo-80g','','','','Czosnek suszony ,,Naturo” 80g','','','',''),
(1008,1,1,'','DIAMANT Cukier puder to bardzo drobno zmielony cukier kryształ. Jest to znakomity składnik zarówno do wypieku delikatnych i pulchnych ciast, przygotowywania lekkich kremów, bitej śmietany jak i mas serowych, makowych. Produkt ten doskonale nadaje się do ozdabiania wypieków i deserów. Świetnie również sprawdza się jako składnik lukru czy polewy, które dzięki niemu są elastyczne, nie pękają i po wyschnięciu mają intensywnie świetlisty, biały kolor.','cukier-puder-diamant-400g','','','','Cukier puder “Diamant” 400g','','','',''),
(1009,1,1,'Wartość energetyczna 23 kJ/100ml<br />Wartość energetyczna kcal 5 kcal/100ml<br />Wielkość porcji 100 ml<br />Zawartość tłuszczów (kwasy tłuszczowe nasycone) 0,2 g','Gęsty i niezwykle esencjonalny bulion o półpłynnej konsystencji. Unikalna receptura na bazie wolno gotowanej wołowiny gwarantuje doskonały smak. Sprawdzi się idealnie jako baza do zup i sosów.','bulion-w-sloiku-wolowy-winiary-160g','','','','Bulion w słoiku wołowy „Winiary” 160g','','','',''),
(1010,1,1,'','DIAMANT Cukier Biały to klasyczny cukier o charakterystycznych kryształach i doskonałej rozpuszczalności. Przeznaczony do słodzenia zimnych i gorących napojów. Doskonale nadaje się do przygotowywania ciast, deserów lub przetworów. Z powodzeniem stosowany jest również do surówek, sałatek, zup i wielu wytrawnych dań.','cukier-bialy-diamant-1kg','','','','Cukier biały “Diamant” 1kg','','','',''),
(1011,1,1,'','Gęsty i esencjonalny bulion o półpłynnej konsystencji. Unikalna receptura na bazie włoszczyzny gwarantuje doskonały smak. Pozwoli przygotować klarowny bulion oraz sprawdzi się jako bazę do zup lub sosów.','bulion-w-sloiku-warzywny-winiary-160g','','','','Bulion w słoiku warzywny „Winiary” 160g','','','',''),
(1012,1,1,'wartość energetyczna: 1700 kJ / 400 kcal, tłuszcz: 0 g, w tym kwasy tłuszczowe nasycone: 0 g, węglowodany: 100 g, w tym cukry: 100 g, białko: 0 g, sól: 0,01 g','Cukier trzcinowy powstaje z trzciny cukrowej, z której wyciska się sok. Na kolejnym etapie produkcji jest on oczyszczany i poddawany krystalizacji. Zawiera melasę dzięki której ma charakterystyczny, złocisty kolor i lekko karmelowy smak. Cukier trzcinowy znakomicie podkreśli charakter egzotycznych drinków i mleczno-owocowych koktajli. Można wykorzystać go do przygotowywania wypieków i deserów oraz słodzenia kawy – nadaje jej delikatnego, karmelowego posmaku.','cukier-trzcinowy-nierafinowany-diamant-500g','','','','Cukier trzcinowy nierafinowany “Diamant” 500g','','','',''),
(1013,1,1,'','Biały ocet winny jest doskonałym dodatkiem do sałatek, surówek oraz marynat. Poprawia również smak barszczu czerwonego, galaretek oraz potraw słodko-kwaśnych. Biały ocet winny pozytywnie wpływa na organizm, zawiera bowiem wartościowe składniki, takie jak witaminy oraz makro- i mikroelementy (potas, fosfor, magnez).','ocet-winny-z-bialego-wina-develey-500ml','','','','Ocet winny z białego wina ,,Develey” 500ml','','','',''),
(1014,1,1,'sol 0,1 g<br />węglowodany (cukry) 2,5<br />błonnik  0,6 g<br />tłuszcz 2,1 g<br />węglowodany 2,6 g','Bogata w białko roślinna alternatywa mleka dla tych, którzy stawiają na smak i dobre nawyki. Jest źródłem białka i wapnia, dzięki czemu stanowi doskonałe urozmaicenie i dopełnienie codziennej diety. Perfekcyjnie się spienia!','napoj-sojowy-inka-1l','','','','Napój sojowy ,,Inka” 1l','','','',''),
(1015,1,1,'','Garść pistacji to wspaniała, zdrowa przekąska. Ze wszystkich orzechów to właśnie pistacje zawierają najwięcej potasu. Są też bogate w wapń, fosfor, witamy z grupy B, witaminę E i antyoksydanty.','orzechy-pistacjowe-solone-japar-opak-100g','','','','Orzechy pistacjowe solone ,,JAPAR” opak. 100g','','','',''),
(1016,1,1,'','Orzechy włoskie zawierają pełnowartościowe białko, co więcej, trzy orzechy pokrywają zapotrzebowanie dzienne na kwasy omega-3, dzięki czemu mogą zastępować ryby w diecie. Nie powinno ich zabraknąć w zdrowej, zbilansowanej diecie.','orzechy-wloskie-luskane-japar-opak-100g','','','','Orzechy włoskie łuskane ,,JAPAR” opak. 100g','','','',''),
(1017,1,1,'','Orzechy laskowe na tle innych orzechów wyróżniają się ze względu na dużą zawartość witaminy E, tzn. witaminy młodości i płodności. Oczywiście, prócz niej zawierają mnóstwo innych witamin, a wśród nich witaminy z grupy B, a także minerały takie jak potas, wapń i fosfor. Mogą być pomocne w walce z problemami związanymi z nadciśnieniem, miażdżycą lub zakrzepami. Stanowią pyszny dodatek do wyrobów czekoladowych, babek, ciast, tortów i masła orzechowego. Możesz także skusić się na domowej roboty nalewkę z orzecha laskowego.','orzechy-laskowe-luskane-japar-100g','','','','Orzechy laskowe łuskane ,,Japar” 100g','','','',''),
(1018,1,1,'','To wspaniały dodatek do tradycyjnych polskich dań. Pyzy świetnie łączą się zarówno ze słodkimi jak i wytrawnymi sosami.','pyzy-babci-tereni','','','','Pyzy ,,Babci Tereni”','','','',''),
(1019,1,1,'','Pierogi ze szpinakiem są znakomitą propozycją dla miłośników dań wegetariańskich.  Szpinak – stanowiący podstawę farszu – to obfite źródło witamin, wapnia i żelaza. Lekkość dania oswaja tradycyjność pierogów z walorami smakowymi szpinaku. Pierogi ze szpinakiem znakomicie czują się w towarzystwie sosu czosnkowego. Dla uzupełnienia takiego posiłku w porcję warzyw, śmiało można podać również surówkę z gamy produktów Grześkowiak.','pierogi-ze-szpinakiem-i-serem-grzeskowiak-400g','','','','Pierogi ze szpinakiem i serem “Grześkowiak” 400g','','','',''),
(1020,1,1,'','Orzechy nerkowca to źródło białka i węglowodanów. Zawierają cynk i kwas foliowy. To wspaniały dodatek do deserów, makaronów i sałatek.','orzechy-nerkowca-japar-opak-100g','','','','Orzechy nerkowca ,,JAPAR” opak. 100g','','','',''),
(1021,1,1,'','','maka-kostrzyn-krupczatka-1kg','','','','Mąka “Kostrzyn” krupczatka 1kg','','','',''),
(1022,1,1,'','','maka-kostrzyn-poznanska-1kg','','','','Mąka “Kostrzyn” poznańska 1kg','','','',''),
(1023,1,1,'','','maka-kostrzyn-luksusowa-1kg','','','','Mąka “Kostrzyn” luksusowa 1kg','','','',''),
(1024,1,1,'','Jest używana do konserwowania żywności od najdawniejszych czasów. Ma naturalne pochodzenie, jest wydobywana w kopalniach soli i pochodzi ze złóż sprzed około 250 milionów lat. Nie jest poddawana żadnej obróbce chemicznej. Z uwagi na naturalne pochodzenie może mieć barwę całkowicie białą, ale także szarawą lub różową.','sol-kamienna-do-przetworow-klodawska-11-kg','','','','Sól kamienna do przetworów ,,Kłodawska” 1,1 kg','','','',''),
(1025,1,1,'','Przyprawa do ryb jest idealna do posypywania ryby przed panierowaniem, ale również jako składnik farszu lub sosu. Uatrakcyjnia dania z ryb smażonych, pieczonych i gotowanych. Dzięki zawartości imbiru i gorczycy potrawa ma lekko pikantny smak, a użyte zioła i warzywa nadają jej charakterystyczny aromat.','przyprawa-do-ryb-japar-100g','','','','Przyprawa do ryb ,,Japar” 100g','','','',''),
(1026,1,1,'','Jest to przyprawa otrzymywana z wysuszonych owoców papryki krzewiastej, uprawianej głównie w Ameryce Południowej i Azji Południowej. Jest najostrzejszą przyprawą używaną w kuchni, swój smak zawdzięcza dużej ilości zawartej w niej kapsaicyny. Chili pobudza procesy trawienne i wzmaga apetyt.','przyprawa-chilli-japar-80g','','','','Przyprawa chilli ,,Japar” 80g','','','',''),
(1027,1,1,'','pomidory suszone 100%','pomidory-suszone-naturo-30g','','','','Pomidory suszone ,,Naturo” 30g','','','',''),
(1028,1,1,'','Papryka słodka mielona Prymat może być używana w kuchni wszechstronnie – do potraw mięsnych, sosów, twarogów, wędlin, sałatek, potraw z ryb, ryżu i drobiu. Posiada wyrazisty, a jednocześnie przyjemnie słodki smak. Nadaje potrawom wyśmienity aromat, a także piękną i intensywną barwę.','papryka-slodka-japar-100g','','','','Papryka słodka ,,Japar” 100g','','','',''),
(1029,1,1,'','Otrzymywana jest z wyselekcjonowanych, najwyższej jakości owoców papryki. Są one następnie suszone poprzez wędzenie dymem z drewna dębowego, a następnie mielone w kamiennych młynach. Przyprawa stanowi podstawę prawdziwej hiszpańskiej kuchni.','papryka-ostra-wedzona-mielona-japar-100g','','','','Papryka ostra wędzona mielona ,,Japar” 100g','','','',''),
(1030,1,1,'','Żurawina suszona wyglądem przypomina rodzynki, jednak jest zdecydowanie bardziej cierpka w smaku. To orzeźwiająca przekąska, a także dodatek do śniadań, sosów i dań głównych.','zurawina-suszona-japar-100g','','','','Żurawina suszona ,,JAPAR” 100g','','','',''),
(1031,1,1,'','Wiórki kokosowe powstają z miąższu kokosowego. To znakomity dodatek do muesli, wypieków czy koktajli.','wiorki-kokosowe-japar-opak-100g','','','','Wiórki kokosowe ,,JAPAR” opak. 100g','','','',''),
(1032,1,1,'','sól kamienna o różowym zabarwieniu, pochodząca z pakistańskiego regionu Pendżab, oddalonego od Himalajów o kilkaset kilometrów. Skład chemiczny tej soli tylko nieznacznie różni się od składu zwykłej soli kuchennej, zaś zawartość soli mineralnych jest śladowa w porównaniu z zapotrzebowaniem organizmu.','sol-himalajska-o-sole-600g','','','','Sól himalajska ,,O` sole” 600g','','','',''),
(1033,1,1,'Skład:<br />sól morska, masło shea*, skrobia kukurydziana*, cukier trzcinowy*, 4,2% sproszkowane mięso z kurczaka*, ekstrakt z drożdży, aromat naturalny (zawiera jaja), 1% tłuszcz drobiowy*, seler*, cebula*, przyprawy*, zioła*, czosnek*<br />* produkty pochodzące z kontrolowanych, certyfikowanych upraw ekologicznych','Kostki rosołowe to kompozycja ekologicznych ziół i przypraw polecana do przyrządzania zup, rosołów, sosów, makaronów i innych potraw. Kostki nie zawierają glutaminianu sodu czy oleju palmowego. Z ich pomocą łatwo przygotujesz zdrową zupę dla całej rodziny.','ekologiczna-kostka-rosolowa-drobiowa','','','','Ekologiczna kostka rosołowa drobiowa','','','',''),
(1034,1,1,'','Śliwki kojarzą nam się głównie z poprawą trawienia – i słusznie. Jednak nie każdy wie, że są źródłem witaminy A,C,E,B6 i K oraz minerałów, takich jak żelazo, miedź czy mangan. Zalecane są osobom odchudzającym się, gdyż mimo swojej wysokiej kaloryczności, zawierają mnóstwo błonnika. Możesz traktować je jako przekąskę, dodać do jogurtu, musli, a przede wszystkim do świątecznego kompotu. Spróbuj zrobić też schab ze śliwką lub pierogi z nadzieniem z tego owocu a na pewno nie pożałujesz !','sliwki-suszone-japar-150g','','','','Śliwki suszone ,,Japar” 150g','','','',''),
(1035,1,1,'','Siemię lniane można spożywać zarówno w postaci wywaru, jak i dodawać do sałatek czy wypieków. Bogate w błonnik. Znane z właściwości osłaniających przewód pokarmowy.','siemie-lniane-japar-opak-200g','','','','Siemię lniane ,,JAPAR” opak. 200g','','','',''),
(1036,1,1,'','Pieprz czarny ziarnisty używa się do zup, bulionów i marynat. Dodajemy go na początku gotowania. Pieprz jest jedną z najbardziej popularnych przypraw, niezastąpioną w każdej kuchni. Pieprz czarny jest najbardziej ostrym ze wszystkich rodzajów pieprzu, ma słodko-gorzki smak.','pieprz-czarny-ziarno-japar-100g','','','','Pieprz czarny ziarno ,,Japar” 100g','','','',''),
(1037,1,1,'Wartość odżywcza w 100 g makaronu / w porcji 50 g<br />Wartość energetyczna 1600 kJ/377 kcal / 800 kJ/188 kcal<br />Tłuszcz 2 g / 1 g<br />w tym kwasy tłuszczowe nasycone 0,6 g / 0,3 g<br />Węglowodany 75 g / 37,5 g<br />Cukry 2,7 g / 1,35 g<br />Błonnik 3,7 g / 1,85 g<br />Białko 13 g / 6,5 g<br />Sól 0,05 g / 0,025 g','Makaron produkowany na bazie jaj przepiórczych. Znakomita podstawa dań jak i dodatek do zup i sałatek.','makaron-przepiorczy-kolanko-od-kurki-przepiorki-250g','','','','Makaron przepiórczy kolanko ,,Od Kurki Przepiórki” 250g','','','',''),
(1038,1,1,'','Skład: mąka makaronowa z pszenicy zwyczajnej, Semolina mąka z pszenicy twardej Durum, świeże jaja (ok. 18%), woda, przyprawa kurkuma. Zawiera gluten.','makaron-swojski-z-4-jaj-nadwarcianskie-specjaly-250g','','','','Makaron Swojski z 4 jaj “Nadwarciańskie Specjały” 250g','','','',''),
(1039,1,1,'Wartość energetyczna<br />1476 kJ / 348 kcal<br />Białko: 6 g<br />Błonnik: 1,4 g<br />Węglowodany: 78 g<br />Tłuszcze: 1 g','Mąka ryżowa otrzymywana jest ze zmielonych i oczyszczonych ziaren ryżu. Ma kolor biały, jest bardzo delikatna i lekkostrawna. Mąkę ryżową można wykorzystać do przygotowania naleśników, ciast, bułek, pierogów.Stanowi doskonałą alternatywę dla mąki pszennej.','maka-ryzowa-melvit-1kg','','','','Mąka ryżowa ,,Melvit” 1kg','','','',''),
(1040,1,1,'','Typ 500 (poznańska) – świetnie nadaje się na pierogi i kluski, pizzę, a także do zasmażek i sosów.','maka-pszenna-poznanska-typ-500-mlyny-stoislaw-1kg','','','','Mąka pszenna poznańska typ 500 ,,Młyny Stoisław” 1kg','','','',''),
(1041,1,1,'Wartość energetyczna 1450 kJ/342 kcal<br />Tłuszcz	1,8 g<br />w tym kwasy tłuszczowe nasycone	0,4 g<br />Węglowodany 68 g<br />w tym cukry 0,5 g<br />Błonnik	2,9 g<br />Białko	12 g<br />Sól &lt;0,01 g','Mąka pszenna typ 750 chlebowa należy do typu mąk domowego wypieku chleba. Idealny element składowy przepisu na domowe pieczywo, takie jak: chałka, bułki, kajzerki. Mąka w 100% naturalna bez żadnych dodatków.','maka-pszenna-chlebowa-typ-750-mlyny-stoislaw-1kg','','','','Mąka pszenna chlebowa typ 750 ,,Młyny Stoisław” 1kg','','','',''),
(1042,1,1,'','','maka-owsiana-melvit-1kg','','','','Mąka owsiana ,,Melvit” 1kg','','','',''),
(1043,1,1,'','','maka-pszenna-na-pizze-wloska-typ-00-mlyny-stoislaw-1kg','','','','Mąka pszenna na pizzę włoską typ 00 ,,Młyny Stoisław” 1kg','','','',''),
(1044,1,1,'Zawartość węglowodanów (cukry) 100 g<br />Zawartość tłuszczów (kwasy tłuszczowe jednonienasycone) 0 g<br />Zawartość tłuszczów 0 g<br />Zawartość błonnika 0 g<br />Zawartość węglowodanów 100 g<br />Zawartość soli 0,1 g','Cukier trzcinowy nierafinowany ,Diamant,1000 g. Przeznaczony do słodzenia kawy, herbaty, drinków oraz egzotycznych koktajli mleczno-owocowych. Doskonały również do pieczenia ciast i ciasteczek. Jego połyskujące, grube, jasno-brązowe kryształy wyśmienicie sprawdzają się jako dekoracja i efektowna posypka.','cukier-trzcinowy-nierafinowany-diamant-1kg','','','','Cukier trzcinowy nierafinowany “Diamant” 1kg','','','',''),
(1045,1,1,'Wartość energetyczna<br />1539 kJ / 364 kcal<br />Białko: 9 g<br />Błonnik: 6 g<br />Węglowodany: 70 g<br />Tłuszcze: 4 g','Produkt ma charakterystyczny żółty kolor i lekko słodkawy smak. Zawarty w mące kukurydzianej błonnik pomaga przy dolegliwościach związanych z układem pokarmowym, reguluje przemianę materii i pozwala na obniżenie poziomu złego cholesterolu.','maka-kukurydziana-melvit-1kg','','','','Mąka kukurydziana ,,Melvit” 1kg','','','',''),
(1046,1,1,'','Opis. Curry – to nazwa popularnej na Dalekim Wschodzie przyprawy lub nazwa potrawy występującej w kuchni indyjskiej. W skład przyprawy wchodzą m.in. kurkuma, imbir, pieprz czarny, kolendra, kmin rzymski, gorczyca, chili, gałka muszkatołowa, kardamon, goździki, papryka.','przyprawa-curry-bez-soli-japar-100g','','','','Przyprawa curry bez soli ,,Japar” 100g','','','',''),
(1047,1,1,'','Najczęściej stosuje się do: wypieku ciast biszkoptowych, francuskich i tortów. naleśników, pączków, faworków, gofrów, kruchych ciastek. przygotowania ciasta pierogowego.','maka-kostrzyn-tortowa-1kg','','','','Mąka “Kostrzyn” tortowa 1kg','','','',''),
(1048,1,1,'','Mąka Wrocławska typ 500 jest mąką pszenną o szerokich zastosowaniach kulinarnych. Znakomicie nadaje się do wypieku delikatnych ciast kruchych, półkruchych, francuskich czy lekkich ciast biszkoptowych.','maka-kostrzyn-wroclawska-1kg','','','','Mąka “Kostrzyn” wrocławska 1kg','','','',''),
