(1060,1,1,'','Jeśli lubisz chrupać pestki słonecznika to znakomicie, ponieważ bogate są w aminokwasy i nienasycone kwasy tłuszczowe. Włączając je do codziennego jadłospisu zapewnisz sobie dawkę wartościowego błonnika oraz witamin, poprawisz wygląd cery i włosów, a także wzmocnisz kości. Słonecznik łuskany jest świetnym dodatkiem do musli, jogurtów oraz sałatek. Sprawdzi się także jako samodzielna przekąska w formie surowej lub po uprażeniu na patelni. W naszej ofercie znaleźć można również kilka rodzajów słonecznika.','slonecznik-luskany-japar-100g','','','','Słonecznik łuskany ,,Japar” 100g','','','',''),
