(1063,1,1,'Wartość odżywcza w 100 g produktu:<br />Wartość energetyczna<br />1464 kJ / 346 kcal<br />Białko:<br />23 g<br />Błonnik:<br />8 g<br />Węglowodany:<br />55 g<br />Tłuszcze:<br />2 g','Soczewica zielona zawiera dużo białka, które może być alternatywą dla białka pochodzenia zwierzęcego. Jest bogatym źródłem ważnego dla serca potasu oraz potrzebnego w ciąży kwasu foliowego. Zawiera witaminy z grupy B, magnez, żelazo i wapń. Soczewica zielona korzystnie wpływa na układ krwionośny i serce. Zachowuje swój kształt po ugotowaniu, dlatego idealnie nadaje się do sałatek, farszów, past kanapkowych.','soczewica-zielona-melvit-400g','','','','Soczewica zielona “Melvit” 400g','','','',''),
(1064,1,1,'Wartość odżywcza w 100 g produktu:<br />Wartość energetyczna<br />1466 kJ / 347 kcal<br />Białko:<br />25 g<br />Błonnik:<br />8,3 g<br />Węglowodany:<br />53 g<br />Tłuszcze:<br />2 g','Soczewica czerwona jest pozbawioną łupinki soczewicą brązową. W przeciwieństwie do większości roślin strączkowych. Czerwona soczewica jest bogatym źródłem potasu, wspiera leczenie nadciśnienia tętniczego. Zawiera duże ilości kwasu foliowego, żelaza oraz witaminy B12. Polecana jest osobom odchudzającym się, ze względu na dużą ilość błonnika i małą kaloryczność. Nie wymaga wcześniejszego moczenia, należy gotować ją krótko, ponieważ jej wnętrze jest  miękkie i niewielkie.  Doskonale sprawdzi się jako składnik zup, kotletów, dań mięsnych.','soczewica-czerwona-melvit-400g','','','','Soczewica czerwona “Melvit” 400g','','','',''),
(1065,1,1,'Wartość energetyczna 1377 kJ/ 324 Kcal<br />Tłuszcz	0 g<br />– w tym kwasy tłuszczowe nasycone 0 g<br />Węglowodany 81 g<br />– w tym cukry 0,6 g<br />Białko	0 g<br />Sól  0,1 g','Skrobia ziemniaczana to zarówno składnik podstawowy, jak element uzupełniający. Wykorzystywana do zagęszczania zup i sosów, przygotowywania budyniu i kisielu czy wypieków ciast i chlebów.','skrobia-ziemniaczana-ppz-trzemeszno-1-kg','','','','Skrobia ziemniaczana PPZ ,,Trzemeszno” 1 kg','','','',''),
(1066,1,1,'Składniki: baza sosu 51,2% (woda*, sól morska*, tłuszcz wołowy* 8,1%, aromaty, koncentrat pomidorowy* 5,9%, warzywa 4,9% (cebula*, czosnek*), ekstrakt drożdży, skrobia kukurydziana, sól, zagęszczony sok z cytryny*, przyprawy*, zagęszczony ekstrakt mięsa wołowego 0,2%), skrobia kukurydziana, woda*, cukier*.Może zawierać: seler.* Naturalne składniki.','Sos o półpłynnej konsystencji, przygotowany na bazie esencjonalnego, wolno gotowanego wywaru wołowego, stworzony w oparciu o naturalne składniki takie jak cebulka, czosnek, listki laurowe, ziele angielskie. Dzięki niemu w kilka minut ugotujesz pyszny sos o zwartej, aksamitnej konsystencji, który doda smaku twoim codziennym daniom mięsnym takim jak pieczony lub duszony schab, karkówka, duszone polędwiczki czy roladki.','sos-pieczeniowy-ciemny-winiary','','','','Sos pieczeniowy ciemny “Winiary”','','','',''),
(1067,1,1,'Wartość energetyczna 0,0 kJ/0,0 kcal<br />Białko 0,0 g<br />w tym cukry 0,0 g<br />Tłuszcze 0,0 g<br />w tym kwasy tłuszczowe nasycone 0,0 g<br />Błonnik pokarmowy 0,0 g<br />Zawartość sodu (Na) 40 g<br />Zawartość jodu (I) 2300','Skład mikroelementów występujący w kłodawskiej soli zbliżony jest do ich zawartości w płynie ustrojowym organizmu człowieka. Biopierwiastki wchodzące w skład kłodawskiej soli tworzą ich kompleksy, łatwo przyswajalne przez organizm. Sól kłodawska zawiera naturalne pierwiastki takie jak: żelazo, wapń, magnez, cynk, potas i jod. Składniki: NaCl (chlorek sodu) – 97,0% min., Kl (jodan potasu)','sol-kamienna-jodowana-kopalnia-soli-klodawa-1kg','','','','Sól kamienna jodowana “Kopalnia soli Kłodawa” 1kg','','','',''),
(1068,1,1,'','W porównaniu do soli kuchennej, sól morska jest bardziej wilgotna i intensywniejsza w smaku. Kolor soli morskiej nie jest idealnie biały. Wszystko dlatego, że zawiera ona mikrocząsteczki morskiej fauny oraz flory. Z tego względu barwa jej jest nieco ciemniejsza niż kolor soli kuchennej.','sol-morska-osole-1kg','','','','Sól morska ,,O`sole” 1kg','','','',''),
(1069,1,1,'','Sól peklowa jest mieszanką soli oraz substancji konserwującej. Wykorzystywana do peklowania mięs, wyciąga wodę z mięsa i tym samym ogranicza w nim rozwój bakterii. Peklowanie jest naturalnym i stosowanym od wieków sposobem konserwowania.','sol-peklowa-o-sole-660g','','','','Sól peklowa ,, O` sole” 660g','','','',''),
(1070,1,1,'Wartość energetyczna (kJ) 1550<br />Wartość energetyczna (kcal) 354<br />Tłuszcz (g) 0,7<br />Kwasy tłuszczowe nasycone (g) 0,2<br />Węglowodany (g)	78,9<br />Cukry (g) 0,2<br />Błonnik (g) 2,4<br />Białko (g) 6,7<br />Sól (g)	0,02','Ryż jaśminowy charakteryzuje się ciekawym, niepowtarzalnym aromatem, dlatego idealnie nadaje się do lekkich deserów. Dodając do ryżu orzechy czy nasiona zwiększy się dodatkowo ilość magnezu w deserze. Ryż jaśminowy można także stosować do dań wytrawnych – szczególnie smacznie prezentuje się z zupą pomidorową.','ryz-jasminowy-kupiec-4x100g','','','','Ryż jaśminowy “Kupiec” 4x100g','','','',''),
