(1084,1,1,'','Sezam sprawdzi się znakomicie do dań na ciepło, jak i sałatek. Urozmaici dania mięsne jak i wegetariańskie. Bogaty w kwasy tłuszczowe, witaminy oraz błonnik.','sezam-japar-opak-150g','','','','Sezam ,,JAPAR” opak. 150g','','','',''),
(1085,1,1,'','Pozytywnie wpływa na układ krwionośny i poprawia krążenie krwi. Jego zdrowotne właściwości znane są nie tylko dietetykom. Może być spożywany bezpośrednio, ale również jako baza do soków czy dodatek do sałatek.','grejpfrut-czerwony-kg','','','','Grejpfrut czerwony (kg)','','','',''),
(1086,1,1,'Wartość energetyczna<br />1380 kJ / 326 kcal<br />Białko: 14 g<br />Błonnik: 6 g<br />Węglowodany: 59 g<br />Tłuszcze: 2 g','Bogate źródło błonnika pokarmowego i białka. Zawiera cynk,miedź, które pozytywnie wpływają układ krwionośny, nerwowy i odpornościowy. Mąka orkiszowa zawiera również witaminy A, E i D.','maka-orkiszowa-melvit-1-kg','','','','Mąka orkiszowa ,,Melvit” 1 kg','','','',''),
(1087,1,1,'','Owoc niezwykle słodkim smaku i pięknym różowym kolorze. Jego dodatek ożywi i urozmaici wiele potraw. Spożywanie granatu pozytywnie wpływa na układ krążenia.','granat-szt','','','','Granat (szt.)','','','',''),
(1088,1,1,'','Bogata w witaminę C pozytywnie wpływa na układ odpornościowy. Niezawodny dodatek do ciepłych i zimnych napojów, sałatek, sosów czy deserów.','cytryna-szt','','','','Cytryna (szt)','','','',''),
(1089,1,1,'','Bogata w witaminę C pozytywnie wpływa na układ odpornościowy. Niezawodny dodatek do ciepłych i zimnych napojów, sałatek, sosów czy deserów.','cytryna-kg','','','','Cytryna (kg)','','','',''),
(1090,1,1,'','Bogata w witaminę C pozytywnie wpływa na układ odpornościowy. Niezawodny dodatek do ciepłych i zimnych napojów, sałatek, sosów czy deserów.','cytryna-bio-opak-400g','','','','Cytryna BIO (opak. 400g)','','','',''),
(1091,1,1,'Wartość odżywcza w 100g<br />Wartość energetyczna 1548kj/336kcal<br />tłuszcz 2,8g<br />w tym kwasy tłuszczowe nasycone 0,8g<br />węglowodany 71g<br />w tym cukry 3,5g<br />błonnik 3,3g<br />białko 12g<br />sól 0,05g','Składniki mąka pszenna makaronowa, pasteryzowana masa jajowa chłodzona 18%, woda, przyprawa kurkuma 0,05%.','makaron-swojski-4-jajeczny-tasiemka-400g','','','','Makaron Swojski 4 jajeczny tasiemka 400g','','','',''),
(1092,1,1,'','Banan to słodki owoc, który może być spożywany zarówno na surowo, jak i w postaci gotowanej czy pieczonej. Pozytywnie wpływa na układ krążenia, wzmacnia serce oraz reguluje ciśnienie tętnicze krwi. Źródło potasu oraz witamin C i E.','banan-kg','','','','Banan (kg)','','','',''),
(1093,1,1,'','Pochodzące z ekologicznych upraw banany BIO, to cenne źródło potasu oraz witamin C i E. W postaci surowej to świetna przekąska nie tylko dla sportowców. Swoje walory smakowe zachowuje także w postaci gotowanej czy pieczonej.','banan-bio-kg','','','','Banan BIO (kg)','','','',''),
(1094,1,1,'','Kumkwat to jeden z nielicznych cytrusów, który nadaje się do spożycia w całości. Skórka odpowiada za słodycz w kumkwacie. Jeżeli chodzi o miąższ owocu, to jest on bardziej kwaśny. Połączenie cierpkiego środka kumkwatu ze słodką skórką zapewnia balans, dzięki któremu cytrus bardzo dobrze smakuje.','kumkwat-opak-250g','','','','Kumkwat (opak. 250g)','','','',''),
(1095,1,1,'','Spożywane główne na surowo. Nie jest jednak powszechnie znaną informacją, że kiwi nie trzeba obierać, ponieważ jego skórka jest jadalna i zawiera wiele witamin. Kiwi zawiera dużo witaminy C, potasu i kwasu foliowego.','kiwi-szt','','','','Kiwi (szt.)','','','',''),
(1096,1,1,'','Jabłka Prince są duże, pokryte lśniącą, gładką skórką z charakterystycznym rubinowym rumieńcem. Miąższ ma barwę kremowo-żółtą, jest ścisły i twardy. Jabłka są soczyste, słodkie i smaczne.','jablko-prince-szt','','','','Jabłko Prince (szt)','','','',''),
(1097,1,1,'','Karambola to egzotyczny owoc o cennych wartościach odżywczych. Ze względu na wygląd nazywany jest gwieździstym owocem.','karambola-szt','','','','Karambola (szt.)','','','',''),
(1098,1,1,'','Cortland to jabłka pochodzące ze Stanów Zjednoczonych, bardzo lubiane w Polsce. Ich skórka jest pokryta w całości czerwonym, karminowym rumieńcem, miąższ jest biały, w smaku słodko-winny, lekko korzenny, kruchy, do tego nie ciemnieje po przekrojeniu. Są bardzo soczyste, nadają się do produkcji soków.','jablko-cortland-kg','','','','Jabłko Cortland (kg)','','','',''),
(1099,1,1,'','Ligol jest Polską odmianą jabłek, powstała dzięki połączeniu odmian Linda i Golden Delicious.  Charakteryzuje się dość sporymi owocami z mocno błyszczącą skórką. Miąższ jest kruchy i soczysty, a smak słodki, delikatnie kwaskowaty. Dużą zaletą jest przede wszystkim fakt, że jabłka po obraniu nie czernieją, więc świetnie nadają się do sałatek.','jablko-ligol-kg','','','','Jabłko Ligol (kg)','','','',''),
(1100,1,1,'','Jabłka Lobo są charakteryzują się kulistym, lekko spłaszczonym kształtem. Mają gładką, błyszczącą, zielonożółtą skórkę, z silnym, ciemnokarminowym, rozmytym rumieńcem, pokrywającym często niemal całą powierzchnię. Na skórce widoczny słaby nalot woskowy. Ich smaczny miąższ jest zielonokremowy, soczysty, kruchy, słabo aromatyczny, kwaskowato-słodki.','jablko-lobo-szt','','','','Jabłko Lobo (szt)','','','',''),
(1101,1,1,'','Jabłka Lobo są charakteryzują się kulistym, lekko spłaszczonym kształtem. Mają gładką, błyszczącą, zielonożółtą skórkę, z silnym, ciemnokarminowym, rozmytym rumieńcem, pokrywającym często niemal całą powierzchnię. Na skórce widoczny słaby nalot woskowy. Ich smaczny miąższ jest zielonokremowy, soczysty, kruchy, słabo aromatyczny, kwaskowato-słodki.','jablko-lobo-kg','','','','Jabłko Lobo (kg)','','','',''),
(1102,1,1,'','wysokobłonnikowe Otręby owsiane Sante są unikatowym produktem na polskim rynku. W przeciwieństwie do wielu innych podobnych produktów, to dokładnie odseparowane od mąki, czyste otręby produkowane dla nich samych, a nie jako produkt uboczny przy produkcji płatków owsianych.  Dzięki zastosowaniu specjalnej technologii produkcji udało się uzyskać aż 19% zawartość błonnika i ponad 6% beta- glukanów. Jak udowodniono w licznych badaniach, wystarczy, że codziennie będziesz jeść tylko jedną 50-gramową porcję prawdziwych otrąb owsianych, aby skutecznie obniżać poziom cholesterolu we krwi*.','otreby-owsiane-sante-150g','','','','Otręby owsiane ,,Sante” 150g','','','',''),
(1103,1,1,'','Champion to jesienne, słodkie i aromatyczne jabłka. W zależności od regionu, w którym są uprawiane jabłonie, mają bardziej lub mniej rozmyty rumieniec i zielono-żółtą skórkę. Ich smak może się kojarzyć z gruszką. Są powszechnie lubiane. Nadają się do przetworów i jedzenia na surowo.','jablko-champion-kg','','','','Jabłko Champion (kg)','','','',''),
(1104,1,1,'','Jabłka Prince są duże, pokryte lśniącą, gładką skórką z charakterystycznym rubinowym rumieńcem. Miąższ ma barwę kremowo-żółtą, jest ścisły i twardy. Jabłka są soczyste, słodkie i smaczne.','jablko-prince-kg','','','','Jabłko Prince (kg)','','','',''),
(1105,1,1,'','Champion to jesienne, słodkie i aromatyczne jabłka. W zależności od regionu, w którym są uprawiane jabłonie, mają bardziej lub mniej rozmyty rumieniec i zielono-żółtą skórkę. Ich smak może się kojarzyć z gruszką. Są powszechnie lubiane. Nadają się do przetworów i jedzenia na surowo.','jablko-champion-szt','','','','Jabłko Champion (szt)','','','',''),
(1106,1,1,'','Cortland to jabłka pochodzące ze Stanów Zjednoczonych, bardzo lubiane w Polsce. Ich skórka jest pokryta w całości czerwonym, karminowym rumieńcem, miąższ jest biały, w smaku słodko-winny, lekko korzenny, kruchy, do tego nie ciemnieje po przekrojeniu. Są bardzo soczyste, nadają się do produkcji soków.','jablko-cortland-szt','','','','Jabłko Cortland (szt)','','','',''),
(1107,1,1,'','A','ananas-szt','','','','Ananas (szt.)','','','',''),
(1108,1,1,'','Substancje aktywne w liściach białej morwy przeciwdziałają starzeniu się skóry. Ekstrakt z liści rośliny zwiększa elastyczność skóry, wyrównuje jej koloryt i działa delikatnie przeciwbólowo. Działa także ochronnie ze względu na bogactwo flawonoidów.','morw-biala-susz-ziolowy-naturo-100g','','','','Morw biała susz ziołowy ,,Naturo” 100g','','','',''),
(1109,1,1,'','Mięta charakteryzuje się wyjątkowym aromatem. To świetny dodatek do deserów, koktajli, herbat czy sałatek. Przyjemnie orzeźwi każde danie. Może być wykorzystywana do przygotowania leczniczych naparów, szczególnie wskazanych przy problemach z trawieniem.','mieta-w-doniczce-szt','','','','Mięta w doniczce (szt.)','','','',''),
(1110,1,1,'','Od wieków sprawdza się w walce przy zaburzeniach trawienia, przy niskim tempie przemiany materii, niweluje stany skurczowe przewodu pokarmowego, wzdęcia i bóle brzucha. Reguluje perystaltykę jelit, działa rozkurczowo i znosi poczucie dyskomfortu.','mieta-susz-ziolowy-naturo-100g','','','','Mięta susz ziołowy ,,Naturo” 100g','','','',''),
(1111,1,1,'','Melisa lekarska to krzewinka, tworzy kępy średnicy około 60 cm, złożone z licznych, czterokanciastych, nieco płożących u nasady, górą wzniesionych, delikatnie owłosionych, rozgałęziających się pędów do 60 cm wysokości, gęsto porośniętych licznymi jajowatymi, żywozielonymi liśćmi o ząbkowanych brzegach.','melisa-susz-ziolowy-naturo-100g','','','','Melisa susz ziołowy ,,Naturo” 100g','','','',''),
(1112,1,1,'','Używany w kuchni przede wszystkim jako dodatek do zup. Polski rosół zyskuje dzięki niemu niepowtarzalny smak. Sprawdzi się także stosowany jako dodatek do mięs i sosów.','lubczyk-w-doniczce-szt','','','','Lubczyk w doniczce (szt.)','','','',''),
(1113,1,1,'','Pomarańcza jest znakomitym źródłem witaminy C, beta-karotenu i witamin z grupy B. Pomarańcze warto jeść z błonkami oddzielającymi cząstki owocu – są dobrym źródłem błonnika i flawonoidów wzmacniających działanie witaminy C. Olejek pomarańczowy ma zaś właściwości uspokajające i przeciwdepresyjne.','pomarancza-kg','','','','Pomarańcza (kg)','','','',''),
(1114,1,1,'','','sliwka-polska-1kg','','','','Śliwka Polska (1kg)','','','',''),
(1115,1,1,'','Pomarańcza jest znakomitym źródłem witaminy C, beta-karotenu i witamin z grupy B. Pomarańcze warto jeść z błonkami oddzielającymi cząstki owocu – są dobrym źródłem błonnika i flawonoidów wzmacniających działanie witaminy C. Olejek pomarańczowy ma zaś właściwości uspokajające i przeciwdepresyjne.','pomarancza-szt','','','','Pomarańcza (szt)','','','',''),
(1116,1,1,'','Plantan – banan warzywny – źródło potasu, błonnika i beta-karotenu.','platan-banan-warzywny-kg','','','','Platan – banan warzywny (kg)','','','',''),
(1117,1,1,'','Miechunka, czyli Physalis peruviana, to wieloletnia roślina ozdobna i jadalna. Owoce miechunki i korzeń rośliny mają wiele właściwości zdrowotnych, działając m.in. antyoksydacyjnie i wzmacniająco na układ immunologiczny. Miechunka jest bogatym źródłem witaminy C, przeciwutleniaczy i innych składników odżywczych.','physalis-opak-100g','','','','Physalis (opak. 100g)','','','',''),
(1118,1,1,'','Pitaja – smoczy owoc, to owoc kaktusa. Nazywany jest również truskawką gruszkowatą lub pitahayą.','pitaja-smoczy-owoc-szt','','','','Pitaja – smoczy owoc (szt.)','','','',''),
(1119,1,1,'','Melon żółty ma wiele właściwości pozytywnie wpływających na funkcjonowanie organizmu. Przede wszystkim – podobnie jak inne odmiany – jest skarbnicą prowitaminy A czyli beta – karotenu. Melon miodowy to także źródło potasu, który wpływa na regulację ciśnienia tętniczego.','melon-zolty-szt','','','','Melon żółty (szt.)','','','',''),
(1120,1,1,'Wartość energetyczna<br />1485 kJ / 350 kcal<br />Białko: 8,9 g<br />Błonnik: 0,7 g<br />Węglowodany: 76 g<br />Cukry: 0 g<br />Tłuszcze: 0,8 g','Ryż Basmati (znaczy pachnący) to specjalna odmiana białego ryżu uprawiana u podnóży Himalajów. Po jego ugotowaniu ziarna są dłuższe i cieńsze od pozostałych odmian. Ma on bardzo charakterystyczny orzechowy smak i zapach.','ryz-basmati-melvit-4x100g','','','','Ryż Basmati ,,Melvit” 4x100g','','','',''),
(1121,1,1,'','Egzotyczny, wyjątkowo słodki owoc, którego zastosowanie w kuchni jest niesamowicie szerokie. Może stanowić bazę koktajli, deserów, a także być dodatkiem do sałatek, jogurtu czy owsianki.','mango-szt','','','','Mango (szt.)','','','',''),
(1122,1,1,'','Marakuja jest owocem egzotycznym pochodzącym z Brazylii. Uprawiana jest na szeroką skalę w regionach tropikalnych i subtropikalnych.','marakuja-opak-2-szt','','','','Marakuja (opak. 2 szt.)','','','',''),
(1123,1,1,'','Mandarynki mają wiele właściwości leczniczych. Dzięki witaminie C i witaminie A – naturalnym przeciwutleniaczom – wspomagają układ odpornościowy, hamują działanie wolnych rodników odpowiedzialnych za proces starzenia, a także poprawiają kondycję skóry oraz chronią przed chorobami oczu.','mandarynka-kg','','','','Mandarynka (kg)','','','',''),
(1124,1,1,'','Malina to owoc bogaty przede wszystkim w cukry, pektyny oraz kwasy organiczne, takie jak kwas salicylowy, jabłkowy czy cytrynowy. To także bogate źródło witamin, m.in. witamin z grupy B oraz witaminy C i E, a także wielu składników mineralnych.','malina-pl-opak-250g','','','','Malina PL (opak. 250g)','','','',''),
(1125,1,1,' ','Tymianek to idealny dodatek do mięs i sosów, a także do zup takich jak grochowa czy fasolowa. Idealnie komponuje się też ze smakiem dziczyzny, dlatego jest nieodłącznym dodatkiem pasztetów.','tymianek-w-doniczce-szt','','','','Tymianek w doniczce (szt.)','','','',''),
(1126,1,1,'','Wszechstronnie wykorzystywany w polskiej kuchni. Znakomicie komponuje się z daniami na bazie jaj i twarogu. Może stanowić dodatek do sałatek, past kanapkowych czy surówek.','szczypiorek-peczek','','','','Szczypiorek (pęczek)','','','',''),
(1127,1,1,'','Szczaw ma postać zielonych, dużych, jasnych lub ciemnych liści. Jest ostro kwaśny z cytrynowym posmakiem. Jego smak jest orzeźwiający i wyraźny. W kuchni często jest wykorzystywany w postaci świeżej, mrożonej, a niektórzy nawet go pasteryzują i przechowują w słoikach.','szczaw-czerwony-w-doniczce-szt','','','','Szczaw czerwony w doniczce (szt.)','','','',''),
(1128,1,1,'','W kuchni używane są przede wszystkim liście szałwii. Gdy dojrzewają ich zieleń zmienia się w kolor srebrnoszary z purpurowym meszkiem. Odznaczają się charakterystycznym, balsamicznym i lekko sosnowym aromatem oraz pikantnym smakiem. Suszone liście szałwii tracą swoje walory smakowe. Najlepiej sprawdzają się w postaci świeżej.','szalwia-w-doniczce-szt','','','','Szałwia w doniczce (szt.)','','','',''),
(1129,1,1,'','Trawa cytrynowa aromatyzuje wiele azjatyckich potraw – wytrawnych i słodkich. Jej jasnozielone łodygi zawierają ten sam olejek eteryczny co skórka cytryny, Ale w odróżnieniu od niej nie są kwaśne. Ich smak jest łagodniejszy, cytrynowo – imbirowy.','trawa-cytrynowa-peczek-250g','','','','Trawa cytrynowa (pęczek 250g)','','','',''),
(1130,1,1,'','Truskawki to jedne z najpopularniejszych i najbardziej lubianych owoców letnich. W naszym warzywniaku oferujemy świeże, aromatyczne truskawki prosto z polskich plantacji, z dala od chemikaliów i sztucznych dodatków. Dzięki swej wyjątkowej słodyczy i soczystości, truskawki stanowią idealny dodatek do deserów, sałatek, koktajli czy wypieków. Ich zawartość witaminy C, antyoksydantów i innych cennych składników odżywczych wpływa korzystnie na zdrowie i kondycję organizmu. W naszym warzywniaku dbamy o to, by truskawki były zawsze świeże i najwyższej jakości. Zapraszamy do naszego sklepu po aromatyczne, soczyste i pełne smaku truskawki, które na pewno przypadną do gustu każdemu.','truskawka-polska-250g','','','','Truskawka Polska 250g','','','',''),
(1131,1,1,'','Jasne winogrona są skarbnicą witamin i składników mineralnych. Zawierają witaminy C i A, witaminy z grupy B, potas, fosfor oraz wapń, magnez, cynk, miedź, żelazo. Ponadto należą do nielicznych owoców zawierających jod – niezbędny dla funkcjonowania tarczycy. Są także zasadotwórcze, co pomaga w pozbyciu się nagromadzonych w organizmie kwasów.','winogrono-jasne-kg','','','','Winogrono jasne (kg)','','','',''),
(1132,1,1,'','Węgierka to jedna z najstarszych odmian śliwy, znana w Europie już w XVII w. Do Polski przywieziona z Węgier – stąd jej nazwa. Ma brązowofioletową skórkę, pokrytą białawym nalotem i drobnymi brunatnymi cętkami, mocno przywierającą do miąższu, który jest złotożółty, żółty lub zielonkawożółty, średnio soczysty. Węgierka to odmiana deserowa, doskonała również na przetwory (powidła i susze).','sliwka-wegierka-kg','','','','Śliwka Węgierka (kg)','','','',''),
(1133,1,1,'','','sliwka-president','','','','Śliwka President','','','',''),
(1134,1,1,'','Kurkuma to kłącze, korzeń lub łodyga znajdujące się pod ziemią. Kurkuma, którą znamy z naszych kuchni to właśnie zmielone kłącze lub łodyga ostryżu. Kłącze kurkumy charakteryzuje się żółtawo-brązowym ubarwieniem, natomiast we wnętrzu przybiera barwę pomarańczową.','kurkuma-japar-100g','','','','kurkuma ,,Japar” 100g','','','',''),
(1135,1,1,'','','sliwka-czerwona-kg','','','','Śliwka czerwona (kg)','','','',''),
(1136,1,1,'','Liście szałwii lekarskiej mają przede wszystkim działanie przeciwpotne, przeciwzapalne, żołądkowe, dezynfekujące, oraz przeciwcukrzycowe. Dodatkowo działają tonizująco na skórę, są skuteczne w leczeniu grzybicy oraz posiadają wyjątkowe działanie kojące przy odmrożeniach i niewielkich oparzeniach.','szalwia-susz-ziolowy-naturo-100g','','','','Szałwia susz ziołowy ,,Naturo” 100g','','','',''),
(1137,1,1,'Wartość energetyczna (kJ) 1518<br />Wartość energetyczna (kcal) 358<br />Tłuszcz (g) 1<br />Kwasy tłuszczowe nasycone (g) 0,2<br />Węglowodany (g)	79<br />Cukry (g) 0,2<br />Błonnik (g) 2,4<br />Białko (g) 7<br />Sól (g)	0,02','Ryż biały długoziarnisty jest najpopularniejszym gatunkiem ryżu na świecie. Jest produktem lekkostrawnym i niskokalorycznym. Posiada wyraźny smak i doskonale współgra z wieloma produktami, co umożliwia przygotowanie oryginalnych potraw. Idealny do sałatek, potraw mięsnych i jako dodatek do jarzyn.','ryz-bialy-kupiec-400g','','','','Ryż biały “Kupiec” 400g','','','',''),
(1138,1,1,'','Oregano to popularne zioło, nieodłączny składnik mieszanki zwanej ziołami prowansalskimi. Cenione w kuchni śródziemnomorskiej. Używane przede wszystkim jako dodatek do pizzy, ale także do warzyw, serów, mięs, owoców morza.','oregano-w-doniczce-szt','','','','Oregano w doniczce (szt.)','','','',''),
(1139,1,1,'','Rozmaryn charakteryzuje się intensywnym, leśnym zapachem. To idealny dodatek do mięs i ryb. Smakowite połączenie tworzy także z serami, masłem, miodem i orzechami.','rozmaryn-w-doniczce-szt','','','','Rozmaryn w doniczce (szt.)','','','',''),
(1140,1,1,'','Idealny dodatek do zup, surówek i sałatek. Wykorzystywana w kuchni nie tylko ze względu na swoje walory smakowe i zapachowe, ale także na wysoką zawartość witamin i minerałów.','natka-pietruszki-peczek','','','','Natka pietruszki (pęczek)','','','',''),
(1141,1,1,'','Sok limonki nadaje wyjątkowy, orzeźwiający aromat napojom oraz potrawom. Wykorzystywany jako dodatek do lemoniad, drinków, sosów, past, sałatek i deserów. Razem z awokado tworzą wyjątkowo pyszny duet.','limonka-szt','','','','Limonka (szt.)','','','',''),
(1142,1,1,'','Jedno z najbardziej popularnych ziół w Polsce. Tworzy świetny duet z ziemniakami. Idealnie sprawdzi się także jako dodatek do past czy sosów. Dobrze wpływa na działanie układu pokarmowego.','koperek-peczek','','','','Koperek (pęczek)','','','',''),
(1143,1,1,'','','koper-do-kiszenia-szt','','','','Koper do kiszenia (szt)','','','',''),
(1144,1,1,'','Czystek ziele 100%','czystek-susz-ziolowy-naturo-100g','','','','Czystek susz ziołowy ,,Naturo” 100g','','','',''),
(1145,1,1,'','Bazylia – królowa ziół w kuchni włoskiej. Znakomity połączenie tworzy z pomidorami i mozarellą. Jej właściwości łagodzą dolegliwości żołądkowe i przyspieszają trawienie.','bazylia-w-doniczce-szt','','','','Bazylia w doniczce (szt.)','','','',''),
(1146,1,1,'','Bazylia tajska to niewysoki krzaczek. Ciemne łodygi porośnięte są zielonymi, dosyć ostro zakończonymi liśćmi. W smaku zdecydowana. Zapach anyżowy i lukrecjowo – miętowy aromat.','bazylia-tajska-w-doniczce-szt','','','','Bazylia tajska w doniczce (szt.)','','','',''),
(1147,1,1,'','Cukinia jest łagodnym w smaku, lekkostrawnym warzywem. Jest ceniona za wysoką wartość dietetyczną. Zawiera potas, żelazo i magnez oraz witaminę C, witaminę K, witaminę PP i witaminę B1, beta karoten. Zaletą cukinii jest to, że nie odkładają się w niej metale ciężkie. Ponadto warzywo odkwasza organizm i pozytywnie wpływa na proces trawienia.','cukinia-z-wlasnych-upraw-kg','','','','Cukinia Z WŁASNYCH UPRAW (kg)','','','',''),
(1148,1,1,'','Wyjątkowo często stosowana w polskiej kuchni. Używana do sałatek, surówek, smażenia czy pieczenia. Znana z właściwości leczniczych. Na jej bazie można przygotować tradycyjny syrop z cebuli. Swe zdrowotne oddziaływanie na organizm cebula zawdzięcza obecności m.in. witaminy C, A, witamin z grupy B, fosforu, żelaza, wapnia, olejków eterycznych i oczywiście związków siarki. Jest bogatym źródłem przeciwutleniaczy. Choć cebula duszona czy gotowana nie traci swoich zdrowotnych właściwości, najbardziej wartościowa jest cebula surowa.','cebula-zolta-kg','','','','Cebula żółta (kg)','','','',''),
(1149,1,1,'','Czosnek askaloński, zwany szalotką lub cebuloczosnkiem, często postrzegany jest jako rodzaj cebuli (szalotki rosną, tworząc pęczki małych bulw), choć wielkością przypomina zwykły czosnek i ma czosnkowy zapach. Szalotka  zawiera dużo  substancji antynowotworowych, pomaga obniżyć ciśnienie, rozrzedza krew i zapobiega zakrzepom. Zawarte w szalotce naturalne antybiotyki pomagają leczyć przeziębienie i grypę. Jest ona też dobrym źródłem witamin B6, C, A i kwasu foliowego. Szalotkę trawi się łatwiej niż cebulę.','cebula-szalotka-opak-250g','','','','Cebula szalotka (opak. 250g)','','','',''),
(1150,1,1,'','Cebula dymka ma w sobie niewiele kalorii. Zawiera za flawonoidy, fruktany, pektyna, tłuszcz, białko, węglowodany, błonnik, cukry, witaminy – witamina A, witaminy z grupy B, witamina C, E i K. Ma w sobie również minerały takie, jak cynk, fosfor, fluor, krzem, magnez, mangan, miedź, potas, selen, siarka, sód, wapń i żelazo. Jedną z zalet małej cebulki jest jej delikatny smak oraz nie wywoływanie łez w trakcie siekania. Od stuleci wykorzystuje się ją w medycynie naturalnej ze względu na wysoką zawartość kwasu askorbinowego oraz zdolność niszczenia bakterii.','cebula-dymka-szt','','','','Cebula dymka (szt.)','','','',''),
(1151,1,1,'','Czerwona cebula nie różni się znacząco od znanej nam wszystkim cebuli w kolorze żółtym, zawiera jednak antocyjany, które nadają jej łuskom ciemnofioletowego koloru i – co ważne dla wielu miłośników gotowania – nie podrażnia oczu przy krojeniu w takim stopniu, jak robi to cebula żółta.  Lista dobroczynnych składników chemicznych czerwonej cebuli jest długa. Zawiera ona potas, siarkę, wapń, magnez, żelazo, mangan, miedź, cynk, jak również szereg witamin z grupy B, a także witaminę E i witaminę C.','cebula-czerwona-kg','','','','Cebula czerwona (kg)','','','',''),
(1152,1,1,'','Brokuł – to zielone warzywo charakteryzuje się dużą zawartością sulforafanu – substancji antynowotworowej. Jest także źródłem witamin: A, E, K1, C, B1. Idealny dodatek do dań obiadowych i sałatek.','brokul-szt','','','','Brokuł (szt.)','','','',''),
(1153,1,1,'','Burak, to warzywo, które wykazuje się zdolnością do oczyszczania i produkowania krwi. Nie powinno go zabraknąć w zdrowej, zbilansowanej diecie. Nadaje się do spożywania na surowo, w formie pieczonej, do wykonywania przetworów i przygotowywania zakwasu. Buraki nie zawierają dużej ilości żelaza, ale są idealnym środkiem krwiotwórczym. Dodatkowo buraki mogą zapobiegać anemii. Buraki mają bardzo mało kalorii. Są za to bogate w witaminy i minerały. Korzeń buraka zawiera witaminy C, B1, kwas foliowy, witaminę A oraz beta-karoten. W burakach znajdziemy w nim również bardzo dużo różnych składników mineralnych, m.in. wapń, potas, mangan, magnez, miedź, fluor oraz sód. Zawiera również dwa rzadko występujące składniki: rubid i cez.','buraki-kg','','','','Buraki (kg)','','','',''),
(1154,1,1,'','Brukselka to źródło wielu witamin – tych z grupy B, a także witamin A, C, E oraz K. Warzywo to dostarcza naszemu organizmowi dawkę magnezu, żelaza, fosforu, sodu, wapnia, manganu, siarki, cynku, selenu czy potasu. Zawarte w niej przeciwutleniacze działają przeciwnowotworowo i wymiatają wolne szkodniki z organizmu.','brukselka-kg','','','','Brukselka (kg)','','','',''),
(1155,1,1,'','Boczniaki to nietypowe grzyby – w przeciwieństwie do leśnych, które są raczej pozbawione wartości odżywczych, boczniaki uważane są za grzyby o właściwościach leczniczych. Są w nich związki, które obniżają poziom cukru i cholesterolu, a nawet niszczą komórki nowotworowe. Boczniaki zawierają białko przyswajalne w 70 proc., sporo nienasyconych kwasów tłuszczowych. Mają komplet witamin z grupy B, witaminę C, a także wapń, żelazo, magnez, fosfor, potas, selen, sód i cynk.','boczniaki-opak-200g','','','','Boczniaki (opak. 200g)','','','',''),
(1156,1,1,'','Bakłażan zawiera mnóstwo soli mineralnych, głównie fosforu i wapnia, dużo glukozy i błonnika. Bakłażan jest warzywem niskokalorycznym, jednak zwykle jest on jadany po obróbce termicznej w oliwie bądź oleju, co powoduje wzrost jego kaloryczności. Bakłażany bogate są w antycyjany, dzięki którym zawdzięczają swój niepowtarzalny kolor. Związki te należą do flawonoidów, które chronią organizm przed działaniem wolnych rodników, odpowiedzialnych m.in. za powstawanie nowotworów.','baklazan-kg','','','','Bakłażan (kg)','','','',''),
(1157,1,1,'','Bataty, inaczej słodkie ziemniaki, goszczą na polskich stołach znaczne rzadziej niż tradycyjne ziemniaki. Tymczasem bataty przewyższają je pod względem wartości odżywczych i właściwości zdrowotnych. Niektóre odmiany batatów są bowiem źródłem karotenoidów, w tym poprawiającej wzrok luteiny. Jeszcze inne zawierają likopen, który może zmniejszać ryzyko rozwoju chorób serca.','bataty-kg','','','','Bataty (kg)','','','',''),
(1158,1,1,'','Awokado to popularny, smaczny owoc, który ma wiele właściwości korzystnych dla zdrowia. Można jeść go jako przystawkę oraz dodawać do różnych dań, a także sporządzać z niego pastę znaną jako guacamole. Awokado jest wykorzystywane jako dodatek do dań kuchni meksykańskiej, świetnie sprawdzi się także jako baza past kanapkowych i koktajli. To cenne źródło witamin A, B1, B2, B3, B6 C, E, K i H, bogate w tłuszcze nienasycone.','awokado-szt','','','','Awokado (szt.)','','','',''),
(1159,1,1,'100 g jogurtu<br />Wartość energetyczna 410 kJ/97 kcal<br />Tłuszcz	2,5 g<br />w tym kwasy nasycone 1,8 g<br />Węglowodany 15,5 g<br />w tym cukryb14,5 g<br />Białko	3,3 g<br />Sól 0,10 g','Trzyskładnikowy jogurt owocowy, zawierający w składzie tylko jogurt, morele i cukier trzcinowy. Przygotowany z produktów które uprawiano bez użycia nawozów sztucznych i pestycydów oraz owoców, które nie były genetycznie modyfikowane.','jogurt-bio-bakoma-z-morelami-140g','','','','Jogurt BIO „Bakoma” z morelami 140g','','','',''),
(1160,1,1,'Wartość energetyczna 266 kJ / 63 kcal<br />Tłuszcz	2,0 g<br />w tym kwasy nasycone 1,4 g<br />Węglowodany 6,8 g<br />w tym cukry 6,8 g<br />Białko	4,5 g<br />Sól 0,13 g','Bakoma','jogurt-bio-bakoma-naturalny-140g','','','','Jogurt BIO „Bakoma” naturalny 140g','','','',''),
(1161,1,1,'','Ser twarogowy ze śmkietanką, solą i pieprzem czarnym mielonym.','gzik-wrzesinski-na-raz-sm-wrzesnia-150g','','','','Gzik Wrzesiński na raz “SM Września” 150g','','','',''),
(1162,1,1,'Wartość energetyczna<br />539 kJ/129,00 kcal<br />Tłuszcz	8,00 g<br />Węglowodany 2,80 g<br />Białko	11,00 g','Przygotowany ze ściśle wyselekcjonowanego twarogu z dodatkiem najwyższej jakości śmietanki. Nie zawiera konserwantów ani wzmacniaczy smaku. Ułatwi przygotowanie tradycyjnego, wielkopolskiego dania jakim są ,,Pyry z gzikiem”.','gzik-wrzesinski-sm-wrzesnia-300g','','','','Gzik Wrzesiński „SM Września” 300g','','','',''),
(1163,1,1,'Wartość energetyczna 110,00 kcal<br />Tłuszcz	6,00 g<br />Węglowodany 2,00 g<br />Białko	12,00 g','Twaróg ze śmietanką, solą, pieprzem i szczypiorkiem. Produkowany według tradycyjnej receptury. To idealny, wiosenny dodatek do śniadań i obiadów.','gzik-wielkopolski-ze-szczypiorkiem-top-tomysl-200g','','','','Gzik wielkopolski ze szczypiorkiem „Top-Tomyśl” 200g','','','',''),
(1164,1,1,'','Gzik wielkopolski to twaróg ze śmietanką, solą i pieprzem. Produkt nie ma dodatków, dlatego można do niego dodać przyprawy wedle uznania. Znakomicie smakuje z rzodkiewką i szczypiorkiem.','gzik-wielkopolski-top-tomysl-200g','','','','Gzik wielkopolski „Top-Tomyśl” 200g','','','',''),
(1165,1,1,'','Drożdże to produktów niezbędny w każdej kuchni. Odznaczają się sporą aktywnością, a tym samym gwarantują, że ciasto będzie miało idealną strukturę po wypieku.','drozdze-tradycyjne-babuni-100g','','','','Drożdże tradycyjne “Babuni” 100g','','','',''),
(1166,1,1,'','Kapusta biała jest warzywem niskokalorycznym. Jest źródłem witaminy C, A, niewielkiej ilości witaminy E, K i rutyny. ','kapusta-biala-szt-ok-2-kg','','','','Kapusta biała (szt. – ok. 2 kg)','','','',''),
(1167,1,1,'','Jarmuż przypomina nieco smaki kapusty, brokuła i szpinaku. ','jarmuz-opak-150g','','','','Jarmuż (opak. 150g)','','','',''),
(1168,1,1,'','Kalarepa to warzywo, które ma wiele wartości odżywczych. Zawiera niemalże wszystkie witaminy i pierwiastki mineralne i chroniącą oczy luteinę. Jednak mało kto wie, że jest źródłem izotiocyjanów i indoli – substancji, które chronią organizm przed rozwojem nowotworów. Zawiera dużo witamin i składników mineralnych. Jest dobrym źródłem witaminy C oraz witamin z grupy B.','kalarepa-szt','','','','Kalarepa (szt.)','','','',''),
(1169,1,1,'','Korzeń imbiru jest źródłem podstawowych składników, jak białka, tłuszcze i – zwłaszcza – węglowodany (około 50% składu węglowodanów korzenia imbiru to skrobia). Zawiera także składniki mineralne i witaminy, jak wapń, fosfor żelazo oraz cynk, witaminy – niacyna i witamina B2 oraz B6. Surowy imbir dodaje świeżości i pikantności owocom morza, polepsza smak mdłych potraw i tłustych mięs, np. kaczki czy wieprzowiny.','imbir-100g','','','','Imbir (100g)','','','',''),
(1170,1,1,'','Kalafior to warzywo bardzo popularne na polskich stołach, jednak stosunkowo mało osób zdaje sobie sprawę z tego, jak wiele cennych właściwości i składników odżywczych on posiada. Kalafior, oprócz małej wartości kalorycznej, ma też bardzo niski indeks glikemiczny (będzie więc idealny dla cukrzyków), a także bogactwo witamin i minerałów. Jest cennym źródłem błonnika, a także składników mineralnych, taki jak potas, wapń, magnez, żelazo, cynk, witaminy z grupy B, witamina C, A i K.','kalafior-szt','','','','Kalafior (szt.)','','','',''),
(1171,1,1,'','Grzyby Shiitake wspiera walkę organizmu z przeziębieniami oraz infekcjami różnego rodzaju, skutecznie usuwając patogeny z organizmu. Tym samym wykazuje właściwości antybakteryjne i antywirusowe.','grzyby-shiitake-tacka-200g','','','','Grzyby Shiitake (tacka 200g)','','','',''),
(1172,1,1,'','Dynia piżmowa doskonale sprawdza się zarówno w daniach słodkich, jak i słonych. Świetnie podkreśli jej smak cynamon, syrop klonowy, ocet balsamiczny, zioła czy wędzona mielona papryka. Pieczenie i grillowanie dyni to świetny pomysł. Sprawia, że nabiera wyrazistego maślanego smaku. Dynia piżmowa zawiera duże ilości witaminy A i C. Dynia ta zawiera także potas, który ma pozytywny wpływ na utrzymanie właściwego poziomu ciśnienia krwi.','dynia-pizmowa-szt','','','','Dynia piżmowa (szt)','','','',''),
(1173,1,1,'','','dynia-makaronowa-szt-ok-15kg','','','','Dynia makaronowa (szt. ok 1,5kg)','','','',''),
(1174,1,1,'','Dynia Hokkaido to zdecydowanie najsmaczniejsza odmiana dyni. Ma lekko orzechowy smak. Świetna po upieczeniu, idealna w formie frytek z dyni. Świetna do zup, musów, deserów. Ma delikatną jadalną skórkę i piękny pomarańczowy kolor miąższu. Dynia Hokkaido swój kolor zawdzięcza dużej obecności beta-karotenu, czyli prowitaminy A. Należy ona do grupy przeciwutleniaczy i aktywnie wspiera nas w walce o prawidłową odporność.  Ogromną zaletą tej dyni jest fakt, że ma niewiele kalorii.','dynia-hokkaido-z-wlasnych-upraw-ok-1kg','','','','Dynia Hokkaido Z WŁASNYCH UPRAW (ok. 1kg)','','','',''),
(1175,1,1,'','W jednym małym ząbku czosnku zawiera się ogrom substancji leczniczych, takich jak związki flawonoidowe, aminokwasy, saponiny, cukry, związki śluzowe, różnorakie witaminy typu C, B1, B2, PP, prowitamina A, liczne sole mineralne (potasu, wapnia, magnezu) czy rzadkie mikroelementy m.in. kobalt, chrom i nikiel. Jednak najistotniejszym elementem czosnku są jego olejki eteryczne zawierające siarczki i allicynę, która charakteryzuje się mocnym zapachem.','czosnek-szt','','','','Czosnek (szt.)','','','',''),
(1176,1,1,'<br />Submit		<br /><br />','Cykoria to warzywo, które posiada wiele prozdrowotnych właściwości. Doskonale sprawdzi się jako dodatek do sałatek i zapiekanek, a także innych potraw. Mała liczba kalorii w cykorii sprawia, że nie jest obciążająca dla organizmu i może stanowić składnik niemal każdej diety.','cykoria-tacka-500g','','','','Cykoria (tacka 500g)','','','',''),
(1177,1,1,'','Cukinia jest łagodnym w smaku, lekkostrawnym warzywem. Jest ceniona za wysoką wartość dietetyczną. Zawiera potas, żelazo i magnez oraz witaminę C, witaminę K, witaminę PP i witaminę B1, beta karoten. Zaletą cukinii jest to, że nie odkładają się w niej metale ciężkie. Ponadto warzywo odkwasza organizm i pozytywnie wpływa na proces trawienia.','cukinia-z-wlasnych-upraw-szt','','','','Cukinia Z WŁASNYCH UPRAW (szt)','','','',''),
(1178,1,1,'','Składniki krem kokosowy 8-% (woda, ekstrakt z kokosa w proszku), cukier, truskawka 5,0%, skrobia modyfikowana, błonnik cytrusowy, substancja zagęszczająca: pektyny; koncentrat soku z poziomki 0,2%, naturalne aromaty, koncentrat soku z buraka, wegańskie kultury bakterii jogurtowych.','deser-weganski-ave-vege-truskawka-poziomka-bakoma-150g','','','','Deser wegański Ave Vege truskawka-poziomka “Bakoma” 150g','','','',''),
(1179,1,1,'','Borówka amerykańska ma wysokie wartości odżywcze. Jej owoce są bogatym źródłem witamin oraz makro- i mikroelementów. Zawierają witaminy A, B, C, E oraz PP, cynk, potas, selen, miedź, magnez, żelazo, wapń oraz bardzo dużą ilość antyoksydantów. Ze względu na duże wartości odżywcze i niską kaloryczność, borówka amerykańska jest idealnym produktem dietetycznym. Jej owoce poprawiają wzrok, regulują trawienie oraz są pomocne w walce z miażdżycą.','borowka-250g','','','','Borówka (250g)','','','',''),
(1180,1,1,'','Jogurt z kulturami bakterii La-5® i BB-12® wzbogacony witaminami B6, B12, D3.','jogurt-naturalny-z-wit-janaturalnie-200g','','','','Jogurt naturalny z wit. ,,Janaturalnie” 200g','','','',''),
(1181,1,1,'Wartość energetyczna 364/87<br />Tłuszcz	4.5g<br />Węglowodany 6.9g<br />Białko	4.7<br />Wapń	178','Jogurt naturalny Jana ma lekką, kremową konsystencję i delikatny smak. Bogaty w wapń i magnez. To świetna przekąska, a także idealny dodatek do zup, sałatek i sosów.','jogurt-naturalny-jana-380g','','','','Jogurt naturalny „Jana” 380g','','','',''),
(1182,1,1,'Wartość energetyczna (kJ) 242.0 Wartość energetyczna (kcal) 58.0 Tłuszcz (g) 2.0 w tym kwasy tłuszczowe nasycone (g) 1.4, Węglowodany (g) 5.9 w tym cukry (g) 5.6 Białko (g) 4.0 Sól (g) 0.13','Jogurt naturalny z Piątnicy powstaje wyłącznie z mleka oraz żywych kultur bakterii jogurtowych. Nie zawiera mleka w proszku ani białek mleka. Ma lekko kremową konsystencję i delikatny smak. Dostarcza pełnowartościowego białka, wit. A, B2 i B12, a także wapnia i magnezu.','jogurt-naturalny-piatnica-170g','','','','Jogurt naturalny „Piątnica” 170g','','','',''),
(1183,1,1,'','Smakują podobnie do samego korzenia. Mają ostry, wyrazisty i lekko piekący smak. Idealne jako dodatek do kanapek, sałatek czy wiosennego twarożku.','kielki-swieze-rzodkiewki-bio-opak-50g','','','','Kiełki świeże rzodkiewki BIO (opak. 50g)','','','',''),
(1184,1,1,'','To produkt wyjątkowo bogaty w składniki odżywcze. Dzięki połączeniu różnych rodzajów kiełek stanowi źródło witamin i minerałów niezbędnych w diecie. Idealne jako dodatek do kanapek, sałatek czy wiosennego twarożku.','kielki-swieze-mix-bio-opak-50g','','','','Kiełki świeże MIX BIO (opak. 50g)','','','',''),
(1185,1,1,'','Charakteryzują się pikantnym smakiem i delikatnym zapachem. To świetny dodatek do sałatek i kanapek. Tak jak dorosłe róże brokuła zawierają sulforafan – substancję o działaniu antynowotworowym.','kielki-swieze-brokula-bio-opak-50g','','','','Kiełki świeże brokuła BIO (opak. 50g)','','','',''),
(1186,1,1,'','Kiełki pora zawierają mnóstwo witamin (zwłaszcza A, B, C i E) oraz makro- i mikroelementów (wapń, żelazo, jod czy miedź). Spożywanie kiełek pora znacznie obniża poziom złego cholesterolu oraz wspomaga układ odpornościowy.','kielki-pora-opak-35g','','','','Kiełki pora (opak. 35g)','','','',''),
(1187,1,1,'','Kiełki na patelnię stir-fry mają delikatny smak, który dobrze komponuje się z kurczakiem, rybami, ryżem czy kaszą. Są bogate w kwas foliowy, B1, miedź, mangan, fosfor oraz witaminę B6. Kiełki są także źródłem błonnika pokarmowego.','kielki-na-patelnie-stir-fry-opak-200g','','','','Kiełki na patelnię stir-fry (opak. 200g)','','','',''),
(1188,1,1,'','Kiełki jarmużu Pokarm Życia są bogate w witaminę A, K i C, a także w sód, potas i żelazo. Jarmuż znany jest ze swych właściwości antyoksydacyjnych, przeciwnowotworowych i przeciwzapalnych.','kielki-jarmuzu-opak-50g','','','','Kiełki jarmużu (opak. 50g)','','','',''),
(1189,1,1,'','Oprócz witamin i minerałów Kiełki fasoli Mung zawierają dobrze przyswajalne białko. Mogą regulować stężenie cholesterolu, obniżać poziom cukru i ciśnienie krwi. Mają również działanie odkażające oraz wpływają korzystnie na poprawę odporności organizmu. W smaku są dość intensywne, słodkie z nutą goryczy.','kielki-fasoli-mung-opak-150g','','','','Kiełki fasoli Mung (opak. 150g)','','','',''),
(1190,1,1,'','Kiełki buraka oprócz dużej ilości witamin A, C, B1, zawierają wiele cennych składników mineralnych, takich jak potas, wapń, żelazo, magnez, miedź, mangan. Ze względu na zawartość niezbędnego w procesie tworzenia czerwonych ciałek krwi kobaltu są niezwykle cenne przy leczeniu anemii.','kielki-buraka-opak-40g','','','','Kiełki buraka (opak. 40g)','','','',''),
(1191,1,1,'','Wyjątkowo jędrne liście sprawiają, że kapusta pekińska idealnie nadaje się jako baza do różnego rodzaju sałatek. Kapusta pekińska jest produktem niskokalorycznym. Znajduje się w niej tyle samo witaminy C, co w cytrynie. Dodatkowo w kapuście pekińskiej znajdziemy też witaminę A, witaminy z grupy B, a także rutynę i beta-karoten.','kapusta-pekinska-szt','','','','Kapusta pekińska (szt.)','','','',''),
(1192,1,1,'','Jej liście zwinięte w główkę charakteryzują się pomarszczoną fakturą. Kapusta włoska to prawdziwa skarbnica witamin, składników mineralnych i cennego błonnika. Warzywo zawiera beta-karoten, witaminę A, witaminę C, witaminę E, wapnia, który wzmacnia kości oraz potasu zapewniającego siłę oraz prawidłowe funkcjonowanie mięśni. We włoskiej kapuście znajduje się również witamina K, która wpływa na krzepliwość krwi.','kapusta-wloska-szt','','','','Kapusta włoska (szt.)','','','',''),
(1193,1,1,'','Czerwona kapusta charakteryzuje się czerwono-fioletową barwą. Jej główki o twardych, zbitych liściach są zazwyczaj niewielkie lub średniej wielkości. Czerwona kapusta łączy w sobie bogactwo składników odżywczych warzyw kapustnych oraz antyoksydacyjne właściwości warzyw czerwonych. To właśnie czerwone barwniki zawarte w tej odmianie kapusty głowiastej – antocyjany sprawiają, że można ją nazwać warzywem zdrowia i młodości. Antocyjany mają bowiem właściwości przeciwutleniające, dzięki czemu chronią organizm przed wolnymi rodnikami.','kapusta-czerwona-szt-ok-2kg','','','','Kapusta czerwona (szt. ok. 2kg)','','','',''),
(1194,1,1,'','Kapusta Pak Choi stanowi częsty dodatek do zup, owoców morza oraz dań mięsnych, np. w postaci nadzienia sajgonek. Idealnie komponuje się z warzywami, dlatego z kapusty pak choi można zrobić różnego rodzaju sałatki, a także dania typu stir-fry, których podstawą przyrządzenia jest szybkie smażenie.','kapusta-pak-choi-opak-2-szt','','','','Kapusta Pak Choi (opak. 2 szt.)','','','',''),
(1195,1,1,'Składniki: jogurt naturalny, kultury bakterii w tym: Bifidobacterium BB-12 i Lactobacillus acidophilus La-5, witaminy: B6, B12, D3.<br />na 100 g	%RWS*<br />Wartość energetyczna	345 kJ / 82 kcal	4%<br />Tłuszcz	4,0 g	6%<br />w tym kwasy tłuszczowe nasycone	2,5 g	13%<br />Węglowodany	6,9 g	3%<br />w tym cukry	6,9 g	8%<br />Białko	4,7 g	9%<br />Sól	0,14 g	2%<br />Witaminy na 100 g	%DRWS**<br />Witamina B6	0,12 mg	15 %<br />Witamina B12	0,375 µg 	15 %<br />Witamina D	0,75 µg	15 %','Jogurt z kulturami bakterii La-5® i BB-12®, wzbogacony witaminami B6, B12, D3.','jogurt-naturalny-jana-200g','','','','Jogurt naturalny „Jana” 200g','','','',''),
(1196,1,1,'Wartość energetyczna	392 kJ/ 93 kcal<br />Tłuszcz	2,7 g<br />W tym kwasy tłuszczowe nasycone	2,0 g<br />Węglowodany 13 g<br />W tym cukry 9,5 g<br />Białko	4,2 g<br />Sól 0,09 g','Jogurt kozi truskawkowy. Bez dodatku mleka krowiego. Bez syropu glukozowo-fruktozowego. Zawiera korzystne dla układu pokarmowego żywe kultury bakterii Lactobacillus.','jogurt-kozi-truskawkowy-danmis-125g','','','','Jogurt kozi truskawkowy „Danmis” 125g','','','',''),
(1197,1,1,'','Jogurt naturalny bez laktozy, o wyjątkowo kremowej konsystencji. Spożywany bezpośrednio sprawdzi się w roli przekąski. Stanowi idealny dodatek do zup i sałatek, a także bazę do dipów.','jogurt-naturalny-bez-laktozy-lowicz-200g','','','','Jogurt naturalny bez laktozy „Łowicz” 200g','','','',''),
(1198,1,1,'Wartość energetyczna	392 kJ/ 93 kcal<br />Tłuszcz	2,7 g<br />W tym kwasy tłuszczowe nasycone	2,0 g<br />Węglowodany 13 g<br />W tym cukry 9,5 g<br />Białko	4,2 g<br />Sól 0,09 g','Jagodowy jogurt produkowany wyłącznie z mleka koziego. Bez dodatku mleka krowiego. Zawiera korzystne dla układu pokarmowego żywe kultury bakterii Lactobacillus.','jogurt-kozi-jagodowy-danmis-125g','','','','Jogurt kozi jagodowy „Danmis” 125g','','','',''),
(1199,1,1,'Wartość energetyczna	392 kJ/ 93 kcal<br />Tłuszcz	2,7 g<br />W tym kwasy tłuszczowe nasycone	2,0 g<br />Węglowodany 13 g<br />W tym cukry 9,5 g<br />Białko	4,2 g<br />Sól 0,09 g','Jogurt brzoskwiniowy produkowany na bazie mleka koziego. Swoją wyjątkowo gładką konsystencję zawdzięcza zagęszczaniu poprzez filtrację, bez dodatku żelatyny.','jogurt-kozi-brzoskwiniowy-danmis-125g','','','','Jogurt kozi brzoskwiniowy „Danmis” 125g','','','',''),
(1200,1,1,'','Melisa posiada karbowane lub ząbkowane, intensywnie zielone liście. Kwitnie wiosną i latem, dając małe, jasnożółte kwiaty. Liście melisy mają delikatny, cytrynowy smak i aromat, dlatego często są wykorzystywane w kuchni oraz w produkcji likierów i nalewek.','melisa-w-doniczce-szt','','','','Melisa w doniczce (szt.)','','','',''),
(1201,1,1,'','Papryka jest dobrym źródłem wartości odżywczych. Ponadto jako jedno z nielicznych warzyw, papryka zachowuje swoje właściwości pod wpływem duszenia i pieczenia. Świeża papryka zawiera więcej witaminy C niż cytryna, a sproszkowana poprawia trawienie i pobudza apetyt. Do właściwości leczniczych papryki zalicza się też mi.in. zapobieganie zwapnieniu naczyń krwionośnych i likwidowanie bólu głowy. Zawarty w papryce likopen wychwytuje wolne rodniki. Papryka dostarcza sporo witamin z grupy B oraz potasu, fosforu, żelaza i magnezu i niewiele kalorii.','papryka-czerwona-kg','','','','Papryka czerwona (kg)','','','',''),
(1202,1,1,'','Ogórek cenimy przede wszystkim za orzeźwiający, delikatny smak. Ogórki są popularnym dodatkiem do sałatek lub kanapek. Ogórek składa się w 98 proc. z wody. Spożywanie ogórków to świetny sposób nawadniania dla osób mających problemy z regularnym spożywaniem płynów. Ogórki nie są jednak witaminowymi rekordzistami – owszem zawierają witaminy A, K i witaminy z grupy B, ale w niezbyt dużych ilościach. Szklarniowa odmiana ogórka świetnie nadaje się do kanapek i jako dodatek do sałatek.','ogorek-szklarniowy-szt','','','','Ogórek szklarniowy (szt)','','','',''),
(1203,1,1,'','Papryczka chilli jest bogata w witaminę C – w 100 gramach znajduje się aż 240 procent dziennego zapotrzebowania tej substancji – witaminę A, B6, żelazo, magnez, a także potas i mangan. A kapsaicyna w papryczkach chili nie tylko nadaje im ostry smak, lecz także przyspiesza spalanie tłuszczu i wspomaga odchudzanie.','papryczka-chilli-szt','','','','Papryczka chilli (szt.)','','','',''),
(1204,1,1,'','Ogórek cenimy przede wszystkim za orzeźwiający, delikatny smak. Ogórki są popularnym dodatkiem do sałatek lub kanapek. Ogórek składa się w 98 proc. z wody. Spożywanie ogórków to świetny sposób nawadniania dla osób mających problemy z regularnym spożywaniem płynów. Ogórki nie są jednak witaminowymi rekordzistami – owszem zawierają witaminy A, K i witaminy z grupy B, ale w niezbyt dużych ilościach. Szklarniowa odmiana ogórka świetnie nadaje się do kanapek i jako dodatek do sałatek.','ogorek-szklarniowy-bio-szt','','','','Ogórek szklarniowy BIO (szt.)','','','',''),
(1205,1,1,'','Mieszanka kilku rodzajów sałat stanowi świetną bazę do przygotowania ulubionego dania. Dzięki temu przygotujesz je szybciej i wygodniej, mając pewność, że w Twojej diecie nie zabraknie składników odżywczych.','mix-salat-opak-150g','','','','Mix sałat (opak. 150g)','','','',''),
(1206,1,1,'','Marchew charakteryzuje się przede wszystkim niską kalorycznością. Dzięki temu jest wyjątkowo zdrowa i poleca w przypadku diet redukcyjnych. Marchew jest przede wszystkim bogatym źródłem karotenoidów. Są to przeciwutleniacze, które nadają warzywom ich pomarańczową barwę. W marchewce znajdziemy przede wszystkim mnóstwo luteiny, zeaksantyny, likopenu i beta-karotenu (prowitaminy A).','marchew-szt','','','','Marchew (szt)','','','',''),
(1207,1,1,'','Marchew charakteryzuje się przede wszystkim niską kalorycznością. Dzięki temu jest wyjątkowo zdrowa i poleca w przypadku diet redukcyjnych. Marchew jest przede wszystkim bogatym źródłem karotenoidów. Są to przeciwutleniacze, które nadają warzywom ich pomarańczową barwę. W marchewce znajdziemy przede wszystkim mnóstwo luteiny, zeaksantyny, likopenu i beta-karotenu (prowitaminy A).','marchew-kg','','','','Marchew (kg)','','','',''),
(1208,1,1,'','','marchew-fioletowa-kg','','','','Marchew fioletowa (kg)','','','',''),
(1209,1,1,'','Korzeniowa odmiana selera obfituje w wapń, sód, fosfor, żelazo i magnez. Oprócz tego zawiera witaminy z grupy B (w tym kwas foliowy, czyli witaminę B9) oraz witaminy PP, C, A i E. Niespodzianka – seler zawiera dwa razy więcej witaminy C niż cytrusy!','korzen-selera-bio-opak-1kg','','','','Korzeń selera BIO (opak. 1kg)','','','',''),
(1210,1,1,'','Maniok dostarcza w ogromnej ilości witaminy A oraz C. Dodatkowo jest źródłem potasu i wapnia. Znajdziemy w nim również żelazo. Wśród właściwości znajduje się wspomaganie trawienia.','maniok-szt-ok-800g','','','','Maniok (szt. ok. 800g)','','','',''),
(1211,1,1,'','Korzeń pietruszki to warzywo, którego właściwości lecznicze i odżywcze nie są tak bardzo doceniane jak działanie natki pietruszki. Tymczasem korzeń pietruszki od dawna znajduje zastosowanie w medycynie ludowej. W korzeniach pietruszki znajdują się m.in. flawonoidy (przeciwutleniacze, które chronią przed groźnymi chorobami), substancje śluzowe, związki cukrowe i sole mineralne.','korzen-pietruszki-szt','','','','Korzeń pietruszki (szt)','','','',''),
(1212,1,1,'Wartość energetyczna 180kj/42kcal<br />tłuszcz 1,5g<br />w tym kwasy tłuszczowe nasycone 1,1g<br />węglowodany 4,3g<br />w tym cukry 3,9g<br />białko 2,9g<br />sól 0,09g','Maślanka wrzesińska jest produktem o łagodnym orzeźwiającym smaku. Doskonale sprawdza się w upalne dni. Jest napojem lekkostrawnym. Szczególnie polecana dla rekonwalescentów odbywających kurację antybiotykową.','maslanka-wrzesinska-sm-wrzesnia-1kg','','','','Maślanka wrzesińska „SM Września” 1kg','','','',''),
(1213,1,1,'','Chrzan wielu z nas przywodzi na myśl wiosnę i Wielkanoc. Nie bez powodu – korzeń chrzanu jest niezbędnym składnikiem święconki i wielu świątecznych dań. Ta ostra w smaku przyprawa kojarzy nam się również ze zdrowiem i krzepą. Jej właściwości zdrowotne są w istocie nie do przecenienia. Włączając korzeń chrzan do diety znacznie zmniejszamy ryzyko pojawienia się nowotworu, poprawiamy trawienie i ukrwienie organizmu, a także możemy uśmierzyć ból głowy i zwalczyć wiele infekcji. Ćwikła, zupa chrzanowa, twarożek z chrzanem… propozycji podania tej cudownej rośliny jest wiele.','korzen-chrzanu-250g','','','','Korzeń chrzanu (250g)','','','',''),
(1214,1,1,'WART. ENERGETYCZNA:<br />1582 KJ/381 KCAL<br />TŁUSZCZ: 40 G<br />– W TYM KW. TŁ. NASYCONE: 24 G<br />WĘGLOWODANY: 2,6 G<br />– W TYM CUKRY: 2,6 G<br />BIAŁKO: 3,4 G<br />SÓL: 0,08 G','Mascarpone Kuchmistrza jest śmietankowo-kremowym serem typu włoskiego, podstawowym składnikiem popularnego tiramisu. Gęsty i kremowy doskonale sprawdza się także jako składnik innych deserów, kremów do ciast i tortów czy dodatek do lodów. Ma delikatnie słodki smak i aksamitną konsystencję gęstej, kremowej śmietany, dzięki czemu równie dobrze jak smak deserów, wzbogaca smak potraw podawanych na gorąco: sosów, makaronów, dań mięsnych, warzywnych, a nawet pizzy i zapiekanek.','mascarpone-kuchmistrza-mlekovita-250g','','','','Mascarpone Kuchmistrza “Mlekovita” 250g','','','',''),
(1215,1,1,'','Mascarpone Kuchmistrza jest śmietankowo-kremowym serem typu włoskiego, podstawowym składnikiem popularnego tiramisu. Gęsty i kremowy doskonale sprawdza się także jako składnik innych deserów, kremów do ciast i tortów czy dodatek do lodów. Ma delikatnie słodki smak i aksamitną konsystencję gęstej, kremowej śmietany, dzięki czemu równie dobrze jak smak deserów, wzbogaca smak potraw podawanych na gorąco: sosów, makaronów, dań mięsnych, warzywnych, a nawet pizzy i zapiekanek.','mascarpone-galbani-250g','','','','Mascarpone “Galbani” 250g','','','',''),
(1216,1,1,'','Zaliczany do produktów mleczarskich o najwyższych wartościach odżywczych. Polecany osobom z nietolerancją laktozy. Jest naturalnym probiotykiem. Kefir powinni spożywać nie tylko dorośli ale także dzieci. Polecany szczególnie sportowcom, gdyż zawartości pełnowartościowego białka przyśpiesza regenerację organizmu. Dobrze smakuje w nieprzetworzonej postaci, a także jako baza do wszelkich koktajli.','kefir-wrzesinski-400g','','','','Kefir ,,Wrześiński” 400g','','','',''),
(1217,1,1,'Wartość energetyczna 192 kJ / 46 kcal<br />Tłuszcz	1,5 g<br />w tym kwasy tłuszczowe nasycone	1,0 g<br />Węglowodany 4,7 g<br />w tym cukry 4,7 g<br />Białko	3,3 g<br />Sól 0,10 g','Kefir naturalny, to napój z mleka krowiego poddanego procesowi fermentacji. Produkt zawiera wapń, fosfor, magnez a także witaminy B2, B12, K, A i D. Jest naturalnym probiotykiem. Znakomicie sprawdzi się jako baza do koktajli owocowych.','kefir-naturalny-15-jana-375g','','','','Kefir naturalny 1,5% „Jana” 375g','','','',''),
(1218,1,1,'','Mleko nienormalizowane pełne od krów rasy Jersey, o przeciętnej zawartości tłuszczu 5%. Pasteryzowane w wysokiej temperaturze i homogenizowane. Źródło białka i wapnia.','mleko-od-krow-rasy-jersey-jana-05l','','','','Mleko od krów rasy Jersey „Jana” 0,5l','','','',''),
(1219,1,1,'','Szeroko wykorzystywana w kuchni azjatyckiej do sałatek, dań mięsnych i rybnych, zup czy past. Zawarte w niej olejki eteryczne mają hamują rozwój bakterii i wirusów. Regularnie spożywana reguluje pracę jelit.','kolendra-w-doniczce-szt','','','','Kolendra w doniczce (szt.)','','','',''),
(1220,1,1,'','Pomidor czerwony jest nie tylko smaczny, ale stanowi doskonały koktajl witaminowy. Znajdziecie w nim duże ilości witamin C, E, beta-karoten oraz cenny likopen, a także duże zasoby potasu. Do tego zawiera sporo wody i ma niską wartość kaloryczną, a co najważniejsze jest bardzo smaczny.','pomidor-czerwony-pl-szt','','','','Pomidor czerwony PL (szt)','','','',''),
(1221,1,1,'','Korzeń pietruszki to warzywo, którego właściwości lecznicze i odżywcze nie są tak bardzo doceniane jak działanie natki pietruszki. Tymczasem korzeń pietruszki od dawna znajduje zastosowanie w medycynie ludowej. W korzeniach pietruszki znajdują się m.in. flawonoidy (przeciwutleniacze, które chronią przed groźnymi chorobami), substancje śluzowe, związki cukrowe i sole mineralne.','korzen-pietruszki-kg','','','','Korzeń pietruszki (kg)','','','',''),
(1222,1,1,'','Pomidory Bawole Serce wyróżnia się spośród innych pomidorów ponadprzeciętnymi rozmiarami owoców. W zależności od odmiany pojedynczy pomidor może ważyć nawet ponad 500 gram, a jego średnica przekracza 8cm. Ale najbardziej są lubiane przede wszystkim za bardzo słodki, jasnoczerwony, mięsisty i soczysty miąższ, a także za niewielką ilość pestek i małe komory nasienne. Nadają się przede wszystkim do najbardziej do spożycia bezpośredniego.','pomidor-bawole-serce-rozamunda-szt','','','','Pomidor Bawole Serce ROZAMUNDA  (szt)','','','',''),
(1223,1,1,'','Pomidory Bawole Serce wyróżnia się spośród innych pomidorów ponadprzeciętnymi rozmiarami owoców. W zależności od odmiany pojedynczy pomidor może ważyć nawet ponad 500 gram, a jego średnica przekracza 8cm. Ale najbardziej są lubiane przede wszystkim za bardzo słodki, jasnoczerwony, mięsisty i soczysty miąższ, a także za niewielką ilość pestek i małe komory nasienne. Nadają się przede wszystkim do najbardziej do spożycia bezpośredniego.','pomidor-bawole-serce-rosamunda-kg','','','','Pomidor Bawole Serce ROSAMUNDA  (kg)','','','',''),
(1224,1,1,'','Portobello jest odmianą tego gatunku, pochodzi z Ameryki. Wyróżnia ją ciemnobrązowy kolor oraz większe rozmiary. Wysokość do 12 cm i ogromny kapelusz, osiągający nawet 10 cm średnicy. Cechują ją także głębszy i bardziej wyrazisty smak i aromat.','pieczarki-portobello-tacka-4-szt','','','','Pieczarki Portobello (tacka – 4 szt.)','','','',''),
(1225,1,1,'','Charakteryzują się lekko orzechowym smakiem. To świetny pomysł na zdrową, niskokaloryczną przekąskę. Pędy słonecznika sprawdzą się także jako dodatek do sałatek. Są źródłem potasu, cynku, miedzi, magnezu, fosforu i wapnia.','pedy-slonecznika-w-doniczce-szt','','','','Pędy słonecznika w doniczce (szt.)','','','',''),
(1226,1,1,'','Żółta papryka wśród swoich kuzynek wyróżnia się przede wszystkim dużą ilością witaminy E, zwaną witaminą młodości, oraz B6. Ta ostatnia bierze udział m.in. w przemianie aminokwasów, ułatwiając ich rozkład, umożliwia magazynowanie energii, uczestniczy w tworzeniu enzymów, hormonów i hemoglobiny. Obecne w żółtej papryce luteina i zeaksantyna bardzo korzystnie wpływają na wzrok. Jej spożywanie chroni nas też przed atakiem wolnych rodników i pomaga zachować szczupłą sylwetkę. Znajdują się też w niej pierwiastki – magnez, miedź, wapń, potas, żelazo.','papryka-zolta-kg','','','','Papryka żółta (kg)','','','',''),
(1227,1,1,'','Żółta papryka wśród swoich kuzynek wyróżnia się przede wszystkim dużą ilością witaminy E, zwaną witaminą młodości, oraz B6. Ta ostatnia bierze udział m.in. w przemianie aminokwasów, ułatwiając ich rozkład, umożliwia magazynowanie energii, uczestniczy w tworzeniu enzymów, hormonów i hemoglobiny. Obecne w żółtej papryce luteina i zeaksantyna bardzo korzystnie wpływają na wzrok. Jej spożywanie chroni nas też przed atakiem wolnych rodników i pomaga zachować szczupłą sylwetkę. Znajdują się też w niej pierwiastki – magnez, miedź, wapń, potas, żelazo.','papryka-zolta-szt','','','','Papryka żółta (szt)','','','',''),
(1228,1,1,'','Pędy groszku są delikatne a chrupiące łodyżki charakteryzują się świeżym, słodkawym smakiem, który przypomina strąki cukrowego groszku. Zapewniają przyjemną chrupkość sałatkom, kanapkom czy zupom. Smaczne i zdrowe uzupełnienie potraw kuchni azjatyckiej oraz owoców morza.','pedy-groszku-w-doniczce-szt','','','','Pędy groszku w doniczce (szt.)','','','',''),
(1229,1,1,'','Papryka typu habanero szczególne uznanie znajdzie wśród miłośników piekielnych smaków. Jest bardzo ostra i najlepiej nadaje się do przyprawiania potraw różnego typu.','papryka-habanero-50g','','','','Papryka Habanero (50g)','','','',''),
(1230,1,1,'','Papryka jest dobrym źródłem wartości odżywczych. Ponadto jako jedno z nielicznych warzyw, papryka zachowuje swoje właściwości pod wpływem duszenia i pieczenia. Świeża papryka zawiera więcej witaminy C niż cytryna, a sproszkowana poprawia trawienie i pobudza apetyt. Do właściwości leczniczych papryki zalicza się też mi.in. zapobieganie zwapnieniu naczyń krwionośnych i likwidowanie bólu głowy. Zawarty w papryce likopen wychwytuje wolne rodniki. Papryka dostarcza sporo witamin z grupy B oraz potasu, fosforu, żelaza i magnezu i niewiele kalorii.','papryka-czerwona-szt','','','','Papryka czerwona (szt)','','','',''),
(1231,1,1,'Wartość energetyczna 249 kJ/60 kcal<br />Tłuszcz 3,2 g<br />w tym kwasy tłuszczowe nasycone 1,9 g<br />Węglowodany 4,7 g<br />w tym cukry 4,7 g<br />Białko 3,0 g<br />Sól 0,1 g','Idealne w codziennej diecie – źródło łatwo przyswajalnego wapnia, białka i witamin. Dzięki procesowi UHT wolne od niebezpiecznych drobnoustrojów.','mleko-lowickie-uht-32-lowicz-1l','','','','Mleko łowickie UHT 3,2% “Łowicz” 1l','','','',''),
(1232,1,1,'Wartość energetyczna: 791kJ/189kcal, tłuszcze: 19g, węglowodany: 2g (*w tym cukry: 2g), białko: 2g, sól: 0g.','Skład:  ekstrakt kokosowy 85%, woda.','mleczko-kokosowe-real-thai-250ml','','','','Mleczko kokosowe ,,Real Thai” 250ml','','','',''),
(1233,1,1,'Wartość energetyczna 763 kJ / 185 kcal<br />Tłuszcz	19,0 g<br />– w tym kwasy tłuszczowe nasycone 16,0 g<br />Sól 0,02 g<br />Węglowodany 2,0 g<br />– w tym cukry 2,0 g<br />Białko 1,5 g','Skład: orzech kokosowy 54%, woda.','mleczko-kokosowe-mr-ming-400ml','','','','Mleczko kokosowe “Mr. Ming” 400ml','','','',''),
(1234,1,1,'ilość kalorii	748kcal<br />wartość energetyczna 3130KJ<br />tłuszcz	82,5g<br />węglowodany	0g<br />białko	0g','Produkt wykorzystywany podczas codziennego przygotowania kanapek. Nadaje się także do smażenia, sosów i wypieków.','maslo-ze-strzalkowa-strzalkowo-250g','','','','Masło ze Strzałkowa „Strzałkowo” 250g','','','',''),
(1235,1,1,'Wartość energetyczna 1341 kJ / 322 kcal<br />Tłuszcz	22 g<br />W tym kwasy tłuszczowe nasycone	15 g<br />Węglowodany 0 g<br />W tym cukry 0 g<br />Białko 31 g<br />Sól 1,1 g','Boryna to delikatny, łagodny, twardy ser. Wyglądem przypomina sery szwajcarskie. Poddawany jest długiemu procesowi dojrzewania w odpowiednich warunkach. Produkty polecany dla osób o podwyższonym poziomie cholesterolu, diabetyków oraz osób dbających o linię.','ser-dojrzewajacy-boryna-w-plastrach-sery-z-goliszewa-135g','','','','Ser dojrzewający Boryna w plastrach „Sery z Goliszewa” 135g','','','',''),
(1236,1,1,'Wartość energetyczna 1086 kJ / 262 kcal<br />Tłuszcz	22 g<br />w tym kwasy tłuszczowe nasycone	16 g<br />Węglowodany 1,0 g<br />w tym cukry 0,8 g<br />Białko	15 g<br />Sól 2,0 g','Ser półtwardy, dojrzewający z mleka owczego z dodatkiem mleka krowiego i koziego. Oryginalny ser szopski prosto z Bułgarii. Jest niezastąpionym składnikiem sałatek. Ma wyrazisty, lekko słony smak.','ser-balkanski-z-mleka-owczego-temar-150g','','','','Ser Bałkański z mleka owczego “Temar” 150g','','','',''),
(1237,1,1,'Wartość energetyczna w 100g produktu<br />Wartość energetyczna<br />962kJ/230 kcal<br />Tłuszcz 19,0g<br />Węglowodany 0,7g<br />Białko 14,0g','Oryginalny bułgarski ser szopski. Charakteryzuje się wyrazistym, lekko słonym smakiem. Dobrze się kroi, jest idealnym składnikiem sałatek. Ser bałkański produkowany jest z mleka krowiego, pasteryzowanego. Zawiera 40% tłuszczu.','ser-balkanski-z-mleka-krowiego-temar-150g','','','','Ser Bałkański z mleka krowiego “Temar” 150g','','','',''),
(1238,1,1,'100 g jogurtu<br />Wartość energetyczna 410 kJ/97 kcal<br />Tłuszcz	2,5 g<br />w tym kwasy nasycone 1,8 g<br />Węglowodany 15,5 g<br />w tym cukryb14,5 g<br />Białko	3,3 g<br />Sól 0,10 g','Jogurt jagodowy, powstały ze składników posiadających certyfikat BIO, co jest gwarancją, że został przygotowany z produktów które uprawiano bez użycia nawozów sztucznych i pestycydów oraz owoców, które nie były genetycznie modyfikowane.','jogurt-bio-bakoma-z-jagodami-140g','','','','Jogurt BIO „Bakoma” z jagodami 140g','','','',''),
(1239,1,1,'Sałata Lollo Bianco ma niezwykle atrakcyjny wygląd. Jej kędzierzawe, zielone liście tworzą luźną rozetę, która wygląda trochę jak postrzępiona kula. Często stanowi bardzo atrakcyjny element dekoracyjny wielu dań.Zastanawiasz się gdzie kupić Sałatę Lollo Bianco? Znajdziesz ją w naszym sklepie w atrakcyjnej cenie!','Sałata Lollo Bianco to bogactwo soli mineralnych, oraz witamin takich jak B1, B2, C i E oraz, co warto podkreślić,  najbogatsze ze wszystkich warzyw źródło kwasu foliowego. Sałaty zawierają sporo błonnika, który zmniejsza przyswajanie tłuszczów i cukrów','salata-lollo-bianco-szt','','','','Sałata Lollo Bianco (szt.)','','','',''),
(1240,1,1,'','Sałata lodowa, zwana także kruchą, to jeden z najpopularniejszych gatunków sałat na naszym stole. Ma wiele zalet. Można ją kupić przez cały rok, długo przechowywać w lodówce, kroić nożem. Smaczna jako samodzielne warzywo, doskonała w sałatkach, idealna do kanapek. Sałata lodowa ma niewiele kalorii. Pomaga zachować szczupłą sylwetkę, poprawiając trawienie. Sałata lodowa zawiera witaminy A, D, E, B9, kwas foliowy i beta-karoten. Jest dobrym źródłem wielu cennych składników odżywczych, takich jak żelazo, magnez, potas czy wapń.','salata-lodowa-szt','','','','Sałata lodowa (szt.)','','','',''),
(1241,1,1,'','Rzodkiew biała ma w sobie więcej olejków eterycznych niż jej mała kuzynka rzodkiewka. Jest też od niej bogatsza w wartości odżywcze. Chociaż nie posiada tak atrakcyjnej, ciemnoróżowej skórki, stanowi równie wdzięczną dekorację kanapek i surówek. Rzodkiew biała jest zaskakująco zdrowa – zawiera sporo witaminy C, która jest silnym antyoksydantem, wzmacnia cerę i pomaga oczyścić organizm z toksyn. Warzywo to dostarcza również przeciwutleniaczy z grupy antocyjanów, które wzmacniają odporność i wykazują działanie przeciwnowotworowe. Jest ponadto bogatym źródłem minerałów.','rzodkiew-biala-kg','','','','Rzodkiew biała (kg)','','','',''),
(1242,1,1,'','To jędrne warzywo o pięknym kolorze, kojarzy się przede wszystkim z wiosennym twarożkiem i kolorowymi kanapkami. Liście rzodkiewki również są jadalne i znajdują swoje zastosowanie w kuchni. Rzodkiewka bogata jest głównie w witaminy i minerały. Wśród nich znajdziemy witaminy: A, C oraz z grupy B, a także żelazo, fosfor, ','rzodkiewka-peczek','','','','Rzodkiewka (pęczek)','','','',''),
(1243,1,1,'','Rukola, czyli rokietta siewna zyskuje coraz większą popularność zwłaszcza wśród fanów kuchni śródziemnomorskiej. Rukola zawiera wiele ważnych składników odżywczych. W 100 gr znajdziemy m.in. ','rukola-opak-100g','','','','Rukola (opak. 100g)','','','',''),
(1244,1,1,'','Por to niepozorne warzywo, które posiada wiele cennych właściwości zdrowotnych. Ma niewiele kalorii, niski indeks glikemiczny, ale dużą zawartość witamin i minerałów. Warto dodawać to warzywo do większości potraw, ponieważ oprócz działania prozdrowotnego, jest smaczne i aromatyczne.','por-szt','','','','Por (szt.)','','','',''),
(1245,1,1,'Por jest bogaty w błonnik, witaminy (szczególnie witaminę K, witaminę C i witaminy z grupy B) oraz minerały, takie jak potas. Jest to zdrowy i niskokaloryczny składnik, który można dodawać do wielu różnych potraw, aby wzbogacić ich smak i wartość odżywczą.','Obrany por jest popularnym składnikiem zupy porowej, sałatek, gulaszy, farszu do pierogów oraz wielu innych dań. Jest on delikatny w smaku i dodaje potrawom lekko cebulowego aromatu.','por-obrany-bona-agra-700g','','','','Por obrany (Bona-Agra) 700g','','','',''),
(1246,1,1,'','Uważa się, że podobnie jak duże pomidory, pomidorki koktajlowe należą do najzdrowszej żywności świata! Warto je jeść ze względu na bogactwo witaminy A – garść pokryje dzienne zapotrzebowanie na tę witaminę w 15 procentach. Witamina A korzystnie wpływa na wzrok i wzmacnia odporność. Na uwagę w pomidorkach koktajlowych zasługuje też witamina C, która uszczelnia naczynia krwionośne, odpowiada za elastyczność skóry, reguluje poziom cholesterolu i ułatwia przyswajanie żelaza. Garść pomidorków koktajlowych pokrywa dzienne zapotrzebowanie na witaminę C w 10 procentach.','pomidorki-koktajlowe-100g','','','','Pomidorki koktajlowe (100g)','','','',''),
(1247,1,1,'','Pomidor malinowy to odmiana warzywa do uprawy gruntowej. Charakteryzuje się sporej wielkości owocami oraz pięknym, malinowym kolorem. Powierzchnia tych pomidorów jest żebrowana, określana również mianem sercowatej. Jego miąższ jest niezwykle soczysty, mięsisty i bardzo smaczny o lekko słodkawym smaku.','pomidor-malinowy-pl-szt','','','','Pomidor malinowy PL (szt)','','','',''),
(1248,1,1,'WART. ENERGETYCZNA:<br />1387 KJ / 334 KCAL<br />TŁUSZCZ:26 G<br />– W TYM KW. TŁ. NASYCONE:17 G<br />WĘGLOWODANY:0 G<br />– W TYM CUKRY:0 G<br />BIAŁKO:25 G<br />SÓL:1,2 G<br />ZAWARTOŚĆ LAKTOZY:&lt;0,01 G','To ser typu szwajcarskiego. Charakteryzuje się łagodnym, słodkawym smakiem i sprężystym miąższem z oczkami, który powstaje w procesie dojrzewania. Bezpieczny dla osób cierpiących na nietolerancję laktozy.','ser-sokol-bez-laktozy-w-plastrach-mlekovita-150g','','','','Ser Sokół bez laktozy w plastrach „Mlekovita” 150g','','','',''),
(1249,1,1,'','Lazur','ser-plesniowy-w-plastrach-blekitny-lazur-100g','','','','Ser pleśniowy w plastrach błękitny ,,Lazur” 100g','','','',''),
(1250,1,1,'Wartość energetyczna 1 430 kJ/ 344 kcal<br />Tłuszcz	26 g<br />W tym kwasy tłuszczowe nasycone	17 g<br />Węglowodany 2,5 g<br />W tym cukry 1,0 g','Kozie sery są najbogatszym źródłem wapnia pośród produktów spożywczych. Spożycie 10 dag pełnotłustego sera koziego pokrywa w pełni dzienne zapotrzebowanie człowieka na ten składnik. Idealnie sprawdzi się jako dodatek do kanapek.','ser-kozi-twardy-w-plastrach-danmis-100g','','','','Ser kozi twardy w plastrach „Danmis” 100g','','','',''),
(1251,1,1,'Składniki: pasteryzowane mleko kozie, sól, podpuszczka mikrobiologiczna, bakterie kwasu mlekowego.Wartość odżywcza:<br />Zawartość soli (ogólnie) w zadeklarowanej jednostce (g lub ml) 2,3 g<br />Zawartość węglowodanów (cukry) w zadeklarowanej jednostce (g) 0,1 g<br />Wielkość porcji 100 g<br />Jednostka będąca podstawą przeliczeń g/100 g<br />Wartość energetyczna w zadeklarowanej jednostce 1252 kJ/100g<br />Wartość energetyczna kcal (energia) w zadeklarowanej jednostce 299 kcal/100g','Aromatyczny Ser kozi sałatkowy Sirtakis dojrzewający w solance. Idealny do sałatek oraz potraw kuchni śródziemnomorskiej. Produkowany z mleka koziego, pasteryzowanego.','ser-kozi-salatkowy-sirtakis-180g-obecnie-firmy-danmis','','','','Ser kozi sałatkowy “Sirtakis” 180g (obecnie firmy Danmis)','','','',''),
(1252,1,1,'','ser kozi twardy 44% (mleko kozie pasteryzowane, sól, stabilizator: chlorek wapnia,','ser-kozi-kremowy-danmis-100g','','','','Ser kozi kremowy ,,Danmis” 100g','','','',''),
(1253,1,1,'WART. ENERGETYCZNA:<br />1387 KJ/334 KCAL<br />TŁUSZCZ:26 G<br />– W TYM KW. TŁ. NASYCONE:17 G<br />WĘGLOWODANY:0 G<br />– W TYM CUKRY:0 G<br />BIAŁKO:25 G<br />SÓL:1,5 G','Ser Gouda należy do serów dojrzewających typu holenderskiego o łagodnym smaku. Jest skoncentrowanym i najlepszym źródłem niezbędnych dla organizmu związków mineralnych. To bogate źródło wapnia. Nie zawiera konserwantów. Odpowiedni dla osób na diecie bezglutenowej i wegetariańskiej.','ser-gouda-w-plastrach-mlekovita-150g','','','','Ser Gouda w plastrach „Mlekovita” 150g','','','',''),
(1254,1,1,'','Ziemniaki to niedoceniany i często uważany za zbędny składnik naszej diety. Ziemniaki są w rzeczywistości bogatym źródłem witamin i składników odżywczych. Sprzedajemy ziemniaki z własnych upraw w atrakcyjnej cenie.','ziemniaki-z-wlasnych-upraw-worek-5kg','','','','Ziemniaki Z WŁASNYCH UPRAW (worek 5kg)','','','',''),
(1255,1,1,'','Ziemniaki to niedoceniany i często uważany za zbędny składnik naszej diety. Ziemniaki są w rzeczywistości bogatym źródłem witamin i składników odżywczych. Sprzedajemy ziemniaki z własnych upraw w atrakcyjnej cenie.','ziemniaki-z-wlasnych-upraw-worek-15kg','','','','Ziemniaki Z WŁASNYCH UPRAW (worek 15kg)','','','',''),
(1256,1,1,'','Marchew, pietruszka, por i seler – oto sekret zdrowia. Stanowiąca kulinarny niezbędnik każdej gospodyni, włoszczyzna, poza walorami smakowo-zapachowymi, dostarcza nam również wielu cennych wartości odżywczych. To warzywo, nie dość, że umożliwia nam przygotowywanie naturalnych wywarów do zup, zapewnia imponującą podaż witamin i minerałów w codziennej diecie. Przy pomocy włoszczyzny ugotujemy nie tylko idealny rosół – odpowiednio przyrządzone warzywa korzeniowe mogą bowiem stać się inspiracją do wielu kuchennych eksperymentów.','wloszczyzna-szt','','','','Włoszczyzna (szt.)','','','',''),
(1257,1,1,'','Gotowane, pieczone, smażone, w formie purée, frytek albo chipsów – każdy z nas ma swój ulubiony wariant ziemniaków. Bez wątpienia to jedne z najbardziej popularnych produktów na naszych stołach. Chociaż uważa się, że są tuczące, tak naprawdę mają mało kalorii, za to zawierają wiele cennych substancji. Ziemniaki nie zawierają tłuszczu i są bogate w mikroelementy, zwłaszcza potas, magnez, żelazo, wapń i fosfor. Poza tym są źródłem witamin A, B1, B2, B3, B6, C, E, K i PP. W ziemniakach znajduje się też błonnik pokarmowy.','ziemniaki-z-wlasnych-upraw-kg','','','','Ziemniaki Z WŁASNYCH UPRAW (kg)','','','',''),
(1258,1,1,'','Szpinak niesłusznie został okryty złą sławą i uznany za jedną z najgorszych potraw dla dzieci. Ta zielona roślina jest podstawowym składnikiem zdrowej diety, a do tego przyrządzona w prawidłowy sposób jest niesamowicie smaczna. Szpinak zasługuje na główne miejsce przy obiadowym stole. Warto się do niego przekonać ze względu na liczne zdrowotne właściwości i niewielką kaloryczność. Wykorzystywany jako baza do sałatek, dodatek do farszów czy past, a także uzupełnienie dań rybnych i mięsnych.','szpinak-opak-200g','','','','Szpinak (opak. 200g)','','','',''),
(1259,1,1,'','Seler jest wspaniałym produktem odchudzającym, a szczególnie jego odmiana naciowa. Ten gatunek selera możemy jeść na surowo, dzięki czemu nie tracimy cennych witamin. Doskonale nadaje się do sałatek, zup i surówek. Można zrobić z niego napój, który doskonale orzeźwia. Mówi się, że szklanka wypitego eliksiru – sok jabłkowy połączony z selerem – daje cudowne efekty: oczyszcza organizm, likwiduje obrzęki, nawilża skórę, wzmacnia włosy, nadaje aksamitną gładkość cerze, chroni skórę przed nowotworami.','seler-naciowy-szt','','','','Seler naciowy (szt.)','','','',''),
(1260,1,1,'','Seler to jedno z najstarszych warzyw na świecie. Jest źródłem witaminy C, witamin z grupy B, witaminy E. Spośród warzyw korzeniowych seler zawiera najwięcej fosforu, ale dostarcza także wapnia, cynku, potasu, magnezu i żelaza. Poza tym seler naciowy, jak większość warzyw, jest niskokaloryczny – 100 g tego warzywa dostarcza tylko 17 kcal. Niezbędny w przygotowywaniu bulionu oraz innych zup.','korzen-selera-kg','','','','Korzeń selera (kg)','','','',''),
(1261,1,1,'','Sałata rzymska to odmiana sałaty znana dzięki sałatce Cezar, której jest składnikiem. Sałata ta nie tylko nadaje posiłkom wyjątkowego smaku, ale jest też bogata w składniki odżywcze. Cechuje się niską kalorycznością oraz jest źródłem cennych dla zdrowia witamin i składników mineralnych. Sałata ta to bogactwo beta-karotenu, witaminy K, folianów, witaminy C, witaminy B1 i witaminy B2. Zawiera też znaczną ilość wapnia, żelaza, potasu, ','salata-rzymska-szt','','','','Sałata rzymska (szt.)','','','',''),
(1262,1,1,'','Sałata masłowa wyróżnia się wyjątkowo delikatnymi, soczystymi liśćmi i łagodnym, słodkawym smakiem, niekiedy z nutą goryczki. Zasobne w wodę (stanowi około 95% składu) warzywo ma bardzo niewielką wartość energetyczną i znikome ilości tłuszczów. W zielonych liściach tkwi jednak ogromne bogactwo substancji bioaktywnych – witamin, minerałów, fitozwiązków.','salata-maslowa-szt','','','','Sałata masłowa (szt.)','','','',''),
