(1279,1,1,'','Pieczarki to najbardziej popularne grzyby uprawne na świecie. Wbrew dawnym stwierdzeniom nie są bezwartościowe pod względem odżywczym. Zawierają dużo witamin z grupy B, a także związków bioaktywnych, m.in. lektyn i tyrozynazy. Badania naukowe potwierdzają przeciwnowotworowe, odpornościowe, antybakteryjne i genoprotekcyjne właściwości pieczarek.','pieczarki-kg','','','','Pieczarki (kg)','','','',''),
