(1298,1,1,'','Sałata Lollo Rosso jest jedną z najłatwiej rozpoznawalnych sałat. Nie ma typowej główki, tworzy natomiast rozetę, która składa się z luźno ułożonych, dość dużych, kędzierzawych liści. Zawierają one więcej witamin A i C niż zielone odmiany sałat. Polecane do bezpośredniego spożycia na kanapki lub do sałatek lub do dekoracji potraw.','salata-lollo-rosso-szt','','','','Sałata Lollo Rosso (szt.)','','','',''),
(1299,1,1,'','Roszponka to roślina podobna do sałaty o małych liściach. Jednak na tle sałat wyróżnia się nie tylko rozmiarem liści, lecz także wartościami odżywczymi, a co za tym idzie – właściwościami leczniczymi. Roszponka zawiera od trzech do czterech razy więcej beta-karotenu i witaminy C niż sałata siewna. To sałata o delikatnym smaku. W kuchni często stosowana jako baza do sałatek. Jej nieduże liście tworzą charakterystyczne rozety, które świetnie nadają się do dekoracji dań.','roszponka-opak-100g','','','','Roszponka (opak. 100g)','','','',''),
