(1365,1,1,'','Produkt otrzymywany z przemiału oczyszczonego ziarna pszenicy. Zawiera wiele składników mineralnych niezbędnych do prawidłowego funkcjonowania organizmu. Posiada dużą wartość odżywczą, dlatego też stanowi podstawowy produkt w żywieniu niemowląt.','kasza-manna-blyskawiczna-kupiec-400g','','','','Kasza manna błyskawiczna ,,Kupiec” 400g','','','',''),
(1366,1,1,'','Kasza jaglana jest lekkostrawna i niezwykle zdrowa. W połączeniu ze świeżymi owocami, orzechami może stanowić bazę do pożywnych koktajli bogatych nie tylko w zdrowe węglowodany, ale także szereg składników mineralnych i witamin.','kasza-jaglana-kupiec-4x100g','','','','Kasza jaglana ,,Kupiec” 4x100g','','','',''),
(1367,1,1,'Wartość energetyczna 1553kj/367kcl.<br />Białko:13 g.<br />Błonnik:6 g.<br />Węglowodany:69 g.<br />Cukry:0,7 g.<br />Tłuszcze:3. g.<br />Sól :0,01 g.','Kasza gryczana prażona to poddane obróbce cieplnej ziarna gryki o ciemnobrązowej barwie i wyrazistym smaku. Gryka to doskonałe źródło krzemu, który chroni organizm przed zawałem serca, zmęczeniem, łamliwością włosów i paznokci.','kasza-gryczana-prazona-melvit-4x100g','','','','Kasza gryczana prażona ,,Melvit” 4x100g','','','',''),
