(1370,1,1,'wartość energetyczna 190,31/42kcal<br />tłuszcz 0.09g<br />w tym tym kwasy tłuszczowe nasycone 0,02g<br />węglowodany 10,60g<br />w tym cukry 9,29g<br />błonnik 1,21g<br />białko 1,45g<br />sól 0,90g','BURAKI TARTE WIÓREK 315 ml, to starte na miazgę buraki ćwikłowe w połączeniu z cukrem, solą i octem wyprodukowane według starej rodzinnej receptury. Nasz produkt jest delikatny w smaku, polecamy go także dla dzieci. To codzienny dodatek do wielu dań obiadowych zwłaszcza pyz z sosem oraz tradycyjnego kotleta schabowego i mielonego. Buraki są cennym źródłem witamin i minerałów dlatego nie powinno ich zabraknąć w naszej diecie.','burak-tarty-wiorek-300g','','','','Burak tarty „Wiórek” 300g','','','',''),
(1371,1,1,'Zawartość soli 0,2 g<br />Wielkość porcji	100 g<br />Zawartość tłuszczów(g)	&lt;0,5<br />Zawartość węglowodanów (cukry) (g) 8,8 g<br />Zawartość węglowodanów (g) 9,4 g','Buraczki wiórki to jedna z najpyszniejszych i najbardziej efektownych form podania buraków. Soczyste, polskie warzywa o głębokiej, rubinowej barwie, połączono z odrobiną octu, cukru i soli, umożliwiając wszechstronne wykorzystanie produktu i doprawienie wedle uznania.','buraczki-wiorki-rolnik-370ml','','','','Buraczki wiórki ,,Rolnik” 370ml','','','',''),
