(1376,1,1,'Składniki: buraki ćwikłowe (94%), ocet spirytusowy, cukier, sól, woda.Wartości odżywcze w 100 g:<br />Wartość energetyczna 191 kJ<br />Wartość energetyczna 45 kcal<br />Tłuszcz &lt;0,5 g<br />w tym kwasy tłuszczowe nasycone &lt;0,1 g<br />Węglowodany 8,0 g<br />w tym cukry 7,3 g<br />Białko 1,7 g<br />Sól 0,41 g','Buraczki tarte Rolnik to jedna z ulubionych surówek w kuchni polskiej, słynąca z cennych wartości odżywczych i wysokich walorów smakowych. Każdy słoik skrywa starannie starte, gotowane buraki ćwikłowe, doprawione wyłącznie octem, cukrem i solą, pozostawiając Ci pełną, kulinarną swobodę, co do formy ich podania. Buraczki są wyśmienitym, pełnym witamin i minerałów dodatkiem do mięs, barszczu czerwonego oraz chłodnika. Buraczki tarte Rolnik znajdziesz także w mniejszych słoikach.','buraczki-tarte-rolnik-350g','','','','Buraczki tarte “Rolnik” 350g','','','',''),
