(1380,1,1,'Składniki: bób ziarno, woda, sól, koper.Wartość odżywcza w 100 g:<br />Wartość energetyczna 267 kJ<br />Wartość energetyczna 64 kcal<br />Tłuszcz 0,5 g<br />w tym kwasy tłuszczowe nasycone 0,2 g<br />Węglowodany 11 g<br />w tym cukry 1,8 g<br />Białko 5,5 g<br />Sól 0,94 g','Bób konserwowy Rolnik z dodatkiem świeżego kopru, pozwoli Ci szybko wyczarować wiele pysznych, sycących i bardzo zdrowych potraw, także kuchni wegetariańskiej i wegańskiej. Jako roślina strączkowa, obfituje w wartości odżywcze. Jest bogaty w kwas foliowy, potas i błonnik. Skutecznie pomaga w walce z cholesterolem LDL. Bób konserwowy możesz podawać od razu po wyjęciu z puszki – z masłem i solą lub dodać do ulubionych dań – makaronów, zapiekanek i sałatek.','bob-konserwowy-rolnik-400g','','','','Bób konserwowy “Rolnik” 400g','','','',''),
