(1383,1,1,'','Miękkie kostki dyni w kwaśno-słodkiej marynacie octowej z goździkami. Marynowana dynia jest wspaniałym dodatkiem do dań mięsnych, do sałatek, do sosów, serów, wędlin oraz jako samodzielna przekąska.','dynia-w-occie-dabrowka-360g','','','','Dynia w occie “Dąbrówka” 360g','','','',''),
(1384,1,1,'','DYNIA DESEROWA WIÓREK, to pokrojone kawałeczki dyni zanurzone w octowej zalewie z przyprawami. Posiada delikatny ,subtelny, słodko-kwaśny smak, którym można cieszyć zarówno latem jak i zimą. Polecamy ją jako dodatek do deserów, sałatek, pieczonego mięsa i sushi. Doskonale smakuje także jako samodzielna przekąska.','dynia-deserowa-wiorek-240ml','','','','Dynia deserowa “Wiórek” (240ml)','','','',''),
(1385,1,1,'Składniki: dynia, woda, cukier, ocet spirytusowy, przeciwutleniacz: kwas askorbinowy, przyprawy.Wartość odżywcza w 100 g:<br />Wartość energetyczna 362 kJ<br />Wartość energetyczna 85 kcal<br />Tłuszcz &lt;0,5 g<br />w tym kwasy tłuszczowe nasycone &lt;0,1 g<br />Węglowodany 18 g<br />w tym cukru 14 g<br />Białko 0,8 g<br />Sól &lt;0,01 g','Dynia deserowa Rolnik – warzywo, królujące w polskich kuchniach głównie jesienią, pozwoli Ci cieszyć się swoją subtelną słodyczą niezależnie od pory roku. Każdy słoik skrywa elegancko pokrojoną, dojrzałą dynię, zanurzoną w delikatnej, cukrowej zalewie, która odpowiada za jej miękkość i słodki smak. Dynia jest niskokaloryczna, obfituje w błonnik, witaminy, sole mineralne i beta-karoten. To wyśmienity dodatek do sałatek, ciast i deserów, a samodzielnie – pyszna i zdrowa przekąska.','dynia-deserowa-premium-rolnik-314ml','','','','Dynia deserowa premium “Rolnik” (314ml)','','','',''),
(1386,1,1,'Zawartość soli	0,5 g<br />Zawartość tłuszczów &lt;0,5<br />Zawartość węglowodanów 8,3 g<br />Zawartość węglowodanów(cukry) 8,4 g','Lekko pikantna surówka, przyrządzona z gotowanych, polskich buraków ćwikłowych, utartych z dodatkiem aromatycznego chrzanu, octu, cukru i soli. Ćwikła gości zarówno na świątecznym, jak i codziennym stole, doskonale komponując się z różnymi rodzajami wędlin, pasztetami, rybami i jajkami. Jest obowiązkowym, warzywnym dodatkiem do mięs, zwłaszcza w potrawach kuchni polskiej.','cwikla-z-chrzanem-rolnik-370ml','','','','Ćwikła z chrzanem “Rolnik” 370ml','','','',''),
(1387,1,1,'','Delikatny smak słodkich buraków w połączeniu z ostrym chrzanem to jeden z najpopularniejszych dodatków w kuchni polskiej. Ćwikła z chrzanem doskonale pasuje do wszelkich wędlin i dań mięsnych podkreślając tym samym ich wspaniały smak.','cwikla-z-chrzanem-nadwarcianskie-specjaly-220g','','','','Ćwikła z chrzanem „Nadwarciańskie Specjały” 220g','','','',''),
