(1390,1,1,'','Odkryj delikatny smak każdej Cebulki perłowej Rolnik, zanurzonej w lekkiej, octowej marynacie, która zapewnia im doskonałą chrupkość i słodycz. Malutkie, białe cebulki z połyskującą skórką, stanowią podstawę pięknie prezentujących się koreczków i fantazyjnych, zimnych płyt oraz wyrazisty dodatek do lekkich sałatek. Nadają się do przyrządzenia oryginalnej salsy pomidorowej.','cebulka-perlowa-rolnik-314ml','','','','Cebulka Perłowa “Rolnik” 314ml','','','',''),
