(1438,1,1,'','Kimchi należy do najzdrowszych przekąsek na świecie. Kimchi mild to łagodna, kiszona propozycja wzbogacona o kurkumę. Jest naturalnym probiotykiem, wspomaga i reguluje trawienie. Jedzenie kimchi działa przeciwzapalnie i przeciwbakteryjnie, wzmacniając odporność organizmu. Zawartość czosnku, imbiru i kurkumy nadaje orientalny charakter przekąsce, która potrafi być uzależniająca. To wersja również dla vegan oraz osób, które wykluczają gluten ze swojej diety.','kimchi-z-kurkuma-runoland-300g','','','','Kimchi z kurkumą ,,Runoland” 300g','','','',''),
(1439,1,1,'Zawartość soli 	0,5 g<br />Wielkość porcji	100 g<br />Zawartość tłuszczów  &lt;0,5<br />Zawartość węglowodanów 	3,7 g<br />Zawartość węglowodanów 	5 g','Chrupiące i delikatne Kiełki fasoli Mung Rolnik, zanurzone w łagodnej, słodko-kwaskowatej marynacie, to znany przysmak kuchni chińskiej i wietnamskiej oraz doskonały dodatek do sałatek, makaronów i wiosennych kanapek. Smakują zarówno surowe, jak i po zapieczeniu – zwłaszcza w potrawach azjatyckich. Kiełki fasoli Mung stanowią bogate źródło białka, witamin, minerałów, błonnika oraz nienasyconych kwasów tłuszczowych.','kielki-fasoli-mung-rolnik-370ml','','','','Kiełki fasoli Mung “Rolnik” 370ml','','','',''),
