(1441,1,1,'Wartość energetyczna 254 kJ / 61 kcal<br />Tłuszcz	5,2 g<br />w tym kwasy tłuszczowe nasycone	1,6 g<br />Węglowodany 2,3 g<br />w tym cukry 1,5 g<br />Białko	1,7 g<br />Sól 2,0 g','Oryginalne, włoskie Karczochy w oleju Rolnik, wprowadzą do Twojej kuchni jeden z ulubionych przysmaków starożytnych Greków i Rzymian, obfitujący w witaminy i minerały. Serca wyselekcjonowanych, młodych karczochów pokrojono w ćwiartki i zanurzono w oleju słonecznikowym, w towarzystwie octu winnego i aromatycznych przypraw. Swoją wykwintnością, karczochy wzbogacą smak sałatek, zapiekanek, makaronów i pizzy.','karczochy-cwiartki-w-oleju-rolnik-290g','','','','Karczochy ćwiartki w oleju “Rolnik” 290g','','','',''),
