(1445,1,1,'','Konserwowa fasola czerwona słynie z bogatej zawartości białka i wysokich walorów smakowych. Wyśmienicie komponuje się z rozmaitymi sałatkami, sosami, zapiekankami i daniami mięsnymi. Jest symbolem kuchni meksykańskiej i hiszpańskiej, obowiązkowym dodatkiem do chili con carne, tortilli oraz oryginalnego, węgierskiego gulaszu.','fasola-czerwona-rolnik-400g','','','','Fasola czerwona „Rolnik” 400g','','','',''),
(1446,1,1,'Składniki: fasola czarna ziarno, woda, sól.Wartość odżywcza w 100 g:<br />Wartość energetyczna 436 kJ<br />Wartość energetyczna 104 kcal<br />Tłuszcz 0,6 g<br />w tym kwasy tłuszczowe nasycone &lt;0,1 g<br />Węglowodany 14,6 g<br />w tym cukry 0,1 g<br />Błonnik 5,6 g<br />Białko 7,1 g<br />Sól 0,73 g','Fasola black kidney Rolnik to podstawowy składnik kuchni meksykańskiej. Przyrządzisz z niej m.in. tradycyjne chili con carne i burrito oraz wiele potraw wegetariańskich i wegańskich – zupy, pasty, kotlety czy bezglutenowe ciasta. Idealnie jędrne, czarne ziarna doskonale pasują do sałatek. Fasola jest cennym źródłem białka, błonnika, cynku, miedzi, przeciwutleniaczy, kwasów tłuszczowych omega-3 oraz witamin A i B.','fasola-czarna-rolnik-400g','','','','Fasola czarna “Rolnik” 400g','','','',''),
(1447,1,1,'Składniki: fasola biała, woda, sól, przeciwutleniacz: kwas askorbinowy.Wartość odżywcza w 100 g:<br />Wartość energetyczna 525 kJ<br />Wartość energetyczna 125,6 kcal<br />Tłuszcz 0,8 g<br />w tym kwasy tłuszczowe nasycone 0 g<br />Węglowodany 20,1 g<br />w tym cukry 0,5 g<br />Białko 7,1 g<br />Sól 0,19 g','Fasola biała konserwowa Rolnik wprowadzi do Twojego jadłospisu jedną z najzdrowszych i najbardziej pożywnych roślin strączkowych. Każda puszka skrywa delikatne w smaku, dorodne i jędrne ziarna, zanurzone w lekkiej zalewie. Biała fasola konserwowa pozwoli Ci szybko stworzyć wiele sycących dań – bez moczenia i gotowania. Przyrządzisz z niej fasolkę po bretońsku, zupę fasolową, barszcz ukraiński, rozmaite sałatki oraz wiele potraw kuchni meksykańskiej.','fasola-biala-rolnik-400g','','','','Fasola Biała “Rolnik” 400g','','','',''),
