(1449,1,1,'','Sos Sriracha jest stosunkowo rzadkim sosem o żywoczerwonej barwie, przebijającej intensywnością ketchup. W oficjalnej skali pikantności mierzonej jednostkami SHU (z ang. Scoville Heat Units, czyli jednostki ostrości Scoville) oscyluje na poziomie 1000-2500. Przypomnijmy, że tyle właśnie mają surowe papryczki poblano.','sos-sriracha-280g','','','','Sos Sriracha 280g','','','',''),
