(1451,1,1,'','Tajski sos o klasycznym słodko kwaśnym smaku stosowany powszechnie w kuchni azjatyckiej. Połączenie przyjemnego lekko pikantnego i kwaśnego smaku sprawia, że już odrobina sosu nadaje potrawom wyjątkowego smaku. Jeżeli lubisz orientalne klimaty to ten sos jest pozycją obowiązkową. To także doskonały dip do przekąsek.','sos-slodko-kwasny-thai','','','','Sos słodko kwaśny ,,Thai”','','','',''),
