(1453,1,1,'Składniki: sok z żurawiny 100% odtworzony z zagęszczonego sokuBez dodatku cukru. Zawiera naturalnie występujące cukry. Pojawienie się osadu jest zjawiskiem naturalnym. Wstrząsnąć przed spożyciem. Produkt pasteryzowany.Sok z żurawiny to bogactwo witamin przede wszystkim witaminy C, ale także A i E oraz witamin z grupy B. Obecnych jest w nim również wiele minerałów jak wapń, magnez, potas i żelazo oraz przeciwutleniaczy.','Wartość odżywcza produktu','sok-z-zurawiny-100-naturo-300ml','','','','Sok z żurawiny 100% ,,Naturo” 300ml','','','',''),
