(1458,1,1,'','Autentyczny tajski sos o przyjemnym słodkim smaku. To nieskończenie wiele pomysłów na pyszne dania z mięs, ryb, drobiu i warzyw. Odrobina słodkiego sosu dodana do potrawy sprawia, że nabiera ona autentycznego orientalnego smaku i aromatu. Tajski sos chilli jest znakomitym dipem do imprezowych przekąsek. Z powodzeniem zastępuje zwykły ketchup. Doskonała propozycja na każdą okazję.','sos-chilli-slodki-thai-200ml','','','','Sos chilli słodki ,,thai” 200ml','','','',''),
