(1474,1,1,'Składniki – woda, mąka pszenna, mięso 15% (wieprzowina, wołowina), teksturat białka sojowego, cebula smażona (cebula, olej rzepakowy), bułka tarta (mąka pszenna, drożdże, sól), sól, olej rzepakowy, przyprawy, substancja konserwująca: sorbinian potasu, aromaty.Może zawierać mleko, siarczyny, seler, gorczycę.Wartość odżywcza w 100 g produktu: Wartość energetyczna 898 kJ / 214 kcal; Tłuszcz 8,5 g, w tym kwasy tłuszczowe nasycone 2,6 g; Węglowodany 23 g, w tym cukry 1,4 g; Białko 10 g; Sól 1,3 g.','Dawniej przygotowywane wyłącznie z okazji świąt, nazywane wówczas “kurnikami” ze względu na jeden ze składników farszu – mięso drobiowe. Dziś pierogi z mięsem, z gamy produktów Firmy Grześkowiak to szybki sposób na smaczny i tradycyjny obiad.','pierogi-z-miesem-grzeskowiak-400g','','','','Pierogi z mięsem “Grześkowiak” 400g','','','',''),
(1475,1,1,'Składniki – mąka pszenna, kapusta kwaszona 27% (kapusta biała, sól), woda, cebula smażona (cebula, olej rzepakowy), pieczarki 4%, olej rzepakowy, bułka tarta (mąka pszenna, drożdże, sól), sól, aromaty, ekstrakt drożdżowy, cukier, substancja konserwująca – sorbinian potasu, pieprz czarny, marchew suszona, pietruszka nać.Może zawierać MLEKO, SOJĘ, SIARCZYNY, SELER, GORCZYCĘ.Wartość odżywcza w 100 g produktu: Wartość energetyczna 641 kJ / 152 kcal; Tłuszcz 3,5 g, w tym kwasy tłuszczowe nasycone 0,4 g; Węglowodany 24 g, w tym cukry 1,9 g; Białko 4,4 g; Sól 1,1 g.','Pierogi z kapustą i grzybami są znane w Polsce już od XIII wieku, przypuszczalnie przywędrowały do nas z Dalekiego Wschodu. Bogactwo lasu i ogrodu zamknięte w cieście w kształcie półksiężyca. Tradycyjnie polski farsz, przygotowany z kapusty kiszonej z dodatkiem grzybów, nadaje pierogom Grześkowiak smak, któremu nie oprze się nawet najbardziej wyrafinowane podniebienie.','pierogi-z-kapusta-i-grzybami-grzeskowiak-400g','','','','Pierogi z kapustą i grzybami “Grześkowiak” 400g','','','',''),
