(1479,1,1,'','Zwany potocznie miodem tysiąca kwiatów, pszczoły wytwarzają z nektarów zebranych z wielu roślin miododajnych kwitnących na polach, w sadach, lasach na łąkach w tym samym czasie. Miód z kwiatów wiosennych ma jasny kolor, przyjemny zapach i łagodny smak. Miód z nektaru kwiatów letnich jest znacznie ciemniejszy i ma bardziej zdecydowany smak oraz zapach. Dzięki łatwo przyswajalnym cukrom prostym wspomaga mięsień sercowy.','miod-wielokwiatowy-pl-400g','','','','Miód Wielokwiatowy PL (400g)','','','',''),
