(1482,1,1,'','Ogórki z czosnkiem to połączenie smaku tradycyjnych, perfekcyjnie przyrządzonych ogóreczków konserwowych z polskim marynowanym czosnkiem. Dzięki temu połączeniu ogórki smakują wyjątkowo i zachwycają wyrazistym charakterem. Idealne jako dodatek zarówno do kanapek, jak i dań na gorąco.','ogorek-czosnkowy-nadwarcianskie-specjaly-640g','','','','Ogórek czosnkowy „Nadwarciańskie Specjały” 640g','','','',''),
(1483,1,1,'','Skład: ogórki (42%), woda, cukier, ocet, cebula, sól, przyprawa do grilla, koper, gorczyca, natka pietruszki, papryka, kurkuma, curry.','nadwarcianskie-koreczki-zakaskowe-nadwarcianskie-specjaly-640g','','','','Nadwarciańskie koreczki zakąskowe „Nadwarciańskie Specjały” 640g','','','',''),
(1484,1,1,'Wartość energetyczna kJ/kcal 117/28<br />Tłuszcz g 0,3<br />w tym kwasy tłuszczowe nasycone g 0,06<br />Węglowodany ogółem g 7,7<br />w tym cukry g 2,1<br />Białko g 1,3<br />Sól g 0,01','Mus z dyni w postaci przetartej, półpłynnej masy. Zawiera tylko dynię, bez żadnych przypraw, dzięki temu każdy będzie mógł zdecydować do czego wykorzystać oraz jak przyprawić mus z dyni. Do musu możemy dodać takie przyprawy jak cynamon, gałkę muszkatołową, imbir, przyprawy korzenne. Wspaniale smakuje z jabłkiem lub pomarańczą.','mus-z-dyni-dabrowka-680g','','','','Mus z dyni “Dąbrówka” 680g','','','',''),
(1485,1,1,'','Marchew z groszkiem to dobrze znany w polskiej kuchni, wyśmienity duet smakowy, uzyskany przez połączenie zielonego groszku i pokrojonej w drobną kostkę marchewki. Dzięki delikatnej, słodko-słonej zalewie, warzywa zyskują idealną kruchość i soczystość oraz apetyczny wygląd.','mieszanka-dwuskladnikowa-edmal-820g','','','','Mieszanka dwuskładnikowa ,,Edmal” 820g','','','',''),
(1486,1,1,'','Gęsty i kremowy sos na bazie majonezu z dodatkiem ogórków, pieczarek, gorczycy i musztardy. Delikatnie ostry. Sprawdzi się świetnie jako dodatek do jaj.','sos-tatarski-nadwarcianskie-specjaly-220g','','','','Sos tatarski ,,Nadwarciańskie Specjały” 220g','','','',''),
(1487,1,1,'','Korzeń chrzanu (52%), woda, cukier, olej roślinny rzepakowy, regulator kwasowości – kwas cytrynowy, sól, mleko w proszku, substancja konserwująca – pirosiarczyn sodu.','chrzan-tarty-victus-160g','','','','Chrzan tarty ,,Victus” 160g','','','',''),
(1488,1,1,'','Marchew z groszkiem Rolnik to dobrze znany w polskiej kuchni, wyśmienity duet smakowy, uzyskany przez połączenie zielonego groszku i pokrojonej w drobną kostkę marchewki. Dzięki delikatnej, słodko-słonej zalewie, warzywa zyskują idealną kruchość i soczystość oraz apetyczny wygląd.','marchew-z-groszkiem-rolnik-460g','','','','Marchew z groszkiem ,,Rolnik” 460g','','','',''),
(1489,1,1,'Wartość energetyczna	151 kJ/36 kcal<br />Tłuszcz	&lt;0,5 g<br />w tym kwasy tłuszczowe nasycone	0,2 g<br />Węglowodany 5,0 g<br />w tym cukry 4,0 g<br />Białko	1,6 g<br />Sól 0,92 g','Dojrzewająca w słońcu Tajlandii, specjalna odmiana miniaturowej kukurydzy, którą zanurzono w delikatnej marynacie na bazie octu i cukru. Dzięki unikalnej recepturze, każda, malutka kolba jest idealnie złocista, słodka i chrupiąca. Komponuje się z potrawami kuchni orientalnej i meksykańskiej. Stanowi także wyborny dodatek do sałatek, sosów i zup.','kukurydza-mini-kolby-rolnik-290g','','','','Kukurydza mini kolby “Rolnik” 290g','','','',''),
(1490,1,1,'Wartość energetyczna:w 100:<br />wartość energetyczna: 180 kJ/43 kcal, tłuszcz: 2,0 g, w tym kwasy tłuszczowe nasycone: 0,2 g, węglowodany: 4,9 g, w tym cukry: 0,8 g, białko: 0,9 g, sól: 1,3 g.','Zupa cebulowa jest bardzo aromatyczna, gęsta i sycąca – a tak prosta do przygotowania! Zupa cebulowa Dworek to świetne rozwiązanie, kiedy nie masz czasu na gotowanie, ale chcesz zjeść wartościowy, domowy posiłek. Zupa cebulowa powstaje według sprawdzonej receptury, z najlepszej cebuli, ziemniakówi wody źródlanej z własnego ujęcia. Zupa cebulowa Dworek nie zawiera GMO i konserwantów.','zupa-cebulow-dworek-680g','','','','Zupa cebulow ,,Dworek” 680g','','','',''),
(1491,1,1,'','KONCENTRAT POMIDOROWY WIÓREK wyprodukowany wyłącznie ze świeżych, dojrzałych pomidorów. Przygotowany wg specjalnej receptury posiada gęstą konsystencję, zachowując przy tym bardzo pomidorowy i aromatyczny smak. Koncentrat to doskonały dodatek w kuchni polskiej zwłaszcza do sosów, zup i bigosu. Może także zastąpić ketchup na kanapkach.','koncentrat-pomidorowy-wiorek-200g','','','','Koncentrat pomidorowy “Wiórek” 200g','','','',''),
(1492,1,1,'SKŁAD: ogórki kiszone 23%, woda źródlana, ryż 10%, marchew 5%, cebula, olej rzepakowy, sól, przyprawy aromatyczno smakowe: koper suszony.<br />Na zakładzie używany jest gluten oraz gorczyca.WARTOŚĆ ODŻYWCZA W 100 g<br />Wartość energetyczna: 51 kcal/213 kJ;<br />Tłuszcz: 1,2g;<br />w tym nasycone kwasy tłuszczowe: 0,1 g;<br />Węglowodany: 8,4g;<br />w tym cukry: 0g;<br />Białko: 1,1g;<br />Sól: 1,3g','Przyrządzona na bazie świeżych i kwaszonych warzyw, tłuszczu roślinnego oraz przypraw. Zupa jest półpłynna, zawiera kawałki warzyw. Idealna na rozgrzewający obiad, zwłaszcza na jesienne dni i wieczory.','zupa-ogorkowa-dworek-680g','','','','Zupa ogórkowa “Dworek” 680g','','','',''),
(1493,1,1,'','Zwany potocznie miodem tysiąca kwiatów, pszczoły wytwarzają z nektarów zebranych z wielu roślin miododajnych kwitnących na polach, w sadach, lasach na łąkach w tym samym czasie. Miód z kwiatów wiosennych ma jasny kolor, przyjemny zapach i łagodny smak. Miód z nektaru kwiatów letnich jest znacznie ciemniejszy i ma bardziej zdecydowany smak oraz zapach. Dzięki łatwo przyswajalnym cukrom prostym wspomaga mięsień sercowy.','miod-pszczeli-wielokwiatowy-100-pl-400g','','','','Miód pszczeli wielokwiatowy 100% (PL) 400g','','','',''),
(1494,1,1,'','Zwany potocznie miodem tysiąca kwiatów, pszczoły wytwarzają z nektarów zebranych z wielu roślin miododajnych kwitnących na polach, w sadach, lasach na łąkach w tym samym czasie. Miód z kwiatów wiosennych ma jasny kolor, przyjemny zapach i łagodny smak. Miód z nektaru kwiatów letnich jest znacznie ciemniejszy i ma bardziej zdecydowany smak oraz zapach. Dzięki łatwo przyswajalnym cukrom prostym wspomaga mięsień sercowy.','miod-pszczeli-wielokwiatowy-100-pl-700g','','','','Miód pszczeli Wielokwiatowy 100% (PL) 700g','','','',''),
(1495,1,1,'SKŁADNIKI<br />ziemniaki 30%, woda źródlana, marchew 16%, kapusta biała 10%, groszek zielony 3%, cebula 3%, por 3%, pietruszka, olej roślinny, koncentrat pomidorowy 30 % w ilości 0,4% , przyprawy naturalne: koper suszonyWARTOŚCI ODŻYWCZE W 100 g:<br />Wartość energetyczna: 138 kJ / 33 kcal,<br />tłuszcz: 1,2 g, w tym kwasy tłuszczowe nasycone: 0 g,<br />węglowodany: 3,5 g, w tym cukry: 0 g,<br />białko: 1,3 g,<br />sól: 1,3 g','Z połączenia ziemniaków, marchewki, białej kapusty, zielonego groszku, cebuli, pora i pietruszki, podkreślonych smakiem pomidorów, powstaje zupa w tradycyjnym stylu. Zupa jarzynowa Dworek sprawdzi się jako pożywny obiad dla całej rodziny, gotowy w kilkanaście minut. Wyrazistości zupie dodają naturalne przyprawy.','zupa-jarzynowa-dworek-680g','','','','Zupa jarzynowa “Dworek” 680g','','','',''),
(1496,1,1,'','Miód rzepakowy jest bogaty w wartości odżywcze. W jego składzie, można znaleźć dużo aminokwasów i witamin z grupy K, B i C, magnez, żelazo, potas, różne olejki eteryczne. Zawiera on także bor, czyli pierwiastek, który jest konieczny do budowania tkanki kostnej oraz prawidłowego funkcjonowania śledziony i tarczycy. Miód rzepakowy powinny spożywać kobiety po okresie menopauzy, kiedy narażone są na utarte masy kostnej.  Stosowany jest w chorobach: serca, wątroby, dolegliwościach reumatycznych, niedokrwistości i schorzeniach żołądka. Polecany w stanach wyczerpania psychofizycznego i ogólnym osłabieniu.','miod-rzepakowy-pl-400g','','','','Miód Rzepakowy PL (400g)','','','',''),
(1497,1,1,'','Przez wielu konsumentów uznawany jest za najlepszy i najcenniejszy pośród miodów. Swą wielowiekową renomę zawdzięcza szerokiemu wykorzystaniu kwiatu lipy w medycynie ludowej.','miod-pszczeli-lipowy-100-pl-400g','','','','Miód pszczeli Lipowy 100% (PL) 400g','','','',''),
(1498,1,1,'','','miod-pszczeli-kremowany-100-pl-400g','','','','Miód pszczeli Kremowany 100% (PL) 400g','','','',''),
(1499,1,1,'','Miód malinowy jest niezwykle rzadko spotykany i pozwól, że powiemy Ci dlaczego. Jak pewnie się domyślasz, jest to miód nektarowy, co oznacza, że powstaje z kwiatów – a w tym przypadku, z kwiatów malin. Maliny nie kwitną zbyt długo, pszczoły nie mają więc zbyt dużo czasu w roku, aby zebrać niezbędny do wytworzenia miodu pyłek. Dlatego też miód malinowy to prawdziwy rarytas! Jest pyszny (słodki, lekko kwaskowy), o wyjątkowej barwie i ma mnóstwo prozdrowotnych właściwości.','miod-malinowy-usza-1kg','','','','Miód Malinowy “USZA” (1kg)','','','',''),
(1500,1,1,'','Przez wielu konsumentów uznawany jest za najlepszy i najcenniejszy pośród miodów. Swą wielowiekową renomę zawdzięcza szerokiemu wykorzystaniu kwiatu lipy w medycynie ludowej.','miod-lipowy-pl-400g','','','','Miód Lipowy PL (400g)','','','',''),
(1501,1,1,'','Miód gryczany jest najbardziej charakterystycznym miodem, którego przez swój ostro-słodki smak, intensywny zapach oraz ciemną barwę przypominającą kolor gorzkiej herbaty nie można pomylić z żadnym innym.','miod-gryczany-pl-400g','','','','Miód Gryczany PL (400g)','','','',''),
(1502,1,1,'Wartość energetyczna	370 kJ/90 kcal<br />Tłuszcz / w tym: 10,0 g<br />– kwasy nasycone 0,8 g<br />– jednonienasycone 6,6 g<br />– wielonienasycone 2,7 g<br />Węglowodany 0 g<br />– w tym cukry 0 g<br />Białko	0 g<br />Sól 0 g<br />Witamina E* [mg] 2,5<br />Witamina K* [µg] 7,5<br />Kwasy Omega 3	0,8 g	8,0 g','Pozyskiwany ze starannie wyselekcjonowanych nasion rzepaku bez GMO. To źródłem kwasów omega 3, witamin E i K, naturalnie występujących w nasionach rzepaku. Wydobywa smak potraw i polecany jest do stosowania zarówno na ciepło (do smażenia, pieczenia) jak i na zimno (np. do sałatek).','olej-kujawski-05l','','','','Olej „Kujawski” 0,5l','','','',''),
(1503,1,1,'Wartość energetyczna 3607 kJ/ 862 kcal<br />Tłuszcz 100 g<br />w tym kwasy<br />tłuszczowe nasycone 86,5 g<br />Węglowodany 0 g<br />w tym cukry 0 g<br />Białko 0 g<br />Sól 0 g','Olej kokosowy, zwany również masłem lub tłuszczem kokosowym, uważany jest za najzdrowszy olej na świecie. Dzięki zawartości unikalnych kwasów tłuszczowych posiada on wiele właściwości leczniczych i prozdrowotnych. Można go zaliczyć do tzw. super żywności, której substancje odżywcze kompleksowo zadbają o prawidłowe funkcjonowanie organizmu.','olej-kokosowy-rafinowany-bio-vita-natura-200ml','','','','Olej kokosowy rafinowany BIO “Vita Natura” 200ml','','','',''),
(1504,1,1,'Wartości odżywcze w 100g:<br />Kcal: 900<br />Tłuszcze: 7.6<br />W tym kwasy tłuszczowe nasycone: 7.6','Źródło cennych wartości odżywczych, w tym kwasów omega-3 oraz witamin E i K. Polecany jest do smażenia i pieczenia ze względu na wysoką stabilność. Ciemna butelka chroni zawartość przed niekorzystnym działaniem światła.','olej-3-ziarna-kujawski-750ml','','','','Olej 3 ziarna „Kujawski” 750ml','','','',''),
(1505,1,1,'','Migdały zostały okrzyknięte Królem Orzechów, gdyż stanowią ich najszlachetniejszą odmianę. Lista ich zdrowotnych właściwości jest naprawdę długa. Są bogatym źródłem wielu witamin, takich jak witamina B, która odpowiada za prawidłowe funkcjonowanie wzroku oraz witaminy B3 odpowiedzialnej za prace serca i układu nerwowego. Zawierają także magnez, który pozwala przezwyciężyć stres i zmęczenie. Wzmacniają odporność, poprawiają koncentracje oraz chronią przed zawałem. Zawarty w nich cynk pozwala nam zadbać o nasze paznokcie i skórę. Są także idealną przekąską dla osób będących na diecie, gdyż regulują przemianę materii i zapobiegają odkładaniu się tłuszczu. Regularne spożywanie migdałów prowadzi do poprawy kondycji zarówno fizycznej jak i psychicznej. Jeśli pragniesz zachować zdrowie i piękny wygląd koniecznie dodaj je do swojego codziennego jadłospisu!','migdaly-luskane-japar-100g','','','','Migdały łuskane ,,Japar” 100g','','','',''),
(1506,1,1,'','Tradycyjne pomidory marynowane żółte oraz czerwone. Słoiki z najlepszymi odmianami pomidorów zawsze będą przypominać o kolorowym lecie i będą wspaniałym dodatkiem do wszelkich świątecznych i codziennych potraw.','marinated-yellow-and-red-tomatoes-dworek-860g','','','','Marinated yellow and red tomatoes “Dworek” (860g)','','','',''),
(1507,1,1,'','Marchew z groszkiem to dobrze znany w polskiej kuchni, wyśmienity duet smakowy, uzyskany przez połączenie zielonego groszku i pokrojonej w drobną kostkę marchewki. Dzięki delikatnej, słodko-słonej zalewie, warzywa zyskują idealną kruchość i soczystość oraz apetyczny wygląd. Mieszankę można podawać jako dodatek do rozmaitych mięs – na zimno, zamiast tradycyjnej surówki lub na ciepło, po uduszeniu z masłem i mąką.','marchew-z-groszkiem-rolnik-500ml','','','','Marchew z groszkiem „Rolnik” 500ml','','','',''),
(1508,1,1,'','Mak biały, podobnie jak mak niebieski zawiera mnóstwo cennych składników odżywczych. Jego smak jest jednak nieco delikatniejszy i słodszy niż smak jego ciemniejszej wersji. Idealnie sprawdzi się w cukiernictwie – na jego bazie można przygotować przepyszne Rogale Świętomarcińskie z masą makową, dodać do kutii – podstawowego świątecznego dania, a nawet wykorzystać do przygotowania potraw z makaronem lub ryżem.','mak-bialy-japar-250g','','','','Mak biały ,,Japar” 250g','','','',''),
(1509,1,1,'','Groch jest jedną z najstarszych roślin strączkowych uprawianych na świecie. Jego ziarna występują pod różną postacią: całe w łupinie, wyłuskane i tzw. połówki. Groch jest uznawany za ciężkostrawny, ale przy odpowiedniej asekuracji przypraw, takich jak majeranek czy kminek, możemy zneutralizować uczucie ciężkości i cieszyć się smakiem np. pysznej, gęstej grochówki lub kremu z zielonego groszku. Warto też wspomnieć, że te małe ziarenka zawierają mnóstwo błonnika, który usprawnia pracę jelit, a także obniża poziom cukru i ciśnienia we krwi. Jego zaletą jest także niski indeks glikemiczny, co jest szczególnie ważne dla osób cierpiących na cukrzycę.','groch-luskany-caly-japar-500g','','','','Groch łuskany cały ,,Japar” 500g','','','',''),
(1510,1,1,'','Na świecie uprawia się ponad 400 gatunków fasoli. Jest popularnym składnikiem wielu dań, takich jak kapusta z fasolą, zupa fasolowa, barszcz, fasolka po bretońsku czy meksykańsku, a także produktem świetnie przyswajającym witaminy A, E, K i D. Posiada dobroczynny wpływ na wątrobę, jelita i trzustkę. Zawiera mnóstwo białka roślinnego, dużo zdrowszego niż białko zwierzęce. Posiada również właściwości wzmacniające serce i chroniące przed zawałem. Kolejną zaletą  jest także  cena, ponieważ niewielkim kosztem możesz zapewnić sobie mnóstwo zdrowia.','fasola-jas-karlowy-japar','','','','Fasola Jaś karłowy ,,Japar”','','','',''),
(1511,1,1,'','Suszone daktyle świetnie sprawdzą się jako słodka przekąska. To także znakomity dodatek do ciast, deserów i muesli. Są bogate w błonnik, potas i wytaminy z grupy B.','daktyle-suszone-japar-opak-250g','','','','Daktyle suszone ,,Japar” opak. 250g','','','',''),
(1512,1,1,'','Kukurydza konserwowa – naturalnie słodka, doskonale chrupiąca o apetycznym, złocistym kolorze. Dzięki niej przyrządzisz niezliczone rodzaje sałatek, zup, sosów i dań jednogarnkowych – zwłaszcza kuchni meksykańskiej i bezglutenowej.','kukurydza-konserwowa-rolnik-425ml','','','','Kukurydza konserwowa „Rolnik” 425ml','','','',''),
(1513,1,1,'','Sady w rodzinie Ambroży są od pokoleń. Aby móc cieszyć się smakiem ulubionych warzyw i owoców powstały w 100% naturalne przetwory owocowo-warzywne, które są z nich stworzone.','papryka-konserwowa-pan-sadownik-900ml','','','','Papryka konserwowa “Pan Sadownik” 900ml','','','',''),
(1514,1,1,'','Oliwki te mają charakterystyczny, wydłużony kształt, zielony naturalny kolor, doskonały smak i aromat dodatkowo podkręcony marynatą ziołową. Greckie zielone oliwki Chalkidiki zbierane są na przełomie września/października, a potem konserwowane/kiszone w wodzie z solą morską i dodatkiem oliwy.','oliwki-zielone-hutesa-140g','','','','Oliwki zielone ,,Hutesa” 140g','','','',''),
(1515,1,1,'','Miód wrzosowy możemy stosować w naszej kuchni na wiele różnych sposobów. Stanowi on doskonały dodatek do rozgrzewającej herbaty, domowych lodów oraz koktajli owocowych. Doskonały dodatek do pieczywa, owsianki i musli. Może być składnikiem dressingów i marynat.','miod-pszczeli-wrzosowy-100-pl-400g','','','','Miód pszczeli Wrzosowy 100% (PL) 400g','','','',''),
(1516,1,1,'','Składniki: ogórki, woda, ocet spirytusowy, cukier, sól, papryka (1%), przyprawy (zawierają gorczycę)','ogorki-z-chilli-rolnik-650g','','','','Ogórki z chilli “Rolnik” 650g','','','',''),
(1517,1,1,'Składniki: ogórki, woda, ocet spirytusowy, cukier, sól, przyprawy (zawierają gorczycę).Wartości odżywcze 100 g:<br />Wartość energetyczna 111 kJ<br />Wartość energetyczna 26 kcal<br />Tłuszcz &lt;0,5 g<br />w tym kwasy tłuszczowe nasycone &lt;0,1 g<br />Węglowodany 5,3 g<br />w tym cukry 3,7 g<br />Białko 0,8 g<br />Sól 0,90 g','Ogórki konserwowe Rolnik zostały przygotowane z wyselekcjonowanych, dużych i twardych ogórków, pochodzących z polskich upraw. Doskonałą jędrność i tradycyjny, słodko-kwaśny smak, zawdzięczają octowej marynacie, pełnej aromatycznych przypraw. Ogórki konserwowe Rolnik to wyrazisty, warzywny dodatek do dań obiadowych, częsty składnik sałatek i koreczków oraz niezastąpiona przekąska podczas każdej imprezy. Duży słoik pozwoli Ci spełnić jeszcze więcej kulinarnych fantazji!','ogorki-konserwowe-rolnik-900ml','','','','Ogórki konserwowe “Rolnik” 900ml','','','',''),
(1518,1,1,'Składniki:ogórek (45%), woda źródlana, musztarda (6%) (woda, ocet spirytusowy, gorczyca, cukier, sól, przyprawy), cukier, ocet spirytusowy, sól, przyprawy: papryka słodka, liśc laurowy, ziele angielskie, marchew, kurkuma.<br />Wartość odżywcza100 g:wartość energetyczna: 168 kJ/40 kcal, tłuszcz: 0,45 g, w tym kwasy tłuszczowe nasycone: 0 g, węglowodany: 8,5 g, w tym cukry: 5,6 g, białko: 0,6 g, sól: 1,3 g.','Ogórki kanapkowe Dworek to starannie dobrane, pokrojone w długie plasterki warzywa wysokiej jakości, zanurzone w aromatycznej zalewie na bazie źródlanej wody, musztardy oraz przypraw, w ładnym słoiku. Ogórki kanapkowe Dworek świetnie pasują do kanapek, hot-dogów, zapiekanek i burgerów, można dodać je do sałatki lub podać w formie przekąski lub jako dodatek do dania głównego.','ogorki-kanapkowe-dworek-720g','','','','Ogórki kanapkowe “Dworek” (720g)','','','',''),
(1519,1,1,'','Zielona świeżość i czerwona ostrość tworzą kompozycję niezapomnianą. W tradycyjnej recepturze ich przygotowania nie ma miejsca na fałszywe nuty, a apetyt, z jakim znikają z półmisków na domowych przyjęciach nie pozostawiają złudzeń- to ogórkowe mistrzostwo gatunku.','ogorek-z-chilii-nadwarcianskie-specjaly-640g','','','','Ogórek z chilii „Nadwarciańskie Specjały” 640g','','','',''),
(1520,1,1,'Składniki:ogórek (45%), woda źródlana, musztarda (woda, ocet spirytusowy, gorczyca, cukier, sól, przyprawy), cukier, ocet spirytusowy, sól, przyprawy: papryka słodka, liść laurowy, ziele angielskie, kurkuma.<br />Wartość odżywczaw 100 g:wartość energetyczna: 168 kJ/40 kcal, tłuszcz: 0,45 g, w tym kwasy tłuszczowe nasycone: 0 g, węglowodany: 8,5 g, w tym cukry: 5,6 g, białko: 0,6 g, sól: 1,3.g.','Ogórki po kozacku Dworek to starannie dobrane, świeże ogórki, zanurzone w przygotowanej według specjalnej receptury octowej zalewie z dodatkiem musztardy, cukru, soli oraz innych aromatycznych ziół i przypraw. Ogórki po kozacku Dworek można podać jako dodatek do dania głównego, są także świetnym pomysłem na smaczną i prostą zakąskę. Ogórki kozackie sprawdzą się również jako składnik przystawek, kanapek, kanapeczek, zapiekanek, pizzy lub sałatek.','ogorek-po-kozacku-dworek-720g','','','','Ogórek po kozacku “Dworek” (720g)','','','',''),
(1521,1,1,'','Przez wielu konsumentów uznawany jest za najlepszy i najcenniejszy pośród miodów. Swą wielowiekową renomę zawdzięcza szerokiemu wykorzystaniu kwiatu lipy w medycynie ludowej.','miod-pszczeli-lipowy-100-pl-700g','','','','Miód pszczeli Lipowy 100% (PL) 700g','','','',''),
(1522,1,1,'','Konfitura Poziomkowa “Wiórek”, to wyśmienite i bardzo aromatyczne poziomki zanurzone w delikatnym syropie w małym słoiczku , którego nie powinno zabraknąć w domowej spiżarni. Konfitura poziomkowa skrywa w sobie niepowtarzalny smak i aromat dojrzałych , soczystych, jędrnych poziomek ,która przypomni zimą smak ciepłego i słonecznego lata. Nasza konfitura została przygotowana według tradycyjnej ,domowej receptury i sprawdzi się zwłaszcza jako dodatek do tostów oraz kanapek z białym serkiem . Podgrzana na ciepło jest doskonałym dodatkiem do pucharka lodów a jesienno-zimową porą nada się do kubka gorącej herbaty.','poziomka-konfitura-wiorek-200g','','','','Poziomka konfitura “Wiórek” 200g','','','',''),
(1523,1,1,'','Powidła śliwkowe węgierkowe “Wiórek” zostały przygotowane według tradycyjnej receptury babci właściciela przetwórni. Jędrne i dojrzałe owoce poddane klasycznemu wysmażeniu są absolutnie niezastąpionym dodatkiem do wyrobów cukierniczych zwłaszcza pączków i staropolskiego piernika. Smakują wyśmienicie na chrupiącej grzance oraz podawane do naleśników zachwycą swoim smakiem dzieci oraz dorosłych.','powidla-sliwkowe-wegierkowe-wiorek-280ml','','','','Powidła śliwkowe węgierkowe “Wiórek” 280ml','','','',''),
(1524,1,1,'','POWIDŁA WĘGIERKOWE EKO 240 ml, to tradycyjny smak powideł kuchni polskiej sporządzone według starej receptury naszych babć. Wysokiej jakości i dobrze wyselekcjonowane owoce pochodzące z ekologicznych sadów zostały poddane klasycznemu wysmażeniu z dodatkiem cukru trzcinowego. Polecamy nasze powidła zwłaszcza jako nadzienie do wypieków, pierników i pączków ale także doskonale smakują z pajdą świeżego chleba lub naleśnikami.','powidla-sliwkowe-eko-wiorek','','','','Powidła śliwkowe EKO „Wiórek”','','','',''),
(1525,1,1,'','Spożywane bezpośrednio stanowią znakomitą przekąskę. Sprawdzą się także jako dodatek do dań głównych. Obniżają poziom złego cholesterolu we krwi i mają niski indeks glikemiczny.','migdaly-luskane-japar-opak-100g','','','','Migdały łuskane ,,JAPAR” opak. 100g','','','',''),
(1526,1,1,'Wartość Energetyczna	3404 kJ<br />Wartość Energetyczna	828 kcal<br />Tłuszcz w tym:	92 g<br />Kwasy nasycone	11 g<br />Jednonienasycone 24 g<br />Wielonienasycone 57 g<br />Węglowodany	0 g<br />w tym cukry:	0 g<br />Błonnik	0 g<br />Białko	0 g<br />Sól 0 g<br />Witamina E 5 mg','Olej z pestek winogron jest źródłem cennej witaminy E. Posiada neutralny smak i zapach dzięki czemu podkreśla naturalne właściwości potraw i nie nadaje tłustego posmaku.','olej-z-pestek-winogron-monini-500ml','','','','Olej z pestek winogron „Monini” 500ml','','','',''),
(1527,1,1,'','','nadwarcianska-pigwa-w-syropie-nadwarcianskie-specjaly-290g','','','','Nadwarciańska pigwa w syropie “Nadwarciańskie Specjały” 290g','','','',''),
(1528,1,1,'SKŁAD:<br />Maliny, woda, cukier. Produkt pasteryzowany.WARTOŚĆ ODŻYWCZA W 100g:<br />Wartość energetyczna: 429kJ/101kcal<br />Tłuszcz: 0,1g<br />Węglowodany: 23,3g (w tym cukry 23,3g)<br />Białko: 0,3g<br />Sól: 0,0021g','Dzięki malinom w syropie możemy cieszyć się ich smakiem nie tylko latem. To świetny dodatek do deserów, potraw na słodko oraz do dekoracji ciast i tortów. Gorąca herbata z dodatkiem miodu i malin w syropie to idealny pomysł na zimowy wieczór.','nadwarcianske-maliny-w-syropie-nadwarcianskie-specjaly-230g','','','','Nadwarciańske maliny w syropie “Nadwarciańskie Specjały” 230g','','','',''),
(1529,1,1,'','','nadwarcianska-jagoda-w-syropie-nadwarcianskie-specjaly-290g','','','','Nadwarciańska jagoda w syropie “Nadwarciańskie Specjały” 290g','','','',''),
(1530,1,1,'','Sady w rodzinie Ambroży są od pokoleń. Aby móc cieszyć się smakiem ulubionych warzyw i owoców powstały w 100% naturalne przetwory owocowo-warzywne, które są z nich stworzone.','mus-jablkowy-pan-sadownik-350ml','','','','Mus jabłkowy “Pan Sadownik” 350ml','','','',''),
(1531,1,1,'','Takie wiśnie idealnie sprawdzają się zimową porą do ciast i deserów, a nawet dań na słodko. Syrop z wiśni po rozcieńczeniu to prawdziwy rarytas','wisnie-drylowane-w-syropie-szpichlerz-280g','','','','Wiśnie drylowane w syropie ,,Szpichlerz” 280g','','','',''),
(1532,1,1,'','SYROP WIŚNIOWY 200 ml, to połączenie soku z wiśni i cukru. W syropie wiśniowym zachowaliśmy oryginalny , owocowy smak. Nasz produkt doskonale nadaje się jako dodatek do herbaty oraz jako polewa do lodów i innych deserów. Polecamy go także do picia po rozcieńczeniu z wodą.','syrop-wisniowy-wiorek-200ml','','','','Syrop wiśniowy „Wiórek” 200ml','','','',''),
(1533,1,1,'','SYROP Z MALIN WIÓREK 200 ml, to tradycyjny, owocowy smak i zamach kojarzący się z dzieciństwem. To niezastąpiony dodatek do herbat szczególnie w jesienno-zimowe dni oraz przy przeziębieniach. Polecamy także do picia po rozcieńczeniu z wodą oraz jako dodatek do napojów i deserów.','syrop-malinowy-wiorek-200ml','','','','Syrop malinowy „Wiórek” 200ml','','','',''),
(1534,1,1,'','Mak niebieski, często zwany makiem czarnym, jest wykorzystywany głównie w kuchni, szczególnie w cukiernictwie. Na naszych stołach króluje przede wszystkim w święta w postaci przepysznych makowców i strucli makowych. Oprócz tego, że wspaniale komponuje się z bakaliami, jest także źródłem witamin rozpuszczalnych w tłuszczach (A, D, E, K). Zawiera pierwiastki mineralne takie jak żelazo, miedź, mangan, magnez, fosfor i cynk. Jest również bogaty w błonnik, który poprawia perystaltykę jelit. Niestety, ze względu na dużą zawartość tłuszczu, jest dość kaloryczny.','mak-japar-400g','','','','Mak ,,Japar” 400g','','','',''),
(1535,1,1,'','Podstawa wielu wypieków, produkt niezbędny w każdej kuchni. Oczyszczone nasiona, wymagają odpowiedniego przygotowania, czyli sparzenia i zmielenia.','mak-japar-opak-400g','','','','Mak ,,JAPAR” opak. 400g','','','',''),
(1536,1,1,'Miąższ awokado jest popularny w kuchni jako składnik sałatek, dipów, kanapek, sushi i wielu innych potraw.','Miąższ awokado to miękka i kremowa część owocu awokado, która znajduje się pod twardą skórką. Miąższ awokado ma delikatny, łagodny smak i jest bardzo bogaty w zdrowe tłuszcze, przede wszystkim jednonienasycone kwasy tłuszczowe. Jest również źródłem błonnika, witamin (takich jak witamina K, witamina E, witaminy z grupy B) oraz minerałów, w tym potasu.','miazsz-awokado-500g','','','','Miąższ Awokado 500g','','','',''),
(1537,1,1,'','Nadwarciańskie Specjały poznały sekret doskonałego przyrządzania ogórków konserwowych i pielęgnuje swoją unikalną recepturę. Najlepszej jakości ogórki oraz odpowiednie proporcje wody, cukru, octu i gorczycy sprawiają, że smakują one wyjątkowo. Ogórki konserwowe są doskonałe zarówno jako przystawka, jak i składnik dania głównego.','ogorek-konserwowy-nadwarcianskie-specjaly-640g','','','','Ogórek konserwowy “Nadwarciańskie Specjały” 640g','','','',''),
(1538,1,1,'','Pokrojone w cienkie plastry ogórki, zanurzone w specjalnej słodko kwaśnej zalewie. Dzięki temu zaraz po wyjęciu ze słoika są wspaniałym urozmaiceniem kanapek, przekąsek. Ogórki kanapkowe świetnie smakują również jako samodzielna przystawka.','ogorek-kanapkowy-nadwarcianskie-specjaly-640g','','','','Ogórek kanapkowy „Nadwarciańskie Specjały” 640g','','','',''),
(1539,1,1,'','Mandarynki w puszcew lekkim syropie MK są gotowym dodatkiem do bitej śmietany, lodów, koktajli, deserów i domowych ciast. Syrop zawierający dużo soku mandarynkowego po rozcieńczeniu z wodą stanowi smaczny orzeźwiający napój podobny do kompotu.','mandarynki-w-lekkim-syropie-mk-312g','','','','Mandarynki w lekkim syropie ,,MK” 312g','','','',''),
(1540,1,1,'','Maliny w syropie znajdowały się zawsze w podręcznej apteczce naszych babek i prababek, gdyż świetnie zwalczały gorączkę, działały napotnie, antybakteryjnie, przeciwwirusowo i przeciwzapalnie.','maliny-w-syropie-szpichlerz-280g','','','','Maliny w syropie ,,Szpichlerz” 280g','','','',''),
(1541,1,1,'','Konfitura z truskawek – wyjątkowa, lokalna, robiona domowym, babcinym sposobem konfitura ze słodkich i pachnących truskawek. Wspaniała do śniadania, gofrów, naleśników, ciast czy prosto z łyżeczki.','konfitura-z-truskawek-nadwarcianskie-specjaly-280g','','','','Konfitura z truskawek “Nadwarciańskie Specjały” 280g','','','',''),
(1542,1,1,'','KOMPOT TRUSKAWKOWY WIÓREK 900 ml, to pyszny , naturalny napój przyrządzony według tradycyjnej receptury z najsmaczniejszych polskich , słodkich truskawek . Ten aromatyczny kompot to przysmak szczególnie dzieci. Polecamy go także jako dodatek do deserów, koktajli oraz słodkich dań przyrządzonych na własny sposób.','kompot-truskawkowy-wiorek-09l','','','','Kompot truskawkowy “Wiórek” 0.9l','','','',''),
(1543,1,1,'','KOMPOT WIŚNIOWY WIÓREK 900 ml, to naturalny napój przygotowany według starej ,rodzinnej receptury na bazie dojrzałych, soczystych owoców pochodzących z wielkopolskich sadów . Nasz kompot polecamy do obiadu zarówno na zimno jak i na ciepło. W jesienno-zimowe dni przypomni smak słonecznego i ciepłego lata.','kompot-wisniowy-wiorek-09l','','','','Kompot wiśniowy „Wiórek” 0,9l','','','',''),
(1544,1,1,'','KOMPOT AGRESTOWY WIÓREK 900 ml, to owocowy , naturalny napój przygotowany według tradycyjnej , rodzinnej receptury na bazie dojrzałego, polskiego agrestu. Nasz kompot jest kwaskowaty i jednocześnie słodki w smaku . Polecamy go jako orzeźwiający napój latem , a zimą doskonale smakuje podgrzany. Owoce agrestu można także dodać do ciast i deserów.','kompot-agrestowy-wiorek-09l','','','','Kompot Agrestowy “Wiórek” 0,9l','','','',''),
(1545,1,1,'','Syrop z cytryn to idealny dodatek do herbaty – szczególnie w chłodniejszych porach roku. Ale i latem doskonale komponuje się z domową ice tea.','cytryny-w-syropie-z-wanilia-szpichlerz-260g','','','','Cytryny w syropie z wanilia ,,Szpichlerz” 260g','','','',''),
(1546,1,1,'','Syrop z cytryn to idealny dodatek do herbaty – szczególnie w chłodniejszych porach roku. Ale i latem doskonale komponuje się z domową ice tea.','cytryny-w-syropie-z-cynamonem-szpichlerz-260g','','','','Cytryny w syropie z cynamonem ,,Szpichlerz” 260g','','','',''),
(1547,1,1,'','Skład: ','cytrynka-w-plynie-rolnik-200ml','','','','Cytrynka w płynie “Rolnik” 200ml','','','',''),
(1548,1,1,'Składniki: brzoskwinie, woda, cukier, regulator kwasowości: kwas cytrynowy, przeciwutleniacz: kwas askorbinowy.Wartość odżywcza w 100 g:<br />Wartość energetyczna 255 kJ<br />Wartość energetyczna 61 kcal<br />Tłuszcz 0 g<br />w tym kwasy tłuszczowe nasycone 0 g<br />Węglowodany 15 g<br />w tym cukry 9,2 g<br />Białko 0,3 g<br />Sól 0 g','W naturalnej, słodkiej zalewie, zanurzono wyselekcjonowane, dojrzałe i dorodne owoce, które zyskały idealną miękkość, jędrność oraz intensywny kolor. Brzoskwinie w syropie doskonale komponują się z deserami, lodami, ciastami, sałatkami i koktajlami. Pozwalają pięknie udekorować serniki i tory. Stanowią także słodkie zwieńczenie codziennych obiadów.','brzoskwinie-w-syropie-rolnik-850ml','','','','Brzoskwinie w syropie “Rolnik” 850ml','','','',''),
(1549,1,1,'Wartość energetyczna:<br />125 kJ / 36 kcal<br />Tłuszcz: 1,7 g<br />w tym kwasy tłuszczowe nasycone: 0,3 g<br />Węglowodany: 1,3 g,<br />w tym cukry 0,5 g<br />Błonnik: 1,0 g<br />Białko: 3,5 g<br />Sól: 0,05 g','Napój roślinny na bazie soi.','napoj-sojowy-bio-zen-1l','','','','Napój sojowy ,,Bio Zen” 1l','','','',''),
(1550,1,1,'Wartość energetyczna 230 kJ / 54 kcal Tłuszcz 1 g w tym kwasy tłuszczowe nasycone 0,1 g Węglowodany 11 g w tym cukry 6 g Błonnik 0,3 g Białko 0,2 g Sól 0,1 g Wapń 120 mg','Roślinna alternatywa mleka na bazie lekkostrawnego ryżu bez dodatku cukru. Źródłem naturalnej słodyczy smaku jest ryż, a sam napój jest też źródłem wapnia potrzebnego do utrzymania zdrowych kości. Ryżowe świetnie sprawdza się do picia solo, ale jako składnik koktajli i shake’ów radzi sobie równie dobrze. Wydobywa i podkreśla ich smak oraz wzbogaca je o dodatkowe wartości odżywcze.','napoj-ryzowy-inka-1l','','','','Napój ryżowy ,,Inka” 1l','','','',''),
(1551,1,1,'','Oliwki Kalamata wyróżniają się kształtem – podłużna „łezka” i kwaskowo-goryczkowym smakiem. Szlachetność oliwki kalamata podkreślamy tym, że pestka jest mała, łatwo odchodzi od miąższu a tego miąższu jest dużo.','oliwki-czarne-hutesa-140g','','','','Oliwki czarne ,,Hutesa” 140g','','','',''),
(1552,1,1,'W 100 ml<br />Wartość energetyczna 186 kJ / 44 kcal<br />Tłuszcz 1,1 g<br />w tym kwasy nasycone 0,2 g<br />Węglowodany 7,6 g<br />w tym cukry 4,4 g<br />Błonnik 0,5 g<br />Białko 0,7 g<br />Sól 0,10 g<br />Wapń 120 mg<br />Witamina E 1,80 mg<br />Witamina B6 0,21 mg<br />Witamina B2 0,21 mg<br />Witamina A 120 µg 15%<br />Kwas foliowy 30 µg<br />Witamina D 0,75 µg<br />Witamina B12 1,25 µg','Doskonała roślinna alternatywa mleka na bazie owsa dla tych, co lubią łączyć przyjemność smaku z dobrymi nawykami. Nie zawiera dodatku cukru, jest źródłem wapnia i witamin. Idealnie sprawdza się dolane do owsianki, do kawy oraz do picia solo. Wszechstronne zastosowanie Owsianego czyni ten napój roślinny uniwersalnym, a jednocześnie wyjątkowym. Tajemnica tkwi w smaku, konsystencji i w subtelnym zbożowym aromacie.','napoj-owsiany-inka-1l','','','','Napój owsiany ,,Inka” 1l','','','',''),
(1553,1,1,' Wartość odżywcza Wartości odżywcze w 100g Wartość energetyczna 56 kJ / 14 kcal Tłuszcz 1,2 g w tym kwasy tłuszczowe nasycone 0,1 g Węglowodany 0,1 g w tym cukry 0 g Błonnik 0,4 g Białko 0,4 g Sól 0,12 g Wapń 120 mg','Roślinna alternatywa mleka o subtelnym, orzechowym smaku dla tych, którzy wiedzą, że tajemnica udanej zmiany nawyków żywieniowych tkwi w przyjemności smaku. Wiele możliwości zastosowania, brak cukru i niska kaloryczność sprawia, że Migdałowe jest idealnym wyborem dla osób dbających o linię i ceniących sobie wyjątkowe walory smakowe.','napoj-migdalowy-inka-1l','','','','Napój migdałowy ,,Inka” 1l','','','',''),
(1554,1,1,'Wartość odżywcza w 100 ml<br />Wartość energetyczna 19 kcal<br />Tłuszcz	0,9 g<br />w tym kwasy nasycone 0,8 g<br />Węglowodany 2,6 g','Roślinna alternatywa mleka o rajskim smaku dla tych, którzy uśmiechają się na myśl o urlopie i wiedzą jak łączyć przyjemność z dobrymi nawykami. Kokosowe doskonale sprawdza się do śniadania, obiadu, czy kolacji. Jest idealnym składnikiem dań na słodko i wytrawnie. Perfekcyjnie łączy się z innymi smakami, czyniąc przygotowywane danie niepowtarzalnym w smaku i aromacie. Kokosowe to niskokaloryczny, niezawierający cukru napój roślinny wzbogacony wapniem oraz witaminami B12 i D.','napoj-kokosowy-inka-1l','','','','Napój kokosowy ,,Inka” 1l','','','',''),
(1555,1,1,'','Mleko kokosowe pozyskiwane jest z miąższu orzecha kokosowego. Napój powstaje za pomocą procesu moczenia orzecha kokosowego w wodzie, następnie jego ogrzanie i odciśnięcie. Mleko kokosowe posiada konsystencję płynną lub kremową – w zależności od ilości użytego kokosa w czasie wyrabiania','mleko-kokosowe-400ml','','','','Mleko kokosowe 400ml','','','',''),
(1556,1,1,'','Ocet ryżowy doskonale sprawdza się również jako składnik sosów, które są dodatkiem np. do duszonych warzyw, ryb, czy mięsa. Poza tym możesz używać go do marynowania warzyw. Ocet ryżowy dobrze łączy się z innymi przyprawami charakterystycznymi dla kuchni azjatyckiej.','ocet-ryzowy-mr-ming-150-ml','','','','Ocet ryżowy ,,Mr. Ming” 150 ml','','','',''),
(1557,1,1,'','Ten produkt spożywczy o wyrazistym smaku i zapachu dodaje charakteru potrawom, dlatego doprawia się nim sałatki, pasty i sosy. Stosowany jest również do marynowania mięs czy grzybów. Czysty ocet jabłkowy obciąża układ pokarmowy i drażni śluzówkę, dlatego zaleca się spożywanie go w formie rozcieńczonej.','ocet-jablkowy-daveley-500ml','','','','Ocet jabłkowy ,,Daveley” 500ml','','','',''),
(1558,1,1,'Wartości odżywcze w 100 g<br />Wartość energetyczna 257,5 kJ/61,6 kcal<br />Tłuszcz	0,3 g<br />w tym kwasy tłuszczowe nasycone	0,03 g<br />Węglowodany 14 g<br />w tyn cukry 7 g<br />Białko	0,3 g<br />Sól 0 g','Produkt otrzymany ze świeżych, przetartych owoców. Jedyne składniki to jabłka i cukier. Bez konserwantów, barwników, wypełniaczy. Świetna alternatywa dla niezdrowych słodyczy. Tworzy świetne połączenie z naleśnikami, plackami ziemniaczanymi, goframi, lodami. Pasuje także do owsianki, ryżu i innych deserów.','przecier-jablkowy-dabrowka-900g','','','','Przecier jabłkowy “Dąbrówka” 900g','','','',''),
(1559,1,1,'Składniki: oliwki zielone nadziewane 61% (oliwki zielone 50%, migdały 11%), woda, ocet winny, sól, regulator kwasowości: kwas cytrynowy, kwas mlekowy.Wartość odżywcza w 100 g:<br />Wartość energetyczna 809 kJ<br />Wartość energetyczna 196 kcal<br />Tłuszcz 19 g<br />w tym kwasy tłuszczowe nasycone 2,2 g<br />Węglowodany 2,2 g<br />w tym cukry 1,6 g<br />Białko 3,8 g<br />Sól 2,8 g','Oliwki zielone z migdałami Rolnik to wykwintny przysmak, pochodzący wprost ze słonecznej Grecji – kraju drzew oliwnych. Każdy słoik skrywa wyselekcjonowane, największe okazy świeżo zebranych oliwek, nadziewanych migdałami i skąpanych w delikatnej zalewie solankowej. Oliwki zielone z migdałami Rolnik to przede wszystkim wyśmienita, śródziemnomorska przekąska, królująca na zimnych płytach oraz wysublimowany dodatek do sałatek i makaronów.','oliwki-zielone-z-migdalami-rolnik-314ml','','','','Oliwki zielone z migdałami “Rolnik” 314ml','','','',''),
(1560,1,1,'Wartości odżywcze w 100 g<br />Wartość energetyczna 63 kJ/15kcal<br />tłuszcz	0,2 g<br />w tym kwasy tłuszczowe nasycone	0,04 g<br />Węglowodany 3,6 g<br />w tym cukry 0,1 g<br />białko	0,9 g<br />sól 0,02 g','Otrzymywany z przetartych, świeżych pomidorów. Jest to czysty przecier w postaci przetartej, półpłynnej masy. Naturalny, gęsty i aromatyczny. Nie zawiera żadnych dodatków, soli, konserwantów, zagęstników, barwników, stabilizatorów. Dzięki temu każdy może doprawić i użyć przecieru według własnego gustu. Docenią go osoby nieużywające w kuchni przypraw, osoby które ze względów zdrowotnych muszą ograniczyć spożycie soli a także diabetycy.','przecier-pomidorowy-dabrowka-860g','','','','Przecier pomidorowy “Dąbrówka” 860g','','','',''),
(1561,1,1,'Wartość energetyczna 49kj/11,70kcal<br />tłuszcz 0,5g<br />w tym kwasy tłuszczowe nasycone 0,10g<br />węglowodany 1,4g<br />w tym cukry 0,20g<br />błonnik 0,60g<br />białko 0,7g<br />sól 1,80g','PRZECIER OGÓRKOWY WIÓREK 370 ml (grubo tarty) to tradycyjny smak domowych kiszonych ogórków, przetarte na tarce o grubych oczkach, polecamy do przyrządzenia zarówno zupy ogórkowej, jak i sałatek warzywnych.','przecier-ogorkowy-wiorek-330g','','','','Przecier ogórkowy „Wiórek” 330g','','','',''),
(1562,1,1,'','Skład: przetarte ogórki kwaszone (99%) (ogórki, woda, sól, koper, chrzan, czosnek, przyprawy w tym gorczyca). Może zawierać seler.','przecier-ogorkowy-nadwarcianskie-specjaly-290g','','','','Przecier ogórkowy „Nadwarciańskie Specjały” 290g','','','',''),
(1563,1,1,'Wartość odżywcza w 100 g: wartość energetyczna: 1881 kcal/457 kJ, tłuszcz: 47 g, w tym kwasy tłuszczowe nasycone: 3,2 g, węglowodany: 3,1 g, w tym cukry: 2,5 g, białko: 1,5 g, sól: 1,3 g.','Suszone pomidory to wyśmienita przekąska oraz przepyszny, słodko-kwaśny dodatek do rozmaitych potraw, sałatek, kanapek i pizzy, którym nadaje ziołowo-czosnkowego aromatu. Dzięki tradycyjnej marynacie na bazie octu winnego i oleju roślinnego, pomidory są idealnie miękkie i soczyste.','pomidory-suszone-w-oleju-rolnik-280g','','','','Pomidory suszone w oleju „Rolnik” 280g','','','',''),
(1564,1,1,'','Swój oryginalny i niepowtarzalny smak zawdzięczają doskonałej kompozycji przypraw oraz dodatkiem papryki, kopru włoskiego czy chrzanu. Są one doskonałym dodatkiem do dań obiadowych, kanapek, sałatek a także jako przekąska.','ogorek-kaszubski-nadwarcianskie-specjaly-640g','','','','Ogórek kaszubski „Nadwarciańskie Specjały” 640g','','','',''),
(1565,1,1,'Składniki: pieczarki (45%), woda, marchew, cebula, cukier, ocet spirytusowy, sól, przyprawy – zawierają gorczycę, regulator kwasowości: kwas cytrynowy, przeciwutleniacz: pirosiarczyn sodu.Wartość odżywcza w 100 g:Wartość energetyczna 126 g<br />Tłuszcz &lt;0,5 g<br />w tym kwasy tłuszczowe nasycone &lt;0,1 g<br />Węglowodany 3,4 g<br />w tym cukry 2,5 g<br />Białko 2 g<br />Sól 1,50 g','Pieczarki marynowane Rolnik to słoik pełen jasnokremowych, małych i jędrnych grzybków, zanurzonych w delikatnej, octowej marynacie ze świeżymi warzywami i mieszanką aromatycznych przypraw. Marynowane pieczarki są wyśmienitą przekąską, składnikiem kolorowych sałatek i koreczków oraz dodatkiem do rozmaitych potraw, które wzbogacają o charakterystyczny, słodko-kwaśny akcent. Twoje ulubione Pieczarki marynowane Rolnik znajdziesz także w większych słoikach.','pieczarki-marynowane-rolnik-370ml','','','','Pieczarki marynowane “Rolnik” 370ml','','','',''),
(1566,1,1,'Wartość odżywcza w 100g<br />Wartość energetyczna 126kj/30kcal<br />tłuszcz 0,3g<br />w tym kwasy tłuszczowe nasycone 0g<br />węglowodany 4,7g<br />w tym cukry 4,1g<br />białko 0.9g<br />sól 1,1g','','patisony-konserwowe-dworek-670g','','','','Patisony konserwowe ,,Dworek” 670g','','','',''),
(1567,1,1,'Składniki: żurawina (49%), woda, cukier, substancja zagęszczająca: E 1422, syrop glukozowo – fruktozowy, koncentrat czarnej marchwi, regulator kwasowości: kwas cytrynowy, przeciwutleniacz: kwas askorbinowy, aromat żurawiny.Wartości odżywcze 100 g 50 g na porcję Składniki:<br />Wartość energetyczna 507 kJ<br />Wartość energetyczna 119 kcal<br />Tłuszcz 0 g<br />w tym kwasy tłuszczowe nasycone 0 g<br />Węglowodany 29 g<br />w tym cukry 22 g<br />Białko 0 g<br />Sól 0,01 g','Żurawina cała Rolnik to tradycyjna, słodko-cierpka konfitura, którą sporządzamy ze świeżo zerwanych, najdorodniejszych owoców. Pozwoli Ci na realizację mięsno-owocowych, kulinarnych fantazji, znanych w naszej kuchni od wieków. Żurawina obfituje w błonnik, witaminy i sole mineralne. Stanowi wyśmienity dodatek do mięs i serów. Jest obowiązkową pozycją na świątecznym stole. Wzbogaca codzienne posiłki o wykwintny i niebanalny akcent.','zurawina-cala-rolnik-300g','','','','Żurawina cała “Rolnik”  (300g)','','','',''),
(1568,1,1,'','Koncentraty oraz przeciery, są idealnymi propozycjami do tworzenia sosów oraz zup. Natomiast passata dobrze komponuje się z makaronem oraz jako dodatek do gołąbków.','passata-pomidorowa-bionaturo-690g','','','','Passata pomidorowa ,,BioNaturo” 690g','','','',''),
(1569,1,1,'Wartość energetyczna 175 kJ / 42 kcal<br />Tłuszcz	2,5 g<br />w tym kwasy tłuszczowe nasycone	1,2 g<br />Węglowodany 3,2 g<br />w tym cukry 3,1 g<br />Białko	0,6 g<br />Sól 1,7 g','Oryginalna, macedońska papryka smażona bez skórki, to aromatyczny przysmak kuchni bałkańskiej oraz baza dla różnorodnych potraw, past i sosów, których wiodącą nutą smakową jest goryczkowa słodycz czerwonej papryki. Smażona na oleju słonecznikowym papryka, wzbogaca smak makaronów, dań z ryżu, sałatek, kanapek i grillowanych warzyw. Jest także wyśmienitym, warzywnym dodatkiem do mięs, smaczną przekąską i składnikiem kolorowych koreczków.','papryka-smazona-rolnik-290g','','','','Papryka smażona “Rolnik” 290g','','','',''),
(1570,1,1,'Wartość energetyczna :<br />109,0kj/26,0kcal<br />białko 0,55g<br />tłuszcz całkowity 0,04g<br />węglowodany 5,65g','Papryka konserwowa Wiórek to dojrzałe i bardzo mięsiste płaty polskiej , czerwonej papryki zanurzone w słodko-kwaśnej , octowej zalewie z przyprawami. Naszą paprykę polecamy jako samodzielną przekąskę lub jako dodatek do różnych potraw , kanapek i koreczków.','papryka-konserwowa-wiorek-500g','','','','Papryka konserwowa „Wiórek” 500g','','','',''),
(1571,1,1,'','Papryka konserwowa natomiast dobrze komponuje się ze śledziem, ogórkiem kiszonym, gotowanym burakiem i ziemniakiem co daje nam ciekawą propozycje na zimowy stół, gdy brak świeżych warzyw.','papryka-konserwowa-rolnik-650g','','','','Papryka konserwowa ,,Rolnik” 650g','','','',''),
(1572,1,1,'Skład:<br />sól morska, maltodekstryna*, skrobia kukurydziana*, masło shea*, warzywa (cebula 1,8%*, marchew 1,7% *, por 1,7%*, pomidory 1,2% *, papryka 1,2% *, seler 1,1% *, czosnek 0,7%*), olej słonecznikowy*, ekstrakt z drożdży, przyprawy*,  zioła* (liście selera), karmelizowany cukier*.<br />* produkty pochodzące z kontrolowanych, certyfikowanych upraw ekologicznych','Kostki rosołowe warzywne to kompozycja ekologicznych ziół i przypraw polecana do przyrządzania zup, rosołów, sosów, makaronów i innych potraw. Kostki nie zawierają glutaminianu sodu czy oleju palmowego. Z ich pomocą łatwo przygotujesz zdrową zupę dla całej rodziny.','bio-kostka-rosolowa-warzywna','','','','BIO Kostka rosołowa warzywna','','','',''),
(1573,1,1,'Wartość energetyczna 23kj/6kcal<br />tłuszcz 0,30g<br />w tym kwasy tłuszczowe nasycone 0,10g<br />węglowodany 0,50g<br />w tym cukry 0,40g<br />błonnik 0,0g<br />białko 0,20g<br />sól 0,76g','To gęsty i esencjonalny bulion o półpłynnej konsystencji, który doskonale podkreśli smak potraw. Unikalna receptura na bazie wolno gotowanego wywaru z kurczaka gwarantuje doskonały smak i aromat, a naturalny proces pasteryzacji zapewnia trwałość.','bulion-w-sloiku-drobiowy-winiary-160g','','','','Bulion w słoiku drobiowy „Winiary” 160g','','','',''),
