(1576,1,1,'Wartość energetyczna: 182 kJ / 43 kcal,<br />Tłuszcz: 1,2 g,<br />w tym kwasy nasycone: 0,2 g,<br />Węglowodany: 6,8 g,<br />w tym cukry: 3,9 g,<br />Błonnik: 0,8 g,<br />Białko: 0,9 g,<br />Sól: 0,10 g,','Roślinna alternatywa mleka stworzona na bazie topowego napoju Owsianego w smakowitej kakaowej odsłonie. Z dodatkiem kakao tworzy idealne połączenie pełne przyjemnego smaku.','napoj-owsiany-kakaowy-inka-500ml','','','','Napój owsiany kakaowy ,,Inka” 500ml','','','',''),
(1577,1,1,'Wartość energetyczna 113kj/27kcal<br />tłuszcz 0,8g<br />w tym kwasy tłuszczowe nasycone 0,1g<br />węglowodany 4,9g<br />w tym cukry 4,9g<br />białko 1,1g<br />sól 1,00g','SZCZAW KONSERWOWY WIÓREK 300 ml, to zmielone na przecier liście szczawiu z dodatkiem soli o kwaskowatym smaku. W 100 % naturalne, cenne źródło witamin i minerałów. Świetnie nadaje się do przyrządzenia tradycyjnej zupy szczawiowej.','szczaw-konserwowy-wiorek-270g','','','','Szczaw konserwowy „Wiórek” 270g','','','',''),
