(1579,1,1,'','Szparagi białe Rolnik to rarytas kuchni całego świata, w których przyrządzany jest na wiele sposobów.','szparagi-biale-konserwowe-rolnik-212ml','','','','Szparagi białe konserwowe ,,Rolnik” 212ml','','','',''),
(1580,1,1,'Składniki: szczaw, sól.Wartość odżywcza w 100 g:<br />Wartość energetyczna 107 kJ<br />Wartość energetyczna 26 kcal<br />Tłuszcz 0,8 g<br />w tym kwasy tłuszczowe nasycone &lt;0,1 g<br />Węglowodany 2,3 g<br />w tym cukry 0,5 g<br />Białko 1,1 g<br />Sól 2,0 g','Dzięki świeżo zebranym i zmielonym liściom polskiego Szczawiu Rolnik, szybko przyrządzisz tradycyjną, sycącą zupę szczawiową z ulubionymi dodatkami. Szczaw wzbogaci także smak sałatek, surówek, kanapek, sosów, past i omletów. Pasuje do ryb i mięs. Stanowi cenne źródło witamin, magnezu, wapnia, krzemu i żelaza. Produkt jest w 100% naturalny, doprawiony jedynie szczyptą soli. Posiada apetycznie zieloną barwę oraz intensywny, kwaskowaty smak.','szczaw-rolnik-315ml','','','','Szczaw “Rolnik” 315ml','','','',''),
(1581,1,1,'','Skład: liście szczawiu (95%), woda, sól. Może zawierać seler i gorczycę.','szczaw-konserwowy-nadwarcianskie-specjaly-280g','','','','Szczaw konserwowy „Nadwarciańskie Specjały” 280g','','','',''),
(1582,1,1,'','SOK Z BURAKÓW KISZONYCH WIÓREK 300 ml, to 100 % soku, otrzymany w wyniku naturalnego procesu kiszenia buraków czerwonych według tradycyjnej receptury, tłoczony, posiada charakterystyczny osad. Nasz sok polecamy do bezpośredniego spożycia, świetnie gasi pragnienie, dzięki swojemu delikatnie kwaskowatemu smakowi, może też być stosowany jako dodatek do zup np. barszczu, chłodnika .','sok-z-burakow-kiszonych-wiorek-300ml','','','','Sok z buraków kiszonych „Wiórek” 300ml','','','',''),
(1583,1,1,'Wartość energetyczna kJ/kcal 84/20<br />Tłuszcz g 0,1<br />w tym kwasy tłuszczowe nasycone g 0,02<br />Węglowodany ogółem g 6,5<br />w tym cukry g 3<br />Białko g 0,5<br />Sól g ≤ 1','Sok uzyskany z najlepszych, polskich buraków ukiszonych z dodatkiem soku z kiszonej kapusty i soli. Intensywna barwa i kwaśny smak sprawia że jest ciekawym i chętnie wybieranym napojem i dodatkiem do potraw. Może stanowić bazę do barszczu czerwonego.','sok-z-burakow-kiszonych-dabrowka-300g','','','','Sok z buraków kiszonych “Dąbrówka” 300g','','','',''),
(1584,1,1,'Składniki: soczewica, woda, sól, przeciwutleniacz: kwas askorbinowy.Wartość odżywcza w 100 g:<br />Wartość energetyczna 373 kJ<br />Wartość energetyczna 88 kcal<br />Tłuszcz &lt;0,5 g<br />w tym kwasy tłuszczowe nasycone 0 g<br />Węglowodany 12 g<br />w tym cukry 1 g<br />Białko 6,8 g<br />Sól 0,75 g','Soczewica konserwowa Rolnik wprowadzi do Twojej diety ziarna jednej z najbardziej wartościowych roślin strączkowych, uprawianej na świecie od zarania dziejów. Soczewica obfituje w białko, kwas foliowy, żelazo i wapń. Jest niskokaloryczna i bardzo sycąca. Stanowi wyśmienite wypełnienie pierogów. Możesz ją dodawać do zup, sałatek, makaronów i pasztetów. Doskonale komponuje się z sosem czosnkowym i przyprawami. Nie wymaga gotowania.','soczewica-lentils-rolnik-400g','','','','Soczewica Lentils “Rolnik” 400g','','','',''),
(1585,1,1,'Wartości odżywcze:<br />Wartości odżywcze w 100 g,<br />Wartość energetyczna 144 kJ,<br />Wartość energetyczna 34 kcal,<br />Tłuszcz &lt;0,5 g,<br />w tym kwasy tłuszczowe nasycone &lt;0,1 g,<br />Węglowodany 5,7 g,<br />w tym cukry 5,1 g,<br />Białko 0,8 g,<br />Sól 0,75 g','Dzięki idealnym proporcjom delikatnej, octowej zalewy, seler zachowuje swój charakterystyczny, korzenny smak, doskonałą jędrność oraz apetyczną, jasnokremową barwę. Jest soczysty i aromatyczny, w 100% naturalny. Cięty w kształtne, smakowite paski, stanowi niezastąpiony dodatek do rozmaitych sałatek i wyrazisty składnik zdrowych surówek obiadowych. Wzbogaca smak pizzy i kanapek.','seler-konserwowy-rolnik-370g','','','','Seler konserwowy „Rolnik” 370g','','','',''),
(1586,1,1,'Składniki: Ogórki kwaszone przetarte.Wartość odżywcza w 100 g:<br />Wartość energetyczna 49 kJ<br />Wartość energetyczna 12 kcal<br />Tłuszcz &lt;0,5 g<br />w tym kwasy tłuszczowe nasycone &lt;0,1 g<br />Węglowodany 1,4 g<br />w tym cukru 0 g<br />Białko 1,0 g<br />Sól 1,8 g','Przecier z ogórków kwaszonych Rolnik odkryje przed Tobą tradycyjny smak domowych ogórków, które dzięki dokładnemu przetarciu, można wykorzystać do błyskawicznego przyrządzenia przepysznej zupy ogórkowej, chłodnika oraz wielu warzywnych sałatek. Przecier z ogórków kwaszonych to jeden z ulubionych, polskich przetworów, który pozwoli Ci rozsmakować się w letnich potrawach niezależnie od pory roku.','przecier-z-ogorkow-kwaszonych-rolnik-315ml','','','','Przecier z ogórków kwaszonych “Rolnik” 315ml','','','',''),
(1587,1,1,'Wartości odżywcze w 100g:<br />Kcal:	22<br />Węglowodany:	3.3<br />Cukry:	3<br />Białko:	1.3<br />Sól:	0.02','Słodkie i mięsiste pomidory bez skórki, obfitujące w witaminy i minerały, zanurzone w gęstym soku pomidorowym. Dzięki pokrojeniu w kostkę, idealnie nadają się do przyrządzania sosów, past i sałatek. Doskonale smakują podane na zimno, jak również po zapieczeniu w rozmaitych potrawach.','pomidory-krojone-rolnik-400g','','','','Pomidory Krojone „Rolnik” 400g','','','',''),
(1588,1,1,'','Wąsoska Przekąska z papryką i cebulką to grubo krojone ogórki konserwowe, które świetnie pasują do niemal każdego dania . Chrupkie kawałeczki ogórków są świetnym składnikiem koreczków i sałatek, ale też mogą być samodzielną przekąską do kolacji czy zwykłej kanapki. Wąsoska Przekąska z papryką i cebulką jest już gotowa do podania. Wystarczy odkręcić słoik i już można cieszyć się porcją warzyw, które pysznie smakują.','wasoska-przekaska-z-papryka-i-cebulka-ogrodek-dziadunia-660g','','','','Wąsoska przekąska z papryką i cebulką „Ogródek Dziadunia” 660g','','','',''),
